(1, '<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); box-sizing: border-box !important; word-wrap: break-word !important;">国家汽车强制保险费与车船税</span></strong></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(0, 112, 192); box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;">私家车强制险：</span></strong></span><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;"> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><br style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; wor