nd-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">③自燃代号：Z &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">④不计免赔代号：M &nbsp; &nbsp; &nbsp; &nbsp;</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">⑤发动机特别损失险代号X &nbsp;</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;">交强险的特性：</span></strong></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">公益性、强制性、广泛性。设立交强险的目的是：让交通事故中的受害人得到及时有效的治疗。 强制性：强制承保，不能拒保。 广泛性：只要是机动车，都可以承保。（机动车包括摩托车，不包括电动车） 酒后驾车、故意撞人，交强险也理赔，目的是保护受害者，体现了公益性。当然遇到这种情况，保险公司会先垫付医疗费用，再立案调查情况，向司机追偿。 交强险不赔的情况：碰瓷的不赔。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;"></span><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">交强险特征：</strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;">分项赔偿原则（往下看） 浮动费率原则（第一年不出险，第二年费率下 调10%，最多下调30%，反之则反），奖优罚 劣原则。 &nbsp;</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); box-sizing: border-box !important; word-wrap: break-word !important;">交强险能解决哪些问题？</span></strong></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(0, 112, 192); box-sizing: border-box !important; word-wrap: break-word !important;">举例<span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">：</span></span></strong><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">车撞了树，只给车上了交强险。假定树不赔，那么，车的损失是否可以走理赔？</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(0, 112, 192); box-sizing: border-box !important; word-wrap: break-word !important;">答案<span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">：</span></span></strong><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">不赔，因交强险只理赔交通事故中的受害方，那么在这个例子里，受害方是树，不赔树的话，车辆损失就得不到任何保险补偿。 &nbsp;</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">再看个</span><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(0, 112, 192); box-sizing: border-box !important; word-wrap: break-word !important;">案例<span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">：</span></span></strong><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">一个捷达在后，奔驰在前，突然前面有交通事故，奔驰急刹车，捷达没刹住， 追尾了，把奔驰的保险杠给撞坏了。这倒霉催的，不过还好有车险。奔驰给4S店打电话问修车费，双方协商解决理赔问题。4S店回复奔驰，配件4万，要空运过来，国内没有这型号的配件。捷达车主心想4万不贵呀，光交强险就12万。结果傻眼了：交强险规定：事故中产生的财产损失，最多赔付2千。也就 是说，因为他只上了交强险，没有上商业三者 险，3.8万要等着捷达支付。 &nbsp; &nbsp;</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); box-sizing: border-box !important; word-wrap: break-word !important;">交强险的理赔最高限额是12.2万</span></strong><br style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;"/><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;">大家听了还挺高兴，还算不少啊，一般的车辆损失也就够了。不要高兴太早了，交强险还有个分项赔偿原则： &nbsp; &nbsp; &nbsp; &nbsp; 撞人致死：11万 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;撞人受伤：1万 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;交通事故产生的财产损失：2千。 这是在被保险人有责任时的赔偿。被保险人无责任时： 死亡伤残赔偿限额为1.1万， 医疗费1千， 财产100. 交强险累积赔付。意思是：一年的保险金额就这些，几次出险理赔金额要加一起算。超过了就自费。（开车还是小心为好，现在撞人致死 理赔11万，这年头11万能安抚被害人家属吗 ？没个30.50万能摆平吗？） 所以仅仅给车上了交强险，真正遇到事故时， 自己掏腰包的花费很昂贵。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;">商业险第三者险：</span></strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">行内有句话：没有商业三者险的车主，伤不起 。 有的人看到商业保险，商业车险，会有抵触情绪：商业保险是盈利性质的，不是福利，这很对。不过现在保险的理赔率也是很高的，特别是车险，理赔就是给车主的福利。 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">定义：商业三者险是保险公司为第三者的损失 承担责任的保险险种。第三者指的.除投保人 、被保险人、保险人以外的，因保险车辆发生 意外事故而遭受损失的第三方受害者。 &nbsp; &nbsp;</span></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(0, 112, 192); font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;">解析：</span></strong></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">1.第三者险是赔给第三者的，不包括自己家人。 有一个案例：一人在倒车时，经验不足，让家 人站在车后，加上技术不熟练，油门当刹车， 导致家人死亡，这种情况车险不能理赔。如果 是外人，可以理赔。这也是为了防止骗保，故 意伤害家人。 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">2.没有分项赔偿原则，有损就赔。 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">3.不累积保险金额，例如投保10万的三者，第一次出险理赔后， 第二次保险金额还是10万，不会因第一次理赔过而减去上一次赔偿的金额。 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">4. 商业三者险的保费： 一般在几百元，5万起，例如600左右保10万 ，800左右20万，1千左右30万。建议额度在 20万以上。少了确实到真正遇到事故时，作用微弱。遇到事故时顿时傻眼。（不出险的车 ，保费来年会下调10%,以下的保费为大致数额，保费和车型以及不出险优惠或出现了上涨的幅度有关。） 商业三者险在北京的理赔率相当高。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;">车损险：</span></strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">被保险人或其允许的驾驶员在驾驶保险车辆时发生保险事故，造成保险车辆受损，保险公司 在合理范围内予以赔偿。</span></span></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">车损险也就是针对车辆本身的损失投的保险。 不上车损险，附加险上不了。 较常见的车损：碰撞、倾覆（翻车）、自然灾害等（冰雹、暴雨、爆炸等等）。保费一般1千多保10万，和车辆型号价格有关，相当于一天3元。这项保险的理赔率也非常高。 &nbsp; &nbsp;</span></span></span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;">车上人员：</span></strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">负责赔偿保险车辆交通意外造成的本车人员伤 亡。 一名司机加四名乘客。一般每人保险金额1万到3万，保费40左右保险金额一万，，乘客一人20元左右保险金额一万，四人保费100到300左右。 建议车主，有了车上人员保险，还要提醒乘客 ，一定要给自己上 意外险 。意外险100到500的保费，保险金额几万至 几十万。有几个案例，朋友搭车，出了事故， 双方闹上法庭，其根本还是因钱的问题。应该学会将这些风险转嫁给保险公司，而不是司机来承担，伤不起。我曾经拒绝过没有意外险的朋友搭乘我的车，朋友也理解。（我在微博里 写：没有意外险，请下车；有意外险，可以搭 我的车） 关于朋友搭车， 法律规定：不管乘客是有偿乘坐还是免费搭车 ，承运人都有奖乘客安全送达目的地的法定义务。</span></span></span></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;">盗抢险全称：</span></strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">全车盗抢险，意思是，丢了某个轮子、反光镜那不能赔。 盗抢险理赔的要求：车被盗后，到县级以上公 安部门报案，三个月没找到，可以要求理赔。 &nbsp; &nbsp;</span></span></span></span></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;">发动机特别损失险:</span></strong></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">也称“涉水险” 投保了车损险的车，可上此险。也就是说，没有商业保险主险，这个不能上。 车辆浸水的情况下，车损险可以赔付除发动机以外车辆损坏的部分，而由此导致的发动机损坏则只有涉水险才有可能赔。 负责保险车辆在积水路面涉水行驶以及涉水时 施救的合理费用。被水淹后致使发动机损坏可 给予赔偿。但是如果被水淹后车主还强行启动 发动机而造成了损害，那么就算购买了涉水险 ，保险公司仍将不予赔偿。 车辆全险并不包括涉水险，车损险不包括发动机损失险。很多朋友以为上了全险万事大吉了 ，其实很多时候的“全险”不包括“涉水险”，所谓的“全险”普遍说的是所有的主险（三者险、 车损险、盗抢险、交强险），而如涉水险这种附加险需要另外购买。车损险发动机的赔付作为免责项，如果想给发动机上保险就必须购买发动机附加险。</span></span></span></span></span></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;">玻璃单独破损险 :</span></strong></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">在保险事故中，玻璃破碎通常都是伴随着车辆其它部位遭受损失而发生的，此时的玻璃破碎属于车损险的责任范围。而在玻璃单独破碎时 ，此时就不属于车损险范围了，而属于玻璃险的责任范围，这时如果没有玻璃险保险公司就不赔了。 &nbsp;</span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); box-sizing: border-box !important; word-wrap: break-word !important;">划痕险：</span></strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">划痕险可以上，可以不上，根车主的经济能力。划痕险的保费一般400元保2000。相对车险的其他项目，比如三者险，600元保10万来说 ，还是比较贵的，不过划痕险只能给三年内的新车上，一般保险公司拒保旧车划痕险。说实在的，有划痕了照样可以开，但有车损或玻璃损坏，没法开。因划痕很容易就出现了，划痕险的理赔率相当高。有保险公司推出：上车险赠送划痕险。为什么可以这样？实际上把划痕的位置乔装改扮，扮成车损的模样，申请理赔 。但是，如果有这种情况，车损怎么也掩盖不了划痕：车身被画上画，这时候，没有划痕险，这家保险公司怎么会理赔呢？所以还是要保持清醒的头脑，考虑问题周到些，不要被“在我们这里上车险便宜”、“上车险赠划痕险”等词语所诱惑。便宜一定给上的保险金额不会高，这是必然的 &nbsp; &nbsp; &nbsp;</span></span></span></span></span></span></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;">自燃险 ：</span></strong></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">一般新车有自保，不需要上自燃险。旧车因供电线路和油路老化，需要燃险。还有一种情况，因车上货物加上外界温度过高，车内燃烧，也属于自燃险理赔范围，所以新车也可以投保自燃险，特别是夏天温度过高的时期，经常出车的朋友。 &nbsp; &nbsp; </span></span></span></span></span></span></span></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;">不计免赔险：</span></strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">商业第三者责任保险的条款中规定了，保险人将根据驾驶人在事故中所负的责任，采取一定的责任免赔率，负主要责任的，免赔15%；负同等责任的，免赔10%；负次要责任的，免赔 5%；负全部责任的，免赔20%。 &nbsp;</span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"> </span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">另外不要把所有证件都放在车里，行驶证放车 里，其他证随身带，以免车辆损失造成证件损 毁，缺少证件到时候理赔的时候会扣一些免赔 ，缺一样扣0.5%(行使证,购车发票,车辆登记证 等等),少了备用钥匙扣3%. &nbsp;</span></span></span></span></span></span></span></span></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;">总结：</span></strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">1.交强险必须上，牢记缴费期 &nbsp; &nbsp; &nbsp;</span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">2.车损险：必须上，管赔自己车的，建议 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;足额投保。 &nbsp; &nbsp; &nbsp; &nbsp;</span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">3.第 三者险：必须上，建议保额20万以上一般5 0万到100万，经济条件好就多上点 。 &nbsp; &nbsp; &nbsp;</span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">4 .车上人员可以不上,上也不必上多，司机2 万左右，乘客1万左右，当然这是已经有人身意外伤害保险的情况下。一个座位20多元管1万， 不如直接办个人身意外险（100到200左右一 份，保险范围不仅包括了普通意外，还有火车 、地铁、自驾等责任，还可以报销医疗费用） &nbsp; &nbsp; &nbsp; &nbsp;</span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">注：交通事故引起的医疗费社保不报销。 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">5.盗抢险要上 &nbsp; &nbsp; &nbsp; &nbsp;</span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">6. 划痕、玻璃险相对较贵,划痕可以不上，玻 璃险根据自己的经济能力。自燃险旧车一定要 上，新车可以考虑上。 &nbsp; &nbsp; &nbsp;</span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">7.不计免赔,上为好。 &nbsp; &nbsp; &nbsp;</span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">8. 涉水险要上，这几年全国各地暴雨车险理赔案例不少。</span></span></span></span></span></span></span></span></span></span></p><p><br/></p>');
INSERT INTO `plf_article_data` (`id`, `content`) VALUES
(4, '<p>郑州璞胜金投电子商务有限公司位于郑州市国家高新城，注册资金500万。是一家集软件开发、网络技术服务、信息咨询服务，理财规划、企业管理策划咨询服务、电子商务服务、销售等为一体的高新技术服务企业。目前，在全国拥有子公司12家，分布河南、河北、山西、陕西、四川、内蒙等。在中国率先推出&quot;个人对个人（&quot;Peer to Peer&quot;或称&quot;P2P&quot;）的《互联网借贷平台》及《共通积分（便利）兑换商城》、《供销商城》等创新型电子商务交易（B2B、B2C、C2C、C2B、O2O）商业模式优势于一体的综合服务平台。平台项目在国内处于领先地位，独一无二，无可替代。</p><p><strong>集团文化——礼 义 廉 耻 </strong>&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp;礼是规规矩矩的态度，礼是严严整整的纪律，</p><p>&nbsp; &nbsp; &nbsp; &nbsp;义是正正当当的行为，义是慷慷慨慨的牺牲，</p><p>&nbsp; &nbsp; &nbsp; &nbsp;廉是清清楚楚的辨别，廉是实实在在的节约，</p><p>&nbsp; &nbsp; &nbsp; &nbsp;耻是切切实实的觉悟，耻是轰轰烈烈的奋斗。</p><p>三年战略 ： 忘掉过去、调整心态、</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 确定模式、寻找天才</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 本土化、同城化、行业化、品牌化</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 科技高地、人才高地</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 技术高地、产业高地</p><p>目标：诚信和创新，提高企业核心竞争力，引领企业成为行业领头人！</p><p>利益：严格按照以股东、员工、客户、家属、社会的利益序列，利益分配，发展运营。</p><p>流程：内部物流化，外部连锁化</p><p>管理：标准化、流程化、简单化、系统化</p><p>集团模式：集资本运营导向模式和产业运作模式的结合，建设以服务实体经济为基础，资本运营为纽带的双核模式</p><p><img src="/data/upload/ueditor/image/1/201412/1419927656433042.jpg" width="100%"/></p><p><img src="/data/upload/ueditor/image/1/201412/1419927656847908.jpg" width="100%"/></p><p><img src="/data/upload/ueditor/image/1/201412/1419927657788707.jpg" width="100%"/></p><p><img src="/data/upload/ueditor/image/1/201412/1419927691942735.png" width="100%"/></p><p><strong>优势与专长</strong></p><p>创业团队具有共同的事业价值观，集智商、情商、财商为一身，优势互补的经营、管理、执行团队。</p><p>战略规划方向正确、目标定位准确，高瞻远瞩，放眼未来。</p><p>团队具有自我创新意识，对市场经济有正确的洞察力和判断力。</p><p>商业模式科学、先进，竞争优势突出，盈利模式多元化，风险控制能力强。</p><p>灵活机动的战略战术，资源整合合作能力强。</p><p><br/></p><p>&quot;无需抵押担保、仅仅凭借个人征信评级、信用管理等服务模式&quot;,成为目前小额民间借贷市场最大的竞争优势。&quot;银行不好贷款,即便贷到款,审批程序也极其复杂和漫长,货币紧缩后,低端小额贷款更是难上加难。&quot;</p><p><br/></p><p>在P2P的个人信贷理财模式里,所有的借款都是信用借款,不需要实物抵押。由于不吸储也不放贷,而是将有理财需求的出借人和有资金需求的借款人&quot;配对&quot;,提供一个自然人之间的借贷交流平台,以之后向借款人收取服务费作为收入来源之一。</p><p><br/></p><p>P2P的信贷模式从长远看,还会不断吸引新的机构进来,随着这些成熟机构的进一步创新,还将演变成信托机构,架起城乡信用融资的桥梁。</p><p><br/></p><p><strong>行业与发展</strong></p><p>所属行业： 资本市场服务</p><p>今天电子商务不是一个技术，不是一个商业模式，它是一场革命，它是一个生活方式和工作方式的变革，它只是刚刚开始。</p><p><br/></p><p>最近统计数据显示， 2013年中国电子商务市场交易规模达10.2万亿元，同比2012年的8.5万亿元，增长29.9%。2014年一季度限额以上单位网上零售额815亿元，增长51.7%。</p><p><br/></p><p>国内网络借贷平台已有数百家，国外有26家。国内主要分布在长三角、珠三角及北京、天津等发达地区。借贷平台客户多达数百万之众，年交易额实现数百亿人民币，单日交易额实现数亿人民币。《温州金融改革实验区》确定了金融服务平台的合法地位。互联网借贷平台的发展趋势日益形成。</p><p><br/></p><p>网络借贷指在网上实现借贷，借入者和借出者均可利用这个网络平台，实现借贷的&quot;在线交易&quot;。</p><p><br/></p><p>2012年P2P网贷入选&quot;2012年中国年度创新成长企业100强&quot;中唯一入选的金融信息服务企业。</p><p>&nbsp; &nbsp;</p><p>长时段来看，互联网金融才大潮初起，难免泥沙俱下，但潮涨潮落，不改一浪高过一浪的发展趋势。当前的鱼龙杂混、良莠不齐的情况一定不会长期持续下去。P2P健康发展的前提可能是要经历一些风雨，淘汰一批经营不善的网贷公司，甚至要打击掉一批借着P2P平台进行违法犯罪活动的团伙。</p><p><br/></p><p>我们相信，经过洗牌之后，一些巨型的、有实力的网贷公司或许将兼并一些中小型网贷公司，并且专注做平台的P2P公司将引进和培育一批金融服务机构。</p><p><br/></p><p><strong>产品服务 </strong></p><p>主营业务：自主研发电子商务交易平台、P2P借贷平台系统，为创业者和传统企业提供全方位、多选项的电子商务解决方案。在中国率先推出&quot;个人对个人（&quot;Peer to Peer&quot;或称&quot;P2P&quot;）的《信用借贷平台》及《共通积分（便利）兑换商城》、《供销商城》等创新型电子商务交易（B2B、B2C、C2C、C2B、O2O）商业模式优势于一体的综合服务平台。</p><p>主要产品与服务：可定制型《P2P借贷平台系统》；电子商务交易平台系统《共通积分（便利）兑换商城》、《供销商城》。</p><p><br/></p>'),
(2, '<p><img src="/data/upload/ueditor/image/1/201412/1419819731497601.png" style="" title="1419819731497601.png" alt="step1.png"/></p><p><span style="color: rgb(26, 26, 26); font-family: 微软雅黑; font-size: 14px; line-height: 24px; background-color: rgb(255, 255, 255);">发生事故后应及时拨打保险公司报案电话，工作人员提醒您收集好相关理赔资料。</span></p><p><img src="/data/upload/ueditor/image/1/201412/1419819972943599.png" style="" title="1419819972943599.png" alt="step2.png"/></p><p><span style="color: rgb(26, 26, 26); font-family: 微软雅黑; font-size: 14px; line-height: 24px; background-color: rgb(255, 255, 255);">提交相关资料，等待审核。</span></p><p><img src="/data/upload/ueditor/image/1/201412/1419819982810352.png" style="" title="1419819982810352.png" alt="step3.png"/></p><p><span style="color: rgb(26, 26, 26); font-family: 微软雅黑; font-size: 14px; line-height: 24px; background-color: rgb(255, 255, 255);">保险公司受理您的理赔申请后，将进行必要地审核及调查，并做出理赔决定。</span></p><p><img src="/data/upload/ueditor/image/1/201412/1419819992929297.png" style="" title="1419819992929297.png" alt="step4.png"/></p><p><span style="color: rgb(26, 26, 26); font-family: 微软雅黑; font-size: 14px; line-height: 24px; background-color: rgb(255, 255, 255);">保险公司做出理赔决定后，会及时通知您结果，并支付理赔金。</span></p><p><br/></p>'),
(3, '<p><img src="/data/upload/ueditor/image/8/201506/1435027946896270.png" style="float: left; margin-left:20px;" title="1435027946896270.png" alt="1p.png"/>&nbsp;平安汽车保险：95512</p><p>&nbsp;官网：<a href="http://www.4008000000.com">http://www.4008000000.com</a></p><p><br/></p><p><img src="/data/upload/ueditor/image/8/201506/1435028066165551.png" style="float: left; margin-left: 20px; width: 44px; height: 35px;" title="1435028066165551.png" alt="2p.png" width="44" height="35"/>&nbsp;中国人保汽车保险：95518</p><p>&nbsp;官网：<a href="http://www.epicc.com.cn/chexian">http://www.epicc.com.cn/chexian</a></p><p><br/></p><p><img src="/data/upload/ueditor/image/8/201506/1435028080328518.png" style="float: left; margin-left:20px;" title="1435028080328518.png" alt="3p.png"/>&nbsp;太平洋汽车保险：95500</p><p>&nbsp;官网：<a href="http://www.ecpic.com.cn">http://www.ecpic.com.cn</a></p><p><br/></p><p><img src="/data/upload/ueditor/image/8/201506/1435028092756433.png" style="float: left; margin-left:20px;" title="1435028092756433.png" alt="4p.png"/>&nbsp;中华联合汽车保险：95585</p><p>&nbsp;官网：<a href="http://e.cic.cn">http://e.cic.cn</a></p><p><br/></p><p><img src="/data/upload/ueditor/image/8/201506/1435028105983174.png" style="float: left; margin-left:20px;" title="1435028105983174.png" alt="5p.png"/>&nbsp;大地汽车保险：95590</p><p>&nbsp;官网：<a href="http://www.95590.cn">http://www.95590.cn</a></p><p><br/></p><p><img src="/data/upload/ueditor/image/8/201506/1435028119992130.png" style="float: left; margin-left: 20px; width: 46px; height: 34px;" title="1435028119992130.png" alt="6p.png" width="46" height="34"/>&nbsp;天安汽车保险：95505</p><p>&nbsp;官网：<a href="http://www.95505.cn">http://www.95505.cn</a></p><p><br/></p><p><img src="/data/upload/ueditor/image/8/201506/1435028130961547.png" style="float: left; margin-left:20px;" title="1435028130961547.png" alt="7p.png"/>&nbsp;永安汽车保险：95502</p><p>&nbsp;官网：<a href="http://www.yaic.com.cn">http://www.yaic.com.cn</a></p><p><br/></p><p><img src="/data/upload/ueditor/image/8/201506/14350