(5, '<p>车辆盗抢险</p><p><br/></p><p>保险车辆（含投保的挂车）因遭受保险责任范围内的全车被盗窃、被抢劫、被抢夺以及在此过程中所造成的损坏，保险人依照保险合同的规定给予赔偿。如果您有被小偷偷窃钱包后痛不欲生的经历，您将明白一旦您的爱车被盗窃、被抢劫，除了给您造成巨大的经济损失，还会有极度的伤心，为了避免这种情况的出现，建议给您的爱车安上防盗器（能降低被盗窃的风险，但不能完全避免被盗），同时为它投保全车盗抢险（万一爱车被盗后，能通过对您经济损失的弥补，来安抚您受伤的心）。</p><p><br/></p><p>盗抢险我需要买么？</p><p>存在任何一种情况，建议购买：</p><p>1.家中无车库，一般停在露天停车场或外面</p><p>2.常常出差在外，无固定停车地点</p><p><br/></p><p>责任免除内容</p><p>1、下列原因造成的损失，保险人不负责赔偿：</p><p>（一）战争、军事冲突、恐怖活动、暴乱；</p><p>（二）自然灾害造成保险车辆的灭失；</p><p>（三）被保险人及其家庭成员或驾驶人的故意行为或违法行为；</p><p>（四）驾驶人饮酒或服用国家管制的精神药品或麻醉药品的；</p><p>（五）保险车辆被诈骗、扣押、罚没、查封或政府征用；</p><p>（六）因民事、经济纠纷导致保险车辆被盗窃、抢劫、抢夺；</p><p>（七）承租人或经承租人许可使用保险车辆的驾驶人与保险车辆同时失踪。</p><p>2、保险车辆全车被盗窃、抢劫、抢夺时，有以下情形之一的，保险人不负赔偿责任：</p><p>（一）除非另有约定，发生保险事故时无公安机关交通管理部门核发的合法有效的行驶证、号牌；</p><p>（二）被保险人索赔时，未能提供机动车停驶手续或出险当地县级以上公安刑侦部门出具的盗抢立案证明；</p><p>（三）保险车辆在竞赛、检测、修理、养护，被扣押、征用、没收期间；</p><p>（四）保险车辆转让他人，被保险人、受让人未履行本保险合同第二部分“通用条款”第十五条规定的通知义务的，因转让导致保险车辆危险程度显著增加而发生保险事故。</p><p>3、下列损失，保险人不负责赔偿：</p><p>（一）非全车遭盗窃、抢劫、抢夺，仅车上零部件或附属设备被盗窃、抢劫、抢夺、损坏；</p><p>（二）新车车辆出厂时的原厂配置以外新增设备的损失；</p><p>（三）保险车辆全车被盗窃、抢劫、抢夺期间造成人身伤亡或本车以外的财产损失；</p><p>（四）遭受保险责任范围内的损失后，未经必要修理继续使用，致使损失扩大的部分；</p><p>（五）市场价格变动造成的贬值、修理后因价值降低引起的损失。</p><p>4、其他不属于保险责任范围内的损失和费用，保险人不负责赔偿。</p><p><br/></p>'),
(6, '<p>车辆损失险</p><p><br/></p><p>车辆损失险是指保险车辆遭受保险责任范围内的自然灾害（不包括地震）或意外事故，造成保险车辆本身损失。作为多数私家车车险中保费最高的一个险种，许多车主对车辆损失险怎么计算不甚明了。其实一般车辆损失险的计算公式是：基本保费+新车购置价X费率，当然车主也可以选择不足额投保，在降低保费的同时保障也会打个折扣。大多数保险公司的车辆损失保险一般保障的是因雷击、暴风、暴雨、洪水等自然灾害和碰撞、倾覆等意外事故造成保险车辆的损失以及相关的施救费用。</p><p><br/></p><p>开车发生交通意外时，补偿您的车所受的损失。比如发生以下事故，保险公司可以按照条款赔偿您的车辆维修费：</p><p>1.您的车由于自身原因撞到护栏等</p><p>2.您不小心撞了别人的车，自己车子受损</p><p><br/></p><p>车辆损失险我需要买么？</p><p>车损险在车险中用途最广，它赔偿被保险车辆本身的损失，无论是小刮小蹭，还是损坏严重，都可以由保险公司来支付维修费用，因此成为了车主们的必选项。</p><p>分析：新手上路，经验有限，容易发生磕磕碰碰，十分有必要购买。</p><p>点评：该险种性价比比较高，目前车价10万左右的车，一两个配件维修费用就可能超过千元。90%的车主都会购买。</p><p><br/></p><p>常见除外责任</p><p>1.由于车辆本身质量问题造成的损失保险公司不负责赔偿，比较常见的有？</p><p>答：1）、发动机因其内部原因发生爆炸或爆裂、轮胎爆炸等。</p><p>2）、因本车电器、线路、供油系统等发生问题造成的火灾。</p><p>2.车被吊车砸坏了，保险公司负责赔偿吗？</p><p>答：要分情况而定，吊车的吊物脱落以及吊钩吊臂或其它零件的断落，造成保险车辆的损失，保险公司负责赔偿。但是吊车本身在操作时由于吊钩、吊臂上下起落砸坏保险车辆的损失，保险公司不负责赔偿。</p><p>3.能把小事故留到一起报案吗？</p><p>答：最好不要这样做。因为事故责任和损失程度不好确定，而且保险车辆遭受保险责任范围内的损失后，未经必要修理继续使用，致使损失扩大的部分，保险公司不负责赔偿。</p><p>4.车在积水中起动使保险车辆的发动机损坏，保险公司负责赔偿吗？</p><p>答：条款规定保险车辆在淹及排气筒的水中启动或被水淹后操作不当致使发动机损坏，保险公司不负责赔偿。</p><p>5.飞来的小石子将我的车风挡玻璃或车窗玻璃碰碎，保险公司负责赔偿吗？</p><p>答：在车损险部分，玻璃单独破碎属于除外责任，保险不负责赔偿。但是如果您加保了玻璃单独破碎险后，保险公司负责赔偿。</p><p>6.车被楼上撒下来酸性液体或油漆污染，保险公司负责赔偿吗？</p><p>答：条款中规定因为车辆的自然磨损、朽蚀、故障造成的损失，保险公司不负责赔偿。</p>'),
(7, '<p>第三责任险</p><p><br/></p><p>第三者责任险（简称三责险），全称：商业第三者责任保险。是指被保险人允许的合格驾驶员在使用被保险车辆过程中发生的意外事故，致使第三者遭受人身伤亡或财产的直接损失，依法应当由被保险人支付的赔偿金额，保险人会按照保险合同中的有关规定给予赔偿。同时，若经保险公司书面同意，被保险人因此发生仲裁或诉讼费用的，由保险公司承担。该险种主要是保障道路交通事故中第三方受害人获得及时有效赔偿的险种。但因事故产生的善后工作，需要由被保险人负责处理。保险公司会在责任限额以外赔偿，但最高不超过责任限额的30%。</p><p>以往绝大多数的地方政府将第三者责任险列为强制保险险种，不买这个保险，机动车便上不了 牌也不能年检。在机动车交通强制保险（简称交强险）出台后，第三者责任险已成为非强制性的保险。因为交强险在对第三者的财产损失和医疗费用部分赔偿较低，可考虑购买第三者责任险作为交强险的补充。</p><p>若发生保险事故，保险公司可按条款赔偿您对第三方造成的损失。比如发生以下事故，如果您有责任，保险公司按照条例赔偿：</p><p>1.您不小心撞了别人的车</p><p>2.您不小心撞了别人造成死亡</p><p><br/></p><p>第三者责任险我需要买么？</p><p>分析：如果不幸撞到豪车或驾车致人重伤，如最近的雅阁撞1200万劳斯莱斯，维修费用35万，这意味着除去保险公司最多赔付的16.2万，车主需赔付18.8万，这相当于一辆全新的雅阁价格。</p><p>点评：交强险赔付有限，购买了第三者责任险，交强险赔付不足的保险公司可赔偿。保障越高越好，建议至少购买选择50万保额，因为这样的保障额度充分而且50万额度的第三者商业险仅仅比20万额度的保费高出600多元，一旦发生重大的第三者责任事故，这600多元的保费可就起了很大的作用</p><p>&nbsp; &nbsp;</p><p>责任免除</p><p>保险车辆造成下列人身伤亡或财产损失，不论在法律上是否应当由被保险人承担赔偿责任，保险人均不负责赔偿：</p><p>（一） 被保险人及其家庭成员的人身伤亡、所有或代管的财产的损失；</p><p>（二） 本车驾驶人员及其家庭成员的人身伤亡、所有或代管的财产的损失；</p><p>（三） 本车上其他人员的人身伤亡或财产损失。</p><p>下列情况下，不论任何原因造成的对第三者的经济赔偿责任，保险人均不负责赔偿：</p><p>（一） 地震、战争、军事冲突、恐怖活动、暴乱、扣押、罚没、政府征用；</p><p>（二） 竞赛、测试，在营业性维修场所修理、养护期间；</p><p>（三） 利用保险车辆从事违法活动；</p><p>（四） 驾驶人员饮酒、吸食或注射毒品、被药物麻醉后使用保险车辆；</p><p>（五） 保险车辆肇事逃逸；</p><p>（六） 驾驶人员有下列情形之一者：</p><p>1、无驾驶证或驾驶车辆与驾驶证准驾车型不相符；</p><p>2、公安交通管理部门规定的其他属于无有效驾驶证的情况下驾车；</p><p>3、使用各种专用机械车、特种车的人员无国家有关部门核发的有效操作证；驾驶营业性客车的驾驶人员无国家有关部门核发的有效资格证书。</p><p>（七） 非被保险人允许的驾驶人员使用保险车辆；</p><p>（八） 保险车辆不具备有效行驶证件；</p><p>（九） 保险车辆拖带未投保第三者责任保险的车辆（含挂车）或被未投保第三者责任保险的其他车辆拖带。</p><p>下列损失和费用，保险人不负责赔偿：</p><p>（一） 保险车辆发生意外事故，致使第三者停业、停驶、停电、停水、停气、停产、通讯中断的损失以及其他各种间接损失；</p><p>（二） 精神损害赔偿；</p><p>（三） 因污染（含放射性污染）造成的损失；</p><p>（四） 第三者财产因市场价格变动造成的贬值、修理后因价值降低引起的损失；</p><p>（五） 保险车辆被盗窃、抢劫、抢夺造成第三者人身伤亡或财产损失；</p><p>（六） 被保险人或驾驶人员的故意行为造成的损失。</p><p>其他不属于保险责任范围内的损失和费用。</p><p><br/></p>'),
(8, '<p>车上人员险</p><p><br/></p><p>车上人员责任险算是车辆商业险的主要保险，它主要功能是赔偿车辆因交通事故造成的车内人员的伤亡的保险。</p><p>车上人员责任险，即车上座位险，是即车上人员责任险中的乘客部分，指的是被保险人允许的合格驾驶员在使用保险车辆过程中发生保险事故，致使车内乘客人身伤亡，依法应由被保险人承担的赔偿责任，保险公司会按照保险合同进行赔偿。</p><p><br/></p><p>车上人员险我需要购买么？</p><p>存在以下任一情况，建议购买：</p><p>1.经常开车带上朋友或其他人，建议购买。</p><p>2.新手或者经常开车的人，建议购买。</p><p><br/></p><p>关于理赔：</p><p>车上责任险的理赔范围是比较广泛的，不仅包括财产也包含人身安全保障，要看是什么事故，有不同的赔偿范围，下面是赔偿范围简单的介绍：</p><p>1、保险车辆遭受保险责任范围内的自然灾害（不包括地震）或意外事故，造成保险车辆本身损失，保险人依据保险合同的规定给予赔偿。</p><p>合格驾驶员在使用被保险车辆过程中发生意外事故而造成第三者的财产直接损失与人员伤亡的。</p><p>2、属于丢失率较高的车型，被盗。</p><p>3、朋友坐您的车子发生意外情况。</p><p>4、指使用过程中发生本车玻璃单独破碎。</p><p>5、车辆在行驶过程中，因本车电器、线路、供油系统发生故障及载运货物自燃原因起火燃烧，造成车辆损失以及施救所支付的合理费用。</p><p>6、在使用过程中，被他人剐划（无明显碰撞痕迹）需要修复的费用。</p><p>7、车辆发生车辆损失险或第三者责任险的保险事故造成赔偿，对应由被保险人承担的免赔金额（20%），由保险公司负责赔。</p><p>8、 车辆发生车辆损失险或第三者责任险的保险事故造成赔偿，对应由被保险人承担的免赔金额，由保险公司负责赔。不计免赔率—附加险几乎是个必保的好险种。</p><p>总之车上责任险包含的项目比较多，保障保障理赔范围都比较广，对于很多有车的朋友来说是一个很不错的保险，建议可以合理搭配主险和附加险，才能做到最安全的保障！</p><p><br/></p><p>常见除外责任</p><p>(1)驾驶员紧急刹车造成乘客伤亡，该不该赔付？</p><p>在交通事故中，因为车与车发生碰撞导致司机、乘客的意外伤亡，如果您投保了车上责任险，由保险公司负责赔偿。但如果驾驶员在行驶过程中紧急刹车导致的本车人员伤亡，保险公司是不承担赔偿责任的。</p><p>(2)我投保了车上责任险，车上3人受伤，保险公司为什么只付了1个人的赔款？</p><p>因为在车上责任险在投保时，必须指明投保座位数，在出现保险事故时，保险公司仅承担投保座位数以内的责任。所以，如果您只投保了一个座位，不管出事时几人受伤，保险公司只赔偿一个人的损失。</p><p><br/></p>'),
(9, '<p>代理商待遇</p><p><br/></p><p>地市级车险投资商待遇</p><p>500万保证金（首席代理商可享受最优惠200万代理权，合同期满，未给公司造成不良影响和经济损失，根据酒品库存进行保证金退还）可享受的资格及利润核算如下：（1）、有县区招商权；（2）、送价值200万的酒；（3）、有7-8%的保费利润；（4）、前三月每月享有3000元的品鉴酒；（5）、有权限收取用户保费的10%作为代办手续费；（6）、有权加收客户10元快递费，让客户享受更便捷的保单快递到家服务；（7）、配送20000个网店并享有对分站的管理权，招商权，收费权，推广权等； (8)、后期积分奖励；（9）、对泸州老窖系列酒的零售批发权。（10）、公司推出的其他激励政策： &nbsp; &nbsp; &nbsp; 月销售额50万以上，月奖励两千元的泸州酒。 &nbsp; &nbsp; &nbsp; 月销售额100万以上，月奖励五千元的泸州酒。 &nbsp; &nbsp; &nbsp; 月销售额200万以上，月奖励一万元的泸州酒。</p><p><br/></p><p>区县级车险投资商待遇</p><p>50万保证金（首席代理商可享受最优惠20万代理权，合同期满未给公司造成不良影响和经济损失，根据酒品库存进行保证金退还）可享受的资格及利润核算：（1）享有县乡区域招商权；（2）配价值20万泸州老窖酒；（3）享有6-7%的保费利润；（4）开业前三个月每月享有价值5000元的品鉴酒；（5）有权限收取用户保费的10%作为代办手续费；（6）有权加收客户10元快递费，让客户享受更便捷的保单快递到家服务；（7）配送2000个网店并享有对分站的管理权，招商权，收费权，推广权等；（8）月销售额50万以上，月奖励两千元的泸州酒。 &nbsp; &nbsp; 月销售额100万以上，月奖励五千元的泸州酒。月销售额200万以上，月奖励一万元的泸州酒。（9）后期积分奖励（可兑换3万多种商品）</p><p><br/></p><p>乡镇级车险投资商待遇</p><p>25万保证金（首席代理商可享受最优惠10万代理权，合同期满未给公司造成不良影响和经济损失，根据酒品库存进行保证金退还）可享受的资格及利润核算：（1）享有乡镇区域招商权；（2）配价值10万泸州老窖酒；（3）享有5-6%的保费利润；（4）有权限收取用户保费的10%作为代办手续费；（5）有权加收客户10元快递费，让客户享受更便捷的保单快递到家服务；（6）配送1000个网店，并享有招商权、收费权、管理权、经营权。（7）月销售额50万以上，月奖励两千元的泸州酒。 &nbsp; &nbsp; 月销售额100万以上，月奖励五千元的泸州酒。 &nbsp; &nbsp; 月销售额200万以上，月奖励一万元的泸州酒。（8）后期积分奖励（可兑换3万多种商品）</p><p><br/></p><p>企业级车险投资商待遇</p><p>10万保证金（首席代理商可享受最优惠5万代理权，合同期满未给公司造成不良影响和经济损失，根据酒品库存进行保证金退还）可享受的资格及利润核算如下：（1）配价值5万泸州老窖酒；（2）享受5%的手续费；（3）有权加收客户10元快递费，让客户享受更便捷的保单快递到家服务；（4）配送500个网店，并享有招商权、收费权、管理权、经营 &nbsp; 权；（5）有权限收取用户保费的10%作为代办手续费；（6）月销售额50万以上，月奖励两千元的泸州酒。 &nbsp; &nbsp; 月销售额100万以上，月奖励五千元的泸州酒。 &nbsp; &nbsp; 月销售额200万以上，月奖励一万元的泸州酒。 （7）后期积分奖励（可兑换3万多种商品）。</p><p><br/></p>'),
(10, '<p style="white-space: normal;"><strong>车险如何购</strong></p><p style="white-space: normal;"><strong><br/></strong></p><p style="white-space: normal;">车险可以分为交强险和商业车险。交强险是强制购买的，商业车险可以根据车主的需要购买。商业险中又分为主险和附加险。主险可以独立购买，但是附加险只有在已经购买了相应主险的情况下才能附加购买。</p><p style="white-space: normal;">目前各家保险公司的车险品种都大致相同。主险主要有“商业第三者责任险”、“车辆损失险”、“全车盗抢险”、“车上人员责任险”。车主可以选择投保其中的部分险种，也可以选择投保全部险种。常见的附加险有“玻璃单独破碎险”、“车身划痕损失险”、“自燃损失险”、“车上货物责任险”、“交通事故精神损害赔偿险”、“涉水行驶发动机损坏险”、“不计免赔险”等。一般“三者险”、“车损险”和“盗抢险”是车主都会投保的险种。其他的险种根据具体情况来选择。</p>'),
(11, '<p style="white-space: normal;"><strong>购买汽车保险注意“四忌”</strong></p><p style="white-space: normal;"><strong><br/></strong></p><p style="white-space: normal;">购买车险时每一个车主每年都要做的事情，但是很多车主在购买车险时，都会遇到各种问题。消费者在购买车险时，应仔细阅读车险条款和相关规定，切忌出现以下四种情况。</p><p style="white-space: normal;">忌不足额投保</p><p style="white-space: normal;">有的车主为了省保费，不足额投保。如此，投保人可以节省一点保费，但如果发生事故造成车辆损毁，将得不到足额赔付。</p><p style="white-space: normal;">忌超额投保</p><p style="white-space: normal;">与不足额投保相反，有的人手中明明是一辆低档车，市场价值低于10万元，却自作主张超额投保，非把保额定在20万元，错误地认为多花点钱就可以在车辆出事时“高额索赔”，实际上这是一厢情愿。在出险车辆定损时，保险公司严格按照出险车辆的实际损失确定赔付金额，如果车辆的实际价值只有10万元，保险公司的最高赔付也就不会超过10万元。</p><p style="white-space: normal;">忌重复投保</p><p style="white-space: normal;">我国保险法规定，重复保险的保险金额总和超过保险价值的，各保险人的赔偿金额的总和不得超过保险价值。因此，车主多买几份保险也不会得到超价值赔款。</p><p style="white-space: normal;">忌投保险种不全面</p><p style="white-space: normal;">汽车保险包括车辆损失险、第三者责任险和全车盗抢险等三类主险，还有划痕险、车上责任险、车辆停驶险、不计免赔险、无过失责任险、自燃损失险、玻璃单独破碎险等一批附加险种，各险种承担的责任范围不可替代。</p><p style="white-space: normal;">专家观点：消费者在购买车险时，足额投保即可，即车辆实际价值多少就投保多少。另外，消费者在选择车险险种时应该考虑周全，既不能为了省钱少保，也不能不加分析盲目投保。</p><p><br/></p>'),
(12, '<p style="white-space: normal;"><strong>全险非全保 汽车保险11种不理赔情况</strong></p><p style="white-space: normal;"><strong><br/></strong></p><p style="white-space: normal;">随着汽车私有化程度的提高，越来越多的人拥有自己的“私家”汽车，车主们对于车辆普遍都有了投保意识，全险更成为很多购车者的首选。但如果您认为只要投保了全险，就一切全包的话，你就“想太多了”。因为，还存在11种情况，保险公司是不会给予理赔的。今天，小慧就在此为大家做一个详细的盘点，希望对大家有所帮助。</p><p style="white-space: normal;">(1)、撞到“自家人”的不赔</p><p style="white-space: normal;">所谓第一者、第二者，是指保险人、被保险人(驾驶员视同于被保险人)，除去这些人以外的，都视为第三者。在保险条款中规定被保险人或驾驶员的家庭成员不属于“第三者”范畴。</p><p style="white-space: normal;">(2)、车灯单独破损的不赔</p><p style="white-space: normal;">据说，保险公司制定该条免责条款是为了对付某些修理厂的骗保行为。有些居心不良的修理厂常常用换下来的破损车灯或者倒车镜，装到车型相同的其他车上，来骗取赔款。</p><p style="white-space: normal;">(3)、车轮单独爆胎的不赔</p><p style="white-space: normal;">保险合同中明确规定了车轮单独损坏是属于保险公司免赔范围，但当汽车有因轮胎爆裂而导致碰撞事故，保险公司则给予理赔，但轮胎损失费用仍不予赔付。</p><p style="white-space: normal;">(4)、把负全责的肇事人放跑的不赔</p><p style="white-space: normal;">如果车主与其他车辆发生碰撞，且责任在对方，不能放弃向第三方追偿的权利，若放弃了，保险公司有拒赔的权利。</p><p style="white-space: normal;">(5)、涉水熄火二次打火发动机受损不赔</p><p style="white-space: normal;">车辆行驶到水深处，发动机熄火后，驾驶员强行打火所造成的发动机损坏，在车辆损失险中属于免责范围。</p><p style="white-space: normal;">(6)、在停车场丢车的不赔</p><p style="white-space: normal;">即使上了“全险”，若在收费停车场中丢车，也不予赔付。因此，无论是车丢了还是被划了，保险公司一概不管，因为收费停车场对车辆有保管的责任。</p><p style="white-space: normal;">(7)、私自加装的设备不赔</p><p style="white-space: normal;">不少车主会在买车后，自己加装音响、电台、冰箱、尾翼或者行李架等，一旦发生事故，造成私自加装设备受到损失的，保险公司也不会对此赔偿。</p><p style="white-space: normal;">(8)、车辆零部件被盗的不赔</p><p style="white-space: normal;">保险公司通常规定“非全车遭盗抢，仅车上零部件或附属设备被盗窃、被抢劫、被抢夺、被损坏”为免除责任。</p><p style="white-space: normal;">(9)、未及时报案的不赔</p><p style="white-space: normal;">发生保险责任范围内的事故后，被保险人应立即向公安部门报案，并在48小时内向保险公司报案。未经核损，擅自对车辆进行修复，保险公司也会拒赔。</p><p style="white-space: normal;">(10)、没有及时缴费的不赔</p><p style="white-space: normal;">有些车主由于工作繁忙，未能按时续缴保费，如果汽车在这段“车险真空期内”出险，保险公司就无能为力了。</p><p style="white-space: normal;">(11)、车辆未年检的不赔</p><p style="white-space: normal;">根据保险合同，保险只对合格车辆生效，对于未年检的车辆只能视为不合格车辆。</p><p><br/></p>'),
(13, '<p style="white-space: normal;"><strong>汽车保险理赔小常识</strong></p><p style="white-space: normal;"><strong><br/></strong></p><p style="white-space: normal;">（1）、随车携带机动车辆《三证一单》的清晰复印件、即车主身份证、驾驶证、行驶证和保险大单。在此特别提醒大家，现在许多保险公司的保险小卡已不在作为理赔凭证。</p><p style="white-space: normal;">（2）、出险及时报案非常重要，尤其是重大事故。拨打保险公司报案电话时需要提供保单号码、出险时间、地点、事故性质等基本情况。</p><p style="white-space: normal;">（3）、临时牌照车辆一般只办理了短期交强保险，且有规定路线和时间，在规定以外的路线和时间发生的意外事故保险公司不承担赔付责任。</p><p style="white-space: normal;">（4）、车辆异地出险时，及时报保险公司，由出险地定损人员进行代查勘定损。赔付费用一般按出险地的行业标准估价，若有局部损坏回到投保地才发现的，这部分的修理费用保险公司可补定损赔偿。</p><p style="white-space: normal;">（5）、被保险人如果要委托修理厂办理赔，或将事故赔偿费直接划给修理厂的，应亲自签订授权委托书，并报保险公司备案。每次修理时，与修理厂签订质量合同，这样才能维护自己的合法权益。</p><p><br/></p>'),
(14, '<p>手机客户端</p><p><br/></p><p>1.通过用手机扫描此二维码，获得手机客户端下载地址。</p><p><br/></p><p>（安卓手机用户客户端下载，请用浏览器扫描下面二维码）&nbsp;</p><p>&nbsp;<img src="/data/upload/ueditor/image/8/201506/1433575731378974.png" title="1433575731378974.png" alt="cli_300px.png" width="265" height="277" style="width: 265px; height: 277px;"/></p><p>（苹果手机越狱用户客户端下载，非越狱手机无法安装，请用浏览器扫描下面二维码）</p><p><img src="/data/upload/ueditor/image/1/201501/1421649177596402.png" title="1421649177596402.png" alt="code.png" width="281" height="269" style="width: 281px; height: 269px;"/></p><p>&nbsp;</p><p><br/></p><p>2.在手机浏览器中输入此地址，下载商城手机客户端。</p><p><br/></p><p>安卓手机用户客户端下载：<a href="http://www.vcivc.cn/data/app/che.1.apk" target="_blank" textvalue="http://www.vcivc.cn/data/app/che.1.apk">http://www.vcivc.cn/data/app/che.1.apk</a></p><p>苹果手机越狱用户客户端下载：<a href="http://www.vcivc.cn/data/app/che.1.ipa" target="_blank" textvalue="http://www.vcivc.cn/data/app/che.1.ipa">http://www.vcivc.cn/data/app/che.1.ipa</a></p><p><br/></p><p><br/></p><p>3.如果您的手机不支持直接下载，那么您可以点击（苹果手机用户客户端下载）或（安卓手机用户客户端下载），先将手机客户端下载到您的电脑中，然后再用数据线或读卡器传输到您的手机中。</p><p><br/></p>'),
(15, '<p>车险复杂，很多刚买车的新手，甚至驾车多年的老手都不敢说完全弄懂了各种车险。在之前推送过的文章中，猫叔对车主购买车险的搭配做出了建议，今天猫叔带来新的图片，让你更清晰直观地了解各类车险的适用范围和购买建议!</p><p><img src="/data/upload/ueditor/image/1/201501/1421490158988728.jpg" width="100%"/></p><p><img src="/data/upload/ueditor/image/1/201501/1421490159200809.jpg" width="100%"/></p><p><img src="/data/upload/ueditor/image/1/201501/1421490162962455.jpg" width="100%"/></p><p><img src="/data/upload/ueditor/image/1/201501/1421490166959644.jpg" width="100%"/></p><p><img src="/data/upload/ueditor/image/1/201501/1421490172741253.jpg" width="100%"/></p><p><img src="/data/upload/ueditor/image/1/201501/1421490176878862.jpg" width="100%"/></p><p><img src="/data/upload/ueditor/image/1/201501/1421490178560593.jpg" width="100%"/></p><p><img src="/data/upload/ueditor/image/1/201501/1421490180972112.jpg" width="100%"/></p><p><img src="/data/upload/ueditor/image/1/201501/1421490222923047.jpg" width="100%"/></p>');
