und-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">③自燃代号：Z &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">④不计免赔代号：M &nbsp; &nbsp; &nbsp; &nbsp;</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">⑤发动机特别损失险代号X &nbsp;</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;">交强险的特性：</span></strong></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">公益性、强制性、广泛性。设立交强险的目的是：让交通事故中的受害人得到及时有效的治疗。 强制性：强制承保，不能拒保。 广泛性：只要是机动车，都可以承保。（机动车包括摩托车，不包括电动车） 酒后驾车、故意撞人，交强险也理赔，目的是保护受害者，体现了公益性。当然遇到这种情况，保险公司会先垫付医疗费用，再立案调查情况，向司机追偿。 交强险不赔的情况：碰瓷的不赔。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;"></span><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">交强险特征：</strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;">分项赔偿原则（往下看） 浮动费率原则（第一年不出险，第二年费率下 调10%，最多下调30%，反之则反），奖优罚 劣原则。 &nbsp;</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); box-sizing: border-box !important; word-wrap: break-word !important;">交强险能解决哪些问题？</span></strong></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(0, 112, 192); box-sizing: border-box !important; word-wrap: break-word !important;">举例<span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">：</span></span></strong><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">车撞了树，只给车上了交强险。假定树不赔，那么，车的损失是否可以走理赔？</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(0, 112, 192); box-sizing: border-box !important; word-wrap: break-word !important;">答案<span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">：</span></span></strong><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">不赔，因交强险只理赔交通事故中的受害方，那么在这个例子里，受害方是树，不赔树的话，车辆损失就得不到任何保险补偿。 &nbsp;</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">再看个</span><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(0, 112, 192); box-sizing: border-box !important; word-wrap: break-word !important;">案例<span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">：</span></span></strong><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">一个捷达在后，奔驰在前，突然前面有交通事故，奔驰急刹车，捷达没刹住， 追尾了，把奔驰的保险杠给撞坏了。这倒霉催的，不过还好有车险。奔驰给4S店打电话问修车费，双方协商解决理赔问题。4S店回复奔驰，配件4万，要空运过来，国内没有这型号的配件。捷达车主心想4万不贵呀，光交强险就12万。结果傻眼了：交强险规定：事故中产生的财产损失，最多赔付2千。也就 是说，因为他只上了交强险，没有上商业三者 险，3.8万要等着捷达支付。 &nbsp; &nbsp;</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); box-sizing: border-box !important; word-wrap: break-word !important;">交强险的理赔最高限额是12.2万</span></strong><br style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;"/><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;">大家听了还挺高兴，还算不少啊，一般的车辆损失也就够了。不要高兴太早了，交强险还有个分项赔偿原则： &nbsp; &nbsp; &nbsp; &nbsp; 撞人致死：11万 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;撞人受伤：1万 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;交通事故产生的财产损失：2千。 这是在被保险人有责任时的赔偿。被保险人无责任时： 死亡伤残赔偿限额为1.1万， 医疗费1千， 财产100. 交强险累积赔付。意思是：一年的保险金额就这些，几次出险理赔金额要加一起算。超过了就自费。（开车还是小心为好，现在撞人致死 理赔11万，这年头11万能安抚被害人家属吗 ？没个30.50万能摆平吗？） 所以仅仅给车上了交强险，真正遇到事故时， 自己掏腰包的花费很昂贵。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;">商业险第三者险：</span></strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">行内有句话：没有商业三者险的车主，伤不起 。 有的人看到商业保险，商业车险，会有抵触情绪：商业保险是盈利性质的，不是福利，这很对。不过现在保险的理赔率也是很高的，特别是车险，理赔就是给车主的福利。 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">定义：商业三者险是保险公司为第三者的损失 承担责任的保险险种。第三者指的.除投保人 、被保险人、保险人以外的，因保险车辆发生 意外事故而遭受损失的第三方受害者。 &nbsp; &nbsp;</span></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(0, 112, 192); font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;">解析：</span></strong></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">1.第三者险是赔给第三者的，不包括自己家人。 有一个案例：一人在倒车时，经验不足，让家 人站在车后，加上技术不熟练，油门当刹车， 导致家人死亡，这种情况车险不能理赔。如果 是外人，可以理赔。这也是为了防止骗保，故 意伤害家人。 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">2.没有分项赔偿原则，有损就赔。 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">3.不累积保险金额，例如投保10万的三者，第一次出险理赔后， 第二次保险金额还是10万，不会因第一次理赔过而减去上一次赔偿的金额。 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 2em; box-sizing: border-box !important; word-wrap: break-word !important;">4. 商业三者险的保费： 一般在几百元，5万起，例如600左右保10万 ，800左右20万，1千左右30万。建议额度在 20万以上。少了确实到真正遇到事故时，作用微弱。遇到事故时顿时傻眼。（不出险的车 ，保费来年会下调10%,以下的保费为大致数额，保费和车型以及不出险优惠或出现了上涨的幅度有关。） 商业三者险在北京的理赔率相当高。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;">车损险：</span></strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">被保险人或其允许的驾驶员在驾驶保险车辆时发生保险事故，造成保险车辆受损，保险公司 在合理范围内予以赔偿。</span></span></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">车损险也就是针对车辆本身的损失投的保险。 不上车损险，附加险上不了。 较常见的车损：碰撞、倾覆（翻车）、自然灾害等（冰雹、暴雨、爆炸等等）。保费一般1千多保10万，和车辆型号价格有关，相当于一天3元。这项保险的理赔率也非常高。 &nbsp; &nbsp;</span></span></span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;">车上人员：</span></strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">负责赔偿保险车辆交通意外造成的本车人员伤 亡。 一名司机加四名乘客。一般每人保险金额1万到3万，保费40左右保险金额一万，，乘客一人20元左右保险金额一万，四人保费100到300左右。 建议车主，有了车上人员保险，还要提醒乘客 ，一定要给自己上 意外险 。意外险100到500的保费，保险金额几万至 几十万。有几个案例，朋友搭车，出了事故， 双方闹上法庭，其根本还是因钱的问题。应该学会将这些风险转嫁给保险公司，而不是司机来承担，伤不起。我曾经拒绝过没有意外险的朋友搭乘我的车，朋友也理解。（我在微博里 写：没有意外险，请下车；有意外险，可以搭 我的车） 关于朋友搭车， 法律规定：不管乘客是有偿乘坐还是免费搭车 ，承运人都有奖乘客安全送达目的地的法定义务。</span></span></span></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;">盗抢险全称：</span></strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">全车盗抢险，意思是，丢了某个轮子、反光镜那不能赔。 盗抢险理赔的要求：车被盗后，到县级以上公 安部门报案，三个月没找到，可以要求理赔。 &nbsp; &nbsp;</span></span></span></span></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;">发动机特别损失险:</span></strong></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">也称“涉水险” 投保了车损险的车，可上此险。也就是说，没有商业保险主险，这个不能上。 车辆浸水的情况下，车损险可以赔付除发动机以外车辆损坏的部分，而由此导致的发动机损坏则只有涉水险才有可能赔。 负责保险车辆在积水路面涉水行驶以及涉水时 施救的合理费用。被水淹后致使发动机损坏可 给予赔偿。但是如果被水淹后车主还强行启动 发动机而造成了损害，那么就算购买了涉水险 ，保险公司仍将不予赔偿。 车辆全险并不包括涉水险，车损险不包括发动机损失险。很多朋友以为上了全险万事大吉了 ，其实很多时候的“全险”不包括“涉水险”，所谓的“全险”普遍说的是所有的主险（三者险、 车损险、盗抢险、交强险），而如涉水险这种附加险需要另外购买。车损险发动机的赔付作为免责项，如果想给发动机上保险就必须购买发动机附加险。</span></span></span></span></span></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;">玻璃单独破损险 :</span></strong></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">在保险事故中，玻璃破碎通常都是伴随着车辆其它部位遭受损失而发生的，此时的玻璃破碎属于车损险的责任范围。而在玻璃单独破碎时 ，此时就不属于车损险范围了，而属于玻璃险的责任范围，这时如果没有玻璃险保险公司就不赔了。 &nbsp;</span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); box-sizing: border-box !important; word-wrap: break-word !important;">划痕险：</span></strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">划痕险可以上，可以不上，根车主的经济能力。划痕险的保费一般400元保2000。相对车险的其他项目，比如三者险，600元保10万来说 ，还是比较贵的，不过划痕险只能给三年内的新车上，一般保险公司拒保旧车划痕险。说实在的，有划痕了照样可以开，但有车损或玻璃损坏，没法开。因划痕很容易就出现了，划痕险的理赔率相当高。有保险公司推出：上车险赠送划痕险。为什么可以这样？实际上把划痕的位置乔装改扮，扮成车损的模样，申请理赔 。但是，如果有这种情况，车损怎么也掩盖不了划痕：车身被画上画，这时候，没有划痕险，这家保险公司怎么会理赔呢？所以还是要保持清醒的头脑，考虑问题周到些，不要被“在我们这里上车险便宜”、“上车险赠划痕险”等词语所诱惑。便宜一定给上的保险金额不会高，这是必然的 &nbsp; &nbsp; &nbsp;</span></span></span></span></span></span></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;">自燃险 ：</span></strong></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">一般新车有自保，不需要上自燃险。旧车因供电线路和油路老化，需要燃险。还有一种情况，因车上货物加上外界温度过高，车内燃烧，也属于自燃险理赔范围，所以新车也可以投保自燃险，特别是夏天温度过高的时期，经常出车的朋友。 &nbsp; &nbsp; </span></span></span></span></span></span></span></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;">不计免赔险：</span></strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">商业第三者责任保险的条款中规定了，保险人将根据驾驶人在事故中所负的责任，采取一定的责任免赔率，负主要责任的，免赔15%；负同等责任的，免赔10%；负次要责任的，免赔 5%；负全部责任的，免赔20%。 &nbsp;</span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"> </span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">另外不要把所有证件都放在车里，行驶证放车 里，其他证随身带，以免车辆损失造成证件损 毁，缺少证件到时候理赔的时候会扣一些免赔 ，缺一样扣0.5%(行使证,购车发票,车辆登记证 等等),少了备用钥匙扣3%. &nbsp;</span></span></span></span></span></span></span></span></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(247, 150, 70); box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;">总结：</span></strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: normal; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Î¢ÈíÑÅºÚ, Arial, sans-serif; font-size: medium; line-height: 25.600000381469727px; background-color: rgb(255, 255, 255); box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体; line-height: 32px; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">1.交强险必须上，牢记缴费期 &nbsp; &nbsp; &nbsp;</span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">2.车损险：必须上，管赔自己车的，建议 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;足额投保。 &nbsp; &nbsp; &nbsp; &nbsp;</span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">3.第 三者险：必须上，建议保额20万以上一般5 0万到100万，经济条件好就多上点 。 &nbsp; &nbsp; &nbsp;</span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">4 .车上人员可以不上,上也不必上多，司机2 万左右，乘客1万左右，当然这是已经有人身意外伤害保险的情况下。一个座位20多元管1万， 不如直接办个人身意外险（100到200左右一 份，保险范围不仅包括了普通意外，还有火车 、地铁、自驾等责任，还可以报销医疗费用） &nbsp; &nbsp; &nbsp; &nbsp;</span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">注：交通事故引起的医疗费社保不报销。 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">5.盗抢险要上 &nbsp; &nbsp; &nbsp; &nbsp;</span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">6. 划痕、玻璃险相对较贵,划痕可以不上，玻 璃险根据自己的经济能力。自燃险旧车一定要 上，新车可以考虑上。 &nbsp; &nbsp; &nbsp;</span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">7.不计免赔,上为好。 &nbsp; &nbsp; &nbsp;</span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">8. 涉水险要上，这几年全国各地暴雨车险理赔案例不少。</span></span></span></span></span></span></span></span></span></span></p><p><br/></p>');
INSERT INTO `plf_article_data` (`id`, `content`) VALUES
(17, '<p><span style="font-size: 16px;">&nbsp; &nbsp; &nbsp;机动车无号牌、无检验合格标志、无保险标志的；驾</span><span style="font-size: 16px;">驶 人无有效机动车驾驶证的；驾驶人饮酒、服用国家管制的精神药品或者麻醉药</span><span style="font-size: 16px;">品的；发生《中华人民共和国道路交通安全法》第七十条第二项规定的交通事故，</span><span style="font-size: 16px;">当事人对事实或者成因有争议的；当事人不能自行移动车辆的；碰撞建筑物、公</span><span style="font-size: 16px;">共设施或者其他设施的。</span><br/></p><p><br/></p>'),
(18, '<p>&nbsp; &nbsp; 交通事故现场是反映交通事故发生前后的空间场所，这里存在大量的事故痕迹和物证，是公安机关正确认定事故责任，处理交通事故的关键，当事人应当在事故发生后妥善保护事故现场。如果道路交通事故现场是由于当事人的原因没有很好地得到保护，受到人为或者自然因素的破坏，就会给现场勘查带来困难，会影响到准确的认定交通事故责任。如果驾驶人有意伪造或者破坏现场，肇事逃逸，导致无法准确的分析、认定事故责任的，依据规定，要由驾驶人负交通事故的全部责任。</p>'),
(19, '<p>①、交通事故发生后，要立即确定现场范围，用白灰、沙石、树枝、绳索等将现场标围封闭，并注意看护，禁止一切车辆和行人进入，标围现场时，应尽量做到不妨碍交通；</p><p>②、若要在现场抢救伤员，应标记伤员的原始位置，以证明现场的变动情况；</p><p>③、遇到下雨、下雪、刮风等自然现象，对现场可能造成破坏时可用席子、塑料布等将现场上的尸体、血迹、车痕、制动印痕和其他散落物等遮盖起来；</p><p>④、现场如果有扩大事故的二因素，如汽油外溢，车上装有易燃、易爆、剧毒、放射性物品时，应立即设法消除，并向周围的行人讲明现场的危险性。必要时应将危险车辆驶离现场；</p><p>⑤、要注意寻找证人，记下见证人的身份、住址等；</p><p>⑥、在繁华或重要路段发生事故，要服从执勤民警的指挥，在做好标记后，将车辆移除现场，以恢复正常交通，但不准擅自移动车辆，也不准不标记而移动车辆。</p><p><br/></p><p>交通事故发生后，当事人应注意重点保护以下事故现场痕迹：</p><p>&nbsp;①、路面痕迹：如车辆制动印迹、扎压痕迹、侧滑痕迹、行人鞋底与路面擦痕及油剂、水迹、血迹等；</p><p>&nbsp;②、车辆及人体擦撞痕迹；如各种车辆部件造成的刮痕、沟槽、服装搓擦痕、车身浮沉擦痕等；</p><p>&nbsp;③、路面遗留物：如玻璃、漆片等散落物及人体组织剥落物等。</p>'),
(20, '<p><span style="font-size: 16px;"><img src="/data/upload/article/201505/14307261806703.png" title="1430885128527508.png" alt="p1.png"/></span></p><p><span style="font-size: 16px;">在相同车道行驶的机动车发生追尾事故，后面的车辆要负全部责任</span></p>'),
(53, '<p style="white-space: normal;"><img src="/data/upload/article/201505/14307262541557.png" title="1430885040253860.png" alt="p2.png"/></p><p style="white-space: normal;">在正常行驶的状态下，前方车辆无故倒车造成事故的，责任全部要<span style="font-size: 16px;">由前车进行承担</span></p>'),
(54, '<p style="white-space: normal;"><img src="/data/upload/article/201505/14307263085933.jpg" title="1430884952977934.png" alt="p3.png"/></p><p style="white-space: normal;">中心黄色双视线表示严格禁止车辆跨越线超车或压线行驶，一旦车<span style="font-size: 16px;">辆因越线超车发生事故就要负全部责任。黄色 &nbsp; &nbsp; 虚线可以并线，调</span><span style="font-size: 16px;">换车道，但一旦因越线超车发生事故就要负全部责任</span></p>'),
(55, '<p style="white-space: normal;"><span style="font-size: 16px;"><img src="/data/upload/article/201505/14307263864735.jpg" title="1430884886693953.png" alt="p4.png"/></span></p><p style="white-space: normal;"><span style="font-size: 16px;">开车门未排查周围情况，开车门一方要负全部责任</span></p>'),
(56, '<p style="white-space: normal;"><img src="/data/upload/article/201505/14307264197130.png" title="1430884806399328.png" alt="p5.png"/></p><p style="white-space: normal;">掉头车辆未让对面直行车，造成事故要由掉头车辆承担全部责任</p>'),
(57, '<p style="white-space: normal;"><img src="/data/upload/article/201505/14307264612578.jpg" title="1430884705732751.png" alt="p6.png"/></p><p style="white-space: normal;">未按规定时间驶入专用车道，造成事故的要负全部责任</p>'),
(58, '<p style="white-space: normal;"><img src="/data/upload/article/201505/14307265129247.jpg" title="1430884631750585.png" alt="p7.png"/></p><p style="white-space: normal;">变更车道与正常车道行驶的车辆发生事故，要负全部责任</p><p style="white-space: normal;"><br/></p><p><br/></p>'),
(59, '<p style="white-space: normal;"><img src="/data/upload/article/201505/14307265914842.jpg" title="1430884544753151.png" alt="p8.png"/></p><p style="white-space: normal;">未遇到障碍的车辆未让遇到障碍的车，造成事故要<span style="font-size: 16px;">由未遇到障碍的车承担全部责任</span></p>'),
(60, '<p style="white-space: normal;"><img src="/data/upload/article/201505/14307266285021.jpg" title="1430884479343369.png" alt="p9.png"/></p><p style="white-space: normal;">会车时超车，与对面车辆造成事故，要承担全部责任。</p><p style="white-space: normal;"><br/></p><p><br/></p>'),
(61, '<p style="white-space: normal;"><img src="/data/upload/article/201505/14307266777568.jpg" title="1430884382162411.png" alt="p10.png"/></p><p style="white-space: normal;">交叉路口超车造成事故，要承担全部责任</p>'),
(21, '<p>伤残等级鉴定术语：为更好的地理解以及划分事故伤残鉴定，我们有必要了解与之相关的一些专业术语</p><p>&nbsp; &nbsp;①、道路交通事故受伤人员：在道路交通事故中遭受各种暴力致伤的人员。</p><p>&nbsp; &nbsp;②、伤残：因道路交通事故损伤所致的人体残废。包括：精神的、生理功能的和解剖结构的异常及其导致的生活、工作和社会活动能力不同程度丧失。</p><p>&nbsp; &nbsp;③、评定 ：在客观检验基础上，评价确定道路交通事故受伤人员伤残等级的过程。</p><p>&nbsp; &nbsp;④、评定人：办案机关依法指派或聘请符合评定人条件，承担道路交通事故受伤人员伤残评定的人员。</p><p>&nbsp; &nbsp;⑤、评定结论 ：评定人根据检验结果，按照伤残评定标准，运用专门知识进行分析所得出的综合性判断。</p><p>&nbsp; &nbsp;⑥、评定书 ：评定人将检验结果、分析意见和评定结论所形成的书面文书。</p><p>&nbsp; &nbsp;⑦、治疗终结 ：临床医学一般原则所承认的临床效果稳定。</p>'),
(32, '<p style="white-space: normal;"><span style="font-size: 16px;">依照交通事故伤残鉴定标准，根据受伤人员的伤残情况，将受伤人员伤残程度共划分为10级，包括1级伤残至10级伤残，伤害程度由重至轻</span><br/></p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">&nbsp; &nbsp; 划分标准如下：</p><p style="white-space: normal;">一级伤残划分依据&nbsp;</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">&nbsp; &nbsp;a. 日常生活完全不能自理，全靠别人帮助或采用专门设施，否则生命无法维持；&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;b. 意识消失；&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;c. 各种活动均受到限制而卧床；&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;d. 社会交往完全丧失。&nbsp;</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">&nbsp; &nbsp;二级伤残划分依据&nbsp;</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">&nbsp; &nbsp;a. 日常生活需要随时有人帮助；&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;b. 各种活动受限，仅限于床上或椅上的活动；&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;c. 不能工作；&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;d. 社会交往极度困难。&nbsp;</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">&nbsp; &nbsp;三级伤残划分依据&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;a. 不能完全独立生活，需经常有人监护；&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;b. 各种活动受限，仅限于室内的活动；&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;c. 明显职业受限；&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;d. 社会交往困难</p><p style="white-space: normal;">&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;四级伤残划分依据&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;a. 日常生活能力严重受限，间或需要帮助；&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;b. 各种活动受限，仅限于居住范围内的活动；</p><p style="white-space: normal;">&nbsp; &nbsp;c. 职业种类受限；&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;d. 社会交往严重受限。&nbsp;</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">&nbsp; &nbsp;五级伤残划分依据&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;a. 日常生活能力部分受限，偶尔需要监护；&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;b. 各种活动受限，仅限于就近的活动；&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;c. 需要明显减轻工作；&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;d. 社会交往贫乏。&nbsp;</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">&nbsp; &nbsp;六级伤残划分依据&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;a. 日常生活能力部分受限，但能部分代偿，条件性需要帮助；&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;b. 各种活动降低；&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;c. 不能胜任原工作；&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;d. 社会交往狭窄。&nbsp;</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">&nbsp; &nbsp;七级伤残划分依据&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;a. 日常生活有关的活动能力严重受限；&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;b. 短暂活动不受限，长时间活动受限；&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;c. 工作时间需要明显缩短；&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;d. 社会交往降低。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">&nbsp; &nbsp;八级伤残划分依据&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;a . 日常生活有关的活动能力部分受限；</p><p style="white-space: normal;">&nbsp; &nbsp;b. 远距离流动受限；&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;c. 断续工作；&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;d. 社会交往受约束。&nbsp;</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">&nbsp; &nbsp;九级伤残划分依据&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;a . 日常活动能力大部分受限；&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;b. 工作和学习能力下降；&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;c. 社会交往能力大部分受限；&nbsp;</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">&nbsp; &nbsp;十级伤残划分依据&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;a. 日常活动能力部分受限；&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;b. 工作和学习能力有所下降；&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp;c. 社会交往能力部分受限。</p><p style="white-space: normal;"><br/></p>'),
(33, '<p>&nbsp;①、伤残评定应以人体伤后治疗效果为依据，对于以原发性损伤及其并发症作为评定依据的，评定时应以损伤当时伤情为主，结合损伤的后果或者结局为辅，综合评定</p><p>&nbsp;②、认真分析残疾与事故，损伤之间的关系</p><p>&nbsp;③、实事求是地评定，遵循实事求是的原则，坚持以致伤因素对人体造成的原发性损伤及由损伤引起的并发症或者后遗症为依据，全面分析，综合评定。</p>'),
(34, '<p>&nbsp; &nbsp;评定时机应以事故直接所致的损伤或确因损伤所致的并发症治疗终结为准。对治疗终结意见不一致时，可由办案机关组织有关专业人员进行鉴定，确定其是否治疗终结。 在道当事人因交通事故致残的，在治疗终结（临床医学一般原则所承认的临床效果稳定。）后，应当由具有资格的伤残鉴定机构评定伤残等级。对治疗终结意见不一致时，可由办案机关组织有关专业人员进行鉴定，确定其是否治疗终结。办案机关依法指派或聘请符合评定人条件，承担道路交通事故受伤人员伤残评定的人员。具备资格的检验、鉴定、评估机构应 当向省级人民政府公安机关交通管理部门备案，公安机关交通管理部门可以向当事人介绍符合条件的检验、鉴定、评估机构，由当事人自行选择。</p>'),
(35, '<p>&nbsp; &nbsp;①、检验、鉴定、评估机构、人员接受公安机关交通管理部门指派、委托或者当事人委托的，应当在规定期限内完成检验、鉴定、评估。检验、鉴定、评估结果确定后，应当出具书面结论，由检验、鉴定、评估人签名并加盖机构印章。</p><p>&nbsp; &nbsp;②、公安机关交通管理部门应当在接到检验、鉴定结果后二日内将检验、鉴定结论复印件交当事人。当事人对公安机关交通管理部门的检验、鉴定结论有异议的，可以在接到检验、鉴定结论复印件后三日内提出重新检验、鉴定的申请。经县级公安机关交通管理部门负责人批准后，应当另行指派或者委托专业技术人员、有资格的鉴定机构进行重新检验、鉴定。</p><p>&nbsp; &nbsp;③、当事人对自行委托的检验、鉴定、评估结论有异议的，可以在接到检验、鉴定、评估结论后三日内另行委托检验、鉴定、评估，并告知公安机关交通管理部门，公安机关交通管理部门予以备案。</p><p>&nbsp; &nbsp;④、申请重新检验、鉴定、评估以一次为限。重新检验、鉴定、评估的时限与检验、鉴定、评估的时限相同。</p><p>&nbsp; &nbsp;⑤、评定书。评定人评定结束后，应制作评定书并签名。评定书包括一般情况、案情介绍、病历摘抄、检验结果记录、分析意见和结论等内容。</p><p>&nbsp; &nbsp;⑥、不同的鉴定机构对同一鉴定对象出具多份鉴定结论，若各鉴定机构均具有法定鉴定资格时，应依据鉴定机构级别的高低， 一般应采信高一级别鉴定机构作出的鉴定结论，排除那些级别较低鉴定机构作出的鉴定结论。</p>'),
(36, '<p>　评定人权利</p><p>　　 ①、有权了解与评定有关的案情和其他材料;</p><p>　　 ②、有权向当事人询问与评定有关的问题;</p><p>　　 ③、有权依照医学原则对道路交通事故受伤人员进行身体检查和要求进行必要的特殊仪器检查等;</p><p>　　 ④、有权因专门知识的限制或鉴定材料的不足而拒绝评定。</p><p><br/></p><p>　 评定人义务</p><p>　　 ①、全面、细致、科学、客观地对道路交通事故受伤人员进行检验和记录;</p><p>　　 ②、正确及时地作出评定结论;</p><p>　　 ③、回答事故办案机关所提出的与评定有关的问题;</p><p>　　 ④、保守案件秘密;</p><p>　　 ⑤、严格遵守国家法律法规和有关回避原则的规定;</p><p>　　 ⑥ 、妥善保管提交评定的物品和材料。</p>'),
(22, '<h2 style="margin: 20px 0px 20px -20px; padding: 0px; font-size: 14px; font-weight: 500; border-left-width: 10px; border-left-style: solid; border-left-color: rgb(55, 171, 47); clear: both; height: 20px; line-height: 19px; text-indent: 11px; font-family: arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);"><span class="title" style="color: rgb(34, 34, 34); float: left; font-size: 20px; font-family: &#39;microsoft yahei&#39;, Arial, Helvetica, sans-serif; zoom: 1;">赔偿权利人</span><a class="conArrow" href="http://baike.haosou.com/doc/7915959-8190054.html#" data-log="h2-title" style="text-decoration: none; background-image: url(http://p0.qhimg.com/t012b40d58f262241ac.png); display: inline; float: right; font-size: 0px; height: 20px; text-shadow: none; width: 20px; background-position: 0px 0px; background-repeat: no-repeat no-repeat;">折叠</a><br/></h2><p style="margin-top: 0px; margin-bottom: 12px; padding: 0px; line-height: 28px;">赔偿权利人。侵害了健康权、生命权、身体权，在当事人之间形成一个侵权的法律关系。对这个侵权法律关系，司法解释第一条的条文里面就提到， &quot;赔偿权利人&quot;，是指因侵权行为或者其他致害原因直接遭受人身损害的受害人、依法由受害人承担扶养义务的被扶养人以及死亡受害人的近亲属。</p><h2 style="margin: 20px 0px 20px -20px; padding: 0px; font-size: 14px; font-weight: 500; border-left-width: 10px; border-left-style: solid; border-left-color: rgb(55, 171, 47); clear: both; height: 20px; line-height: 19px; text-indent: 11px; font-family: arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);"><span class="title" style="color: rgb(34, 34, 34); float: left; font-size: 20px; font-family: &#39;microsoft yahei&#39;, Arial, Helvetica, sans-serif; zoom: 1;">直接受害人</span><a class="conArrow" href="http://baike.haosou.com/doc/7915959-8190054.html#" data-log="h2-title" style="text-decoration: none; background-image: url(http://p0.qhimg.com/t012b40d58f262241ac.png); display: inline; float: right; font-size: 0px; height: 20px; text-shadow: none; width: 20px; background-position: 0px 0px; background-repeat: no-repeat no-repeat;">折叠</a><br/></h2><p style="margin-top: 0px; margin-bottom: 12px; padding: 0px; line-height: 28px;">第一种赔偿权利人就是直接受害人，就是健康权、生命权、身体权受到侵害的受害人，这种受害人是最多的。这种赔偿权利主体，就是直接受害人。 被害人没有死亡，但因伤不能参加诉讼，委托其近亲属或者其他人参加诉讼的，被害人仍是原告人，是赔偿权利人。受委托的人不能成为原告人，其身分是委托代理人。另外，被害人没有死亡，近亲属替被害人支付医疗费等其他费用的，近亲属不能以此为由，作为原告人提起诉讼。近亲属支付的医疗费等，只能由被害人自己以原告人的身份向被告人追偿。被害人抚养近亲属的费用，是从其收入中支出，因重伤、残疾收入减少、失去，无法支付抚养费的，应由被害人作为原告人以正常收入的损失为由向被告人追偿。近亲属因被害人重伤、残疾而失去抚养费的，依法由受害人承担扶养义务的被扶养人的近亲属。</p><h2 style="margin: 20px 0px 20px -20px; padding: 0px; font-size: 14px; font-weight: 500; border-left-width: 10px; border-left-style: solid; border-left-color: rgb(55, 171, 47); clear: both; height: 20px; line-height: 19px; text-indent: 11px; font-family: arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);"><span class="title" style="color: rgb(34, 34, 34); float: left; font-size: 20px; font-family: &#39;microsoft yahei&#39;, Arial, Helvetica, sans-serif; zoom: 1;">间接受害人</span><a class="conArrow" href="http://baike.haosou.com/doc/7915959-8190054.html#" data-log="h2-title" style="text-decoration: none; background-image: url(http://p0.qhimg.com/t012b40d58f262241ac.png); display: inline; float: right; font-size: 0px; height: 20px; text-shadow: none; width: 20px; background-position: 0px 0px; background-repeat: no-repeat no-repeat;">折叠</a><br/></h2><p style="margin-top: 0px; margin-bottom: 12px; padding: 0px; line-height: 28px;">第二种赔偿权利人就是间接受害人。间接受害人，指的是抚养来源受到损害的人，是死者生前扶养的人，死者生前扶养的人，原来是在死者扶养之下，扶养来源是来源于死者，因为侵权行为侵害而死亡后，使他的扶养来源受到损害，这是一个间接的损害。《民法通则》第119条实际上讲的间接受害人就是死者生前扶养的人，他的抚养来源受到了损害，他有权利请求赔偿生活补助费。最高法院在贯彻《民法通则》的司法解释当中又增加了一个间接受害人，就是造成身体残废的人，他在受伤以前所扶养的人也可以请求抚养损害赔偿，这个也是间接受害人。是赔偿权利主体。</p><p style="margin-top: 0px; margin-bottom: 12px; padding: 0px; line-height: 28px;">侵权行为人直接的侵权行为侵害了她的丈夫，造成了人身损害，但是这个侵权行为又使得她的丈夫丧失了性功能，造成了对方配偶性利益的损害，丈夫是直接受害人，妻子是一个间接受害人，这是一个间接损害。</p><h2 style="margin: 20px 0px 20px -20px; padding: 0px; font-size: 14px; font-weight: 500; border-left-width: 10px; border-left-style: solid; border-left-color: rgb(55, 171, 47); clear: both; height: 20px; line-height: 19px; text-indent: 11px; font-family: arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);"><span class="title" style="color: rgb(34, 34, 34); float: left; font-size: 20px; font-family: &#39;microsoft yahei&#39;, Arial, Helvetica, sans-serif; zoom: 1;">死者近亲属</span><a class="conArrow" href="http://baike.haosou.com/doc/7915959-8190054.html#" data-log="h2-title" style="text-decoration: none; background-image: url(http://p0.qhimg.com/t012b40d58f262241ac.png); display: inline; float: right; font-size: 0px; height: 20px; text-shadow: none; width: 20px; background-position: 0px 0px; background-repeat: no-repeat no-repeat;">折叠</a><br/></h2><p style="margin-top: 0px; margin-bottom: 12px; padding: 0px; line-height: 28px;">第三种赔偿权利人就是死者近亲属。在这个司法解释里面讲的死者近亲属，就是侵害生命权，侵权行为的直接受害者已经死亡了，这个死者近亲属他有权利请求赔偿，他也是赔偿<a href="http://baike.haosou.com/doc/3683131-3870951.html" target="_blank" style="color: rgb(19, 110, 194); text-decoration: none;">权利人</a>。我们侵权行为法讲死者近亲属，还应该考虑的不是人身损害赔偿这种情况，而是在精神损害赔偿当中，一个人的侵权行为侵害了死者的人格利益，造成死者人格利益的损害，作为死者人格利益保护人的死者近亲属，他有权提起诉讼，这种死者近亲属是更典型的。在死者近亲属作为赔偿<a href="http://baike.haosou.com/doc/3683131-3870951.html" target="_blank" style="color: rgb(19, 110, 194); text-decoration: none;">权利人</a>中，实际存在两种类型，也就是包括侵害生命权造成死亡的受害人的近亲属，和死者人格利益受到侵害作为死者人格利益保护人的死者的近亲属。被害人死亡后，其父母、子女、兄弟姐妹作为近亲属都提起民事诉讼，有的法院全部列为原告人参加诉讼，不利于诉讼效率的原则。可以让他们选定一个代表人参加诉讼，或者由法院按照继承的程序，直接指定一个第一程序继承人参加诉讼。这符合民事诉讼法规定的当事人一方为人数众多的共同诉讼，可以由当事人推选代表人参加诉讼的原则。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 10px 0px; line-height: 25px; font-size: 14px; color: rgb(51, 51, 51); font-family: 宋体, arial; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-family: arial, helvetica, sans-serif; font-size: 16px;">　受害事故当事人近亲属的范围 &nbsp;</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 10px 0px; line-height: 25px; font-size: 14px; color: rgb(51, 51, 51); font-family: 宋体, arial; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-family: arial, helvetica, sans-serif; font-size: 16px;">为明确因工死亡职工供养亲属范围，根据《</span><a href="http://www.lawtime.cn/info/sunhai/gsbxtl/" target="_blank" style="color: rgb(13, 119, 202); text-decoration: underline; font-family: arial, helvetica, sans-serif; font-size: 16px;"><span style="font-family: arial, helvetica, sans-serif; font-size: 16px;">工伤保险条例</span></a><span style="font-family: arial, helvetica, sans-serif; font-size: 16px;">》第三十七条第一款第二项的授权，制定本规定。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 10px 0px; line-height: 25px; font-size: 14px; color: rgb(51, 51, 51); font-family: 宋体, arial; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-family: arial, helvetica, sans-serif; font-size: 16px;">本规定所称因工死亡职工供养亲属，是指该职工的配偶、子女、父母、祖父母、外祖父母、孙子女、外孙子女、兄弟姐妹。&nbsp;<br/>本规定所称子女，包括婚生子女、非婚生子女、养子女和有抚养关系的继子女，其中，婚生子女、非婚生子女包括遗腹子女；&nbsp;<br/>本规定所称父母，包括生父母、养父母和有抚养关系的继父母；&nbsp;<br/>本规定所称兄弟姐妹，包括同父母的兄弟姐妹、同父异母或者同母异父的兄弟姐妹、养兄弟姐妹、有抚养关系的继兄弟姐妹。</span></p><p style="margin-top: 20px; margin-bottom: 20px; padding: 0px; font-size: 14px; line-height: 26px; color: rgb(53, 53, 53); font-family: sinSun; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-family: arial, helvetica, sans-serif; font-size: 16px;">未出生的胎儿</span></p><p style="margin-top: 20px; margin-bottom: 20px; padding: 0px; font-size: 14px; line-height: 26px; color: rgb(53, 53, 53); font-family: sinSun; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-family: arial, helvetica, sans-serif; font-size: 16px;">　但在审判实务中，未出生的胎儿因侵权行为或者其他损害事故遭受损害的情形，所在多有，不容回避。在法律适用上，其是否享有赔偿请求权问题，具有重要意义。</span><span style="font-family: arial, helvetica, sans-serif; font-size: 16px; line-height: 26px;">在胎儿出生后为间接受害人，笔者认为视胎儿存活与否，如存活另行主张，如系死胎则不存在权利。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 10px 0px; line-height: 25px; font-size: 14px; color: rgb(51, 51, 51); font-family: 宋体, arial; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-family: arial, helvetica, sans-serif; font-size: 16px;"><br/></span><br/></p><p><br/></p>');
INSERT INTO `plf_article_data` (`id`, `content`) VALUES
(23, '<p style="margin: 16px 0;padding: 0px;border: 0px;outline: 0px;font-size: 14px;font-family: SimSun;vertical-align: baseline;line-height: 26px;color: rgb(46, 46, 46);text-indent: 2em;white-space: normal;background-color: rgb(249, 252, 254)"><span style="line-height: 26px; text-indent: 2em; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 16px; font-family: 宋体; vertical-align: baseline; color: rgb(54, 54, 54);">赔偿义务人即被告，是指因自己或者他人的侵权行为以及其他致害原因依法应当承担民事责任的自然人、法人或者其他组织。</span><br/></p><p style="margin: 16px 0;padding: 0px;border: 0px;outline: 0px;font-size: 14px;font-family: SimSun;vertical-align: baseline;line-height: 26px;color: rgb(46, 46, 46);text-indent: 2em;white-space: normal;background-color: rgb(249, 252, 254)"><span style=";padding: 0px;border: 0px;outline: 0px;font-weight: inherit;font-style: inherit;font-size: 16px;font-family: 宋体;vertical-align: baseline;color: rgb(54, 54, 54)">　道路<span style="padding: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 16px; font-family: Simsun; vertical-align: baseline;">交通事故赔偿义务人</span>也叫<span style="padding: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 16px; font-family: Simsun; vertical-align: baseline; color: rgb(18, 59, 141);">交通事故赔偿</span>责任主体，是指交通事故损害赔偿责任的承担者，通常为被告。准确确定道路<span style="padding: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 16px; font-family: Simsun; vertical-align: baseline;">交通事故损害赔偿</span>责任的主体<span style="padding: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 16px; font-family: Simsun; vertical-align: baseline;">,</span>是正确处理<span style="padding: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 16px; font-family: Simsun; vertical-align: baseline; color: rgb(18, 59, 141);">交通事故损害赔偿</span>案件的基础。只有确定了损害赔偿责任的主体，受害人被侵犯的权益才能得以维护。打官司中，<span style="padding: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 16px; font-family: Simsun; vertical-align: baseline;">“</span>告谁<span style="padding: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 16px; font-family: Simsun; vertical-align: baseline;">”</span>是一个很重要的问题。如果告的对象不对，不仅浪费了时间、人力、财力，还达不到要求赔偿的目的。</span></p><p style="margin: 16px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; line-height: 26px; text-indent: 2em; white-space: normal; background-color: rgb(249, 252, 254);"><span style="color:#363636;font-family:宋体">交通事故赔偿责任主体的确定标准</span></p><p style="margin: 16px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; line-height: 26px; text-indent: 2em; white-space: normal; background-color: rgb(249, 252, 254);"><span style="color:#363636;font-family:宋体"></span></p><p style="line-height: 28px; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB W3&#39;, &#39;Hiragino Sans GB&#39;, Arial, Helvetica, simsun, u5b8bu4f53; font-size: 16px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">1、所有人自主驾驶情形下责任主体的确定标准</p><p style="line-height: 28px; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB W3&#39;, &#39;Hiragino Sans GB&#39;, Arial, Helvetica, simsun, u5b8bu4f53; font-size: 16px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">该种情形中，所有人既是运行支配者，又是运行利益的归属者，发生交通事故当然由其承担损害赔偿责任。</p><p style="line-height: 28px; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB W3&#39;, &#39;Hiragino Sans GB&#39;, Arial, Helvetica, simsun, u5b8bu4f53; font-size: 16px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">2、受雇人驾驶情形下责任主体的确定标准</p><p style="line-height: 28px; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB W3&#39;, &#39;Hiragino Sans GB&#39;, Arial, Helvetica, simsun, u5b8bu4f53; font-size: 16px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">受雇人在受所有人雇佣期间，因实施雇佣行为发生交通事故的，所有人应承担损害赔偿责任。如果雇员在受雇期间非因实施雇佣行为而发生交通事故的，原则上仍应由所有人承担赔偿责任，所有人承担赔偿责任后，可以向雇员追偿。雇员因故意或者重大过失发生交通事故的，应当与雇主承担连带赔偿责任。重大过失是指：被追究刑事责任、行政拘留、吊销驾驶证以及被认定为负全部责任。</p><p style="line-height: 28px; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB W3&#39;, &#39;Hiragino Sans GB&#39;, Arial, Helvetica, simsun, u5b8bu4f53; font-size: 16px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">3、擅自驾驶情形下的责任主体确定标准</p><p style="line-height: 28px; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB W3&#39;, &#39;Hiragino Sans GB&#39;, Arial, Helvetica, simsun, u5b8bu4f53; font-size: 16px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">未经车辆所有人同意擅自驾驶他人车辆发生交通事故的，应由擅自驾驶人承担赔偿责任。如果机动车的所有人或保管人对车辆的保管未尽应有的注意和管理义务，应连带承担赔偿责任。</p><p style="line-height: 28px; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB W3&#39;, &#39;Hiragino Sans GB&#39;, Arial, Helvetica, simsun, u5b8bu4f53; font-size: 16px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">4、被盗窃、抢劫、抢夺车辆发生交通事故时责任主体的确定标准</p><p style="line-height: 28px; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB W3&#39;, &#39;Hiragino Sans GB&#39;, Arial, Helvetica, simsun, u5b8bu4f53; font-size: 16px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">在机动车辆被他人盗窃，如果发生交通事故，由肇事者承担赔偿责任。最高人民法院在《关于被盗机动车肇事后由谁承担损害赔偿责任》的批复中明确规定：“使用盗窃的机动车肇事，造成被害人物质损失的，肇事人应当依法承担损害赔偿责任，被盗机动车的所有人不承担赔偿责任。”同样在车辆被抢劫、抢夺驾驶情形下，不论车辆所有人对于车辆的管理有无不当或者瑕疵，都应由抢劫、抢夺驾驶者承担损害赔偿责任。</p><p style="line-height: 28px; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB W3&#39;, &#39;Hiragino Sans GB&#39;, Arial, Helvetica, simsun, u5b8bu4f53; font-size: 16px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">5、分期付款买卖情形下的责任主体的确定标准</p><p style="line-height: 28px; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB W3&#39;, &#39;Hiragino Sans GB&#39;, Arial, Helvetica, simsun, u5b8bu4f53; font-size: 16px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">所谓分期付款买卖，又称所有权保留买卖，是动产买卖中普遍采用的一种交易方式。在购买人实际支配下的车辆发生交通事故，责任主体应是购买人，而不是保留所有权的出卖人。</p><p style="line-height: 28px; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB W3&#39;, &#39;Hiragino Sans GB&#39;, Arial, Helvetica, simsun, u5b8bu4f53; font-size: 16px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">6、车辆买卖未过户情形下的责任主体的确定标准</p><p style="line-height: 28px; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB W3&#39;, &#39;Hiragino Sans GB&#39;, Arial, Helvetica, simsun, u5b8bu4f53; font-size: 16px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">车辆买卖未办理过户手续，但车辆已经实际交付的，发生交通事故后，应由车辆的买受人或控制人承担损害赔偿责任。</p><p style="line-height: 28px; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB W3&#39;, &#39;Hiragino Sans GB&#39;, Arial, Helvetica, simsun, u5b8bu4f53; font-size: 16px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">7、出租、出借情形下的责任主体的确定标准</p><p style="line-height: 28px; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB W3&#39;, &#39;Hiragino Sans GB&#39;, Arial, Helvetica, simsun, u5b8bu4f53; font-size: 16px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">车辆所有人将车辆租给或借给他人使用，如发生交通事故，应由出租人、承租人承担损害赔偿责任，车辆所有人不承担赔偿责任。但出租人明知租用人或者出借人明知借用人不具备驾驶车辆的资格或者车辆本身存在安全隐患的，应承担连带赔偿责任。</p><p style="line-height: 28px; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB W3&#39;, &#39;Hiragino Sans GB&#39;, Arial, Helvetica, simsun, u5b8bu4f53; font-size: 16px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">8、车辆承包发包情形下的责任主体的确定标准</p><p style="line-height: 28px; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB W3&#39;, &#39;Hiragino Sans GB&#39;, Arial, Helvetica, simsun, u5b8bu4f53; font-size: 16px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">车辆所有人将车辆发包给他人承包期间，承包方发生交通事故，发包方与承包方承担连带赔偿责任。</p><p style="line-height: 28px; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB W3&#39;, &#39;Hiragino Sans GB&#39;, Arial, Helvetica, simsun, u5b8bu4f53; font-size: 16px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">9、挂靠情形下的责任主体的确定标准</p><p style="line-height: 28px; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB W3&#39;, &#39;Hiragino Sans GB&#39;, Arial, Helvetica, simsun, u5b8bu4f53; font-size: 16px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;"><span style="font-family: impact, chicago;">挂靠经营的机动车发生交通事故致人损害的，应由挂靠人和被挂靠人承担连带赔偿责任，挂靠人与被挂靠人之间约定被挂靠人对交通事故的后果免责的，仅在双方之间具有约束力。</span></p><p style="line-height: 28px; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB W3&#39;, &#39;Hiragino Sans GB&#39;, Arial, Helvetica, simsun, u5b8bu4f53; font-size: 16px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">10、车辆送交修理或保管期间的责任主体的确定标准</p><p style="line-height: 28px; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB W3&#39;, &#39;Hiragino Sans GB&#39;, Arial, Helvetica, simsun, u5b8bu4f53; font-size: 16px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">机动车送交修理或委托保管期间，修理人或保管人因使用车辆发生交通事故的，应由修理人和保管人承担赔偿责任。</p><p style="line-height: 28px; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB W3&#39;, &#39;Hiragino Sans GB&#39;, Arial, Helvetica, simsun, u5b8bu4f53; font-size: 16px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">11、车辆被质押情形下的责任主体的确定标准</p><p style="line-height: 28px; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB W3&#39;, &#39;Hiragino Sans GB&#39;, Arial, Helvetica, simsun, u5b8bu4f53; font-size: 16px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">车辆被质押后期间发生交通事故，应由车辆的控制人承担赔偿责任。</p><p style="line-height: 28px; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB W3&#39;, &#39;Hiragino Sans GB&#39;, Arial, Helvetica, simsun, u5b8bu4f53; font-size: 16px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">12、好意同乘情形下的责任主体的确定标准</p><p style="line-height: 28px; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB W3&#39;, &#39;Hiragino Sans GB&#39;, Arial, Helvetica, simsun, u5b8bu4f53; font-size: 16px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">好意同乘者，是指在车辆所有人或控制人好意并无偿地邀请或允许搭乘该车的人因交通事故导致人身损害的，车辆所有人或控制人应当承担损害赔偿责任。如果好意同乘者有过错的，可减轻车辆所有人或控制人的责任。</p><p class="reader-word-layer reader-word-s1-2" style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 225px; font-family: 宋体, a59b901fc5da50e2524d7fca0010001, 宋体; letter-spacing: -0.55px; position: absolute; -webkit-font-smoothing: antialiased; text-shadow: rgba(0, 0, 0, 0.00392157) 1px 1px 1px; background-color: rgb(255, 255, 255); width: 5183px; height: 225px; line-height: 225px; top: 1490px; left: 2199px; z-index: 70;">保险公司作为道路交通事故赔偿责任主体的确定标准</p><p style="margin: 16px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; line-height: 26px; text-indent: 2em; white-space: normal; background-color: rgb(249, 252, 254);"><span style="color:#363636;font-family:宋体"></span></p><p class="reader-word-layer reader-word-s1-2" style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 225px; font-family: 宋体, a59b901fc5da50e2524d7fca0010001, 宋体; letter-spacing: -0.55px; position: absolute; -webkit-font-smoothing: antialiased; text-shadow: rgba(0, 0, 0, 0.00392157) 1px 1px 1px; background-color: rgb(255, 255, 255); width: 5183px; height: 225px; line-height: 225px; top: 1490px; left: 2199px; z-index: 70;">保险公司作为道路交通事故赔偿责任主体的确定标准</p><p style="margin: 16px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; line-height: 26px; text-indent: 2em; white-space: normal; background-color: rgb(249, 252, 254);"><span style="color:#363636;font-family:宋体"></span>保险公司为赔偿义务人<br/></p><p style="line-height: 1.75em;">《道路交通安全法》第75条规定：“肇事车辆参加机动车第三者责任强制保险的，由保险公司在责任限额范围内支付抢救费用，抢救费用超过责任额的……”。 该法第76条规定：“机动车发生交通事故造成人身伤亡、财产损失的，由保险公司在机动车第三者责任强制保险责任限额范围内予以赔偿……”。 道路交通安全法对保险公司的责任作出了明确规定。保险公司是赔偿款支付的主体，保险公司在责任限额范围内支付抢救费用，机动车发生交通事故造成人身伤亡、财产损失的，由保险公司在机动车第三者责任强制保险责任限额范围内予以赔偿，保险公司在保险金额的支付过程中可能与一方或双方当事人发生争议，出现拒付或少付保险费的现象，需要民事判决强制理赔; 我国保险法第50条第二款规定：“责任保险是指以被保险人对第三者依法应负的赔偿责任为保险标的的保险。”交通事故的受害人因此应取得对保险公司的直接请求权，保险公司有义务直接对受害人给付赔偿金。当事人申请或人民法院因案情需要，可以追加保险公司为被告。</p><p style="line-height: 1.75em;">&nbsp; 交通事故中的违约责任赔偿</p><p style="text-indent: 2em; padding: 0px; margin-top: 10px; margin-bottom: 0px; font-family: 宋体; font-size: 14px; line-height: 1.75em; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-family: arial, helvetica, sans-serif; font-size: 16px;">《合同法》第104条规定：“当事人不履行合同义务或者履行合同义务不符合约定的，应当承担继续履行、采取补救措施或者赔偿损失等违约责任。”交通事故当事人在维护自己权益时，经常会遇到侵权责任请求权与</span><a href="http://www.fabao365.com/laodong/gongshang" class="wlink" target="_blank" style="color: rgb(0, 85, 153); font-family: arial, helvetica, sans-serif; text-decoration: underline; font-size: 16px;"><span style="font-family: arial, helvetica, sans-serif; font-size: 16px;">工伤</span></a><span style="font-family: arial, helvetica, sans-serif; font-size: 16px;">保险请求权的竞合，侵权责任请求权与违约责任请求权的竞合，车辆维修、保管或借用期间的交通事故。</span></p><p style="text-indent: 2em; padding: 0px; margin-top: 10px; margin-bottom: 0px; font-family: 宋体; font-size: 14px; line-height: 1.75em; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-family: arial, helvetica, sans-serif; font-size: 16px;">1、乘客事故。承运人应当对运输过程中旅客的伤亡承担损害赔偿责任，但伤亡是旅客自身健康原因造成的或者承运人证明伤亡是旅客故意、重大过失造成的除外。前款规定适用于按照规定免票、持优待票或者经承运人许可搭乘的无票旅客。乘客乘坐的客车与另一辆车相撞而发生交通事故，乘客人身、财产遭到损害的，可依客运合同关系要求承运人承担违约责任，给予赔偿；同时也可依侵权损害赔偿的法律规定要求对交通事故负有责任的车辆所有者或经营者承担侵权责任，赔偿损失，但只能择一行使权利。</span></p><p style="text-indent: 2em; padding: 0px; margin-top: 10px; margin-bottom: 0px; font-family: 宋体; font-size: 14px; line-height: 1.75em; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-family: arial, helvetica, sans-serif; font-size: 16px;">2、交通工伤事故。如果劳动者遭受工伤，是由于交通事故第三人的侵权行为造成，第三人不能免除民事赔偿责任，即交通事故与工伤双赔偿。工伤保险与民事损害赔偿的关系从性质上看，工伤保险属于</span><a href="http://www.fabao365.com/baoxianlipei/shehuibaoxian" class="wlink" target="_blank" style="color: rgb(0, 85, 153); font-family: arial, helvetica, sans-serif; text-decoration: underline; font-size: 16px;"><span style="font-family: arial, helvetica, sans-serif; font-size: 16px;">社会保险</span></a><span style="font-family: arial, helvetica, sans-serif; font-size: 16px;">范畴，与私权救济性质的民事损害赔偿存在根本的差别。这就产生了工伤保险赔偿与民事损害赔偿的竞合。</span></p><p style="text-indent: 2em; padding: 0px; margin-top: 10px; margin-bottom: 0px; font-family: 宋体; font-size: 14px; line-height: 1.75em; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-family: arial, helvetica, sans-serif; font-size: 16px;">3、车辆保管合同。保管合同合同中，保管人保管不善即相当于保管人有过错，应承担违约责任。如机动车送交修理的责任主体等。车辆修理期间所发生的交通事故，车辆修理人为民事赔偿责任主体保管期间所发生的。由保管人为民事赔偿责任主体。因为此时的机动车所有人已经丧失运行支配力，也丧失了运行利益。</span></p><p style="text-indent: 2em; padding: 0px; margin-top: 10px; margin-bottom: 0px; font-family: 宋体; font-size: 14px; line-height: 1.75em; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-family: arial, helvetica, sans-serif; font-size: 16px;">4、代驾司机发生交通事故的损失赔偿。代驾司机是受代驾公司指派的，其代驾行为是职务行为。公司和酒后顾客之间存在委托合同关系。酒后顾客找代驾公司的目的就是为了防止发生交通事故，找代驾公司后出现交通事故，合同目的没有实现。如由于代驾司机的责任造成的，则存在违约问题。代驾司机发生交通事故，所造成的损失应先由保险公司赔偿，超额部分由代驾公司承担。</span></p><p style="text-indent: 2em; padding: 0px; margin-top: 10px; margin-bottom: 0px; font-family: 宋体; font-size: 14px; line-height: 1.75em; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-family: arial, helvetica, sans-serif; font-size: 16px;">交通事故赔偿归责原则</span></p><p style="text-indent: 2em; padding: 0px; margin-top: 10px; margin-bottom: 0px; font-family: 宋体; font-size: 14px; line-height: 1.75em; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-family: arial, helvetica, sans-serif; font-size: 16px;"><span style="color: rgb(54, 54, 54); font-family: Simsun; font-size: 16px; line-height: 25.59375px; background-color: rgb(249, 252, 254);">1、机动车是一种高速运行的交通工具，根据民法通则第一百二十三条的规定，高速工具造成他人损害的，应当承担民事责任，惟一的免责事由是能够证明损害是由受害人故意造成的，故交通事故责任是无过错责任。<span style="color: rgb(54, 54, 54); font-family: Simsun; font-size: 16px; line-height: 25.59375px; background-color: rgb(249, 252, 254);">交通事故中机动车与行人而言，行人处于绝对的弱势地位，机动车处于强势地位，立法对此予以倾斜。此类交通事故采无过错责任原则并不排除过失相抵原则的适用，行人和非机动车如存在重大过失的，可根据过失相抵原则，减轻机动车保有者的赔偿责任，但必须明确的是减轻，而不是免除。</span></span></span></p><p style="text-indent: 2em; padding: 0px; margin-top: 10px; margin-bottom: 0px; font-family: 宋体; font-size: 14px; line-height: 1.75em; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-family: arial, helvetica, sans-serif; font-size: 16px;"><span style="color: rgb(54, 54, 54); font-family: Simsun; font-size: 16px; line-height: 25.59375px; background-color: rgb(249, 252, 254);">2、机动车之间发生的交通事故，实行严格的过错责任原则，有过错的一方承担责任，如果双方都有过错，则实行过错比较，按照过失相抵原则确定双方的责任。不存在哪方优势的问题，它们相互接触发生的交通事故应首先考虑适用过错责任原则，无法查清双方的过错的，应适用公平责任原则。机动车发生碰撞，确定责任大小，除考虑过错大小外，还应考虑“优者危险负担”原则的适用。“优者危险负担”原则，是处理交通事故损害赔偿责任的特有原则，是现代法治“抑强扶弱”基本精神的体现。所谓“优者危险负担”原则，是指在受害人有过失的情况下，考虑到双方对道路交通注意义务的轻重，按机动车辆危险性的大小以及危险回避能力的优劣，分配交通事故的损害后果</span></span></p><p style="text-indent: 2em; padding: 0px; margin-top: 10px; margin-bottom: 0px; font-family: 宋体; font-size: 14px; line-height: 1.75em; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-family: arial, helvetica, sans-serif; font-size: 16px;"><span style="color: rgb(54, 54, 54); font-family: Simsun; font-size: 16px; line-height: 25.59375px; background-color: rgb(249, 252, 254);">3、<span style="color: rgb(54, 54, 54); font-family: Simsun; font-size: 16px; line-height: 25.59375px; background-color: rgb(249, 252, 254);">在确立无过错责任为</span><a href="http://www.szshigu.com/" class="WU" style="margin: 0px; padding: 0px; text-decoration: none; color: rgb(54, 54, 54); font-family: Simsun; font-size: 16px; line-height: 25.59375px; white-space: normal; background-color: rgb(249, 252, 254);">归责原则</a><span style="color: rgb(54, 54, 54); font-family: Simsun; font-size: 16px; line-height: 25.59375px; background-color: rgb(249, 252, 254);">的前提下，考虑过失相抵原则、优者危险负担原则，合理界定损害赔偿民事责任</span></span></span></p><p style="text-indent: 2em; padding: 0px; margin-top: 10px; margin-bottom: 0px; font-family: 宋体; font-size: 14px; line-height: 1.75em; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-family: arial, helvetica, sans-serif; font-size: 16px;"><span style="color: rgb(54, 54, 54); font-family: Simsun; font-size: 16px; line-height: 25.59375px; background-color: rgb(249, 252, 254);"><span style="color: rgb(54, 54, 54); font-family: Simsun; font-size: 16px; line-height: 25.59375px; background-color: rgb(249, 252, 254);">4、<span style="color: rgb(54, 54, 54); font-family: Simsun; font-size: 16px; line-height: 25.59375px; background-color: rgb(249, 252, 254);">公平责任原则，又称衡平原则，是指当事双方在对造成损害均无过错的情况下，由人民法院根据公平的观念，在考虑当事人的财产状况及其他情况的基础上，责令加害人对受害人的财产损失给予适当的补偿</span></span></span></span></p><p><br/></p>'),
(24, '<p>&nbsp; &nbsp; 对于交通事故损害赔偿项目及赔偿标准，以往由《办法》规定，涉及人身损害赔偿的其他案件的赔偿项目和标准也是参照《办法》计算。主要包括以下三部分:一、农村居民与城市居民区分标准;二、道路交通事故赔偿项目的赔偿标准;三、道路交通事故财产赔偿金额的赔偿标准。</p><p>农村城镇标准划分</p><p>&nbsp;&nbsp; &nbsp;依据《人身损害赔偿解释》的规定，残疾的赔偿金、被扶养人生活费、死亡赔偿金的计算标准应根据审查确定的赔偿权利人的身份情况分别按照城镇居民和农村居民的有关标准进行计算。大量的农民工进入城镇打工或定居，他们已是城镇居民中的一个特殊群体，部分地区农村居民实际年均收人已同于甚至高于城镇居民年均收入，如果无视这一客观实际，仅仅因为受害人为农村户籍就一律按农村居民标准进行赔偿，有违公平。因此，在确认赔偿权利人的身份时应以户籍登记主义为原则，以经常居住地为例外。如果户籍在各镇所在地的居委、村及虽未建成但已列入城镇规划区的村，即作为城镇居民。对于赔偿权利人虽为农村居民，但如有证据证实发生交通事故时其工作单位或实际居住满一年的地点在镇所在地的居委、村及虽未建成但已列入城镇规划区的村的，也作为城镇居民，在计算赔偿数额时按城镇居民的标准对待，实行同城待遇，这样才能体现法律面前人人平等和对农村居民的公平保护。如果还有特殊情况，难以区分是城镇居民还是农村居民的，就高不就低，按城镇居民对待。</p>'),
(108, '<p><span style="font-family: 宋体, SimSun;">2015商业车险新规（《关于加强机动车辆商业保险条款费率管理的通知》）正式启动，一度备受争议的“高保低赔”、“无责不赔”问题有望得到解决，今日</span><span style="font-family: 宋体, SimSun;">交通新规</span><span style="font-family: 宋体, SimSun;">小编就和大家说说<span style="color: rgb(255, 0, 0); font-family: 宋体, SimSun;"><strong>2015商业车险新规的十大亮点</strong></span>，让大家更好的了解2015商业车险新规的好处。（点击查看：</span><span style="font-family: 宋体, SimSun;"><strong><span style="color: rgb(0, 32, 96); font-family: 宋体, SimSun; text-decoration: underline;">2015车险新规解读：事故车保险费用增加</span></strong></span><span style="font-family: 宋体, SimSun;">）<br/><br/></span></p><p><br/></p><p style="text-align: center;"><img alt="2015商业车险新规十大亮点解析.jpg" src="/data/upload/ueditor/image/.jpg"/></p><p><br/><span style="font-family: 宋体, SimSun;">　　<br/>　　<strong><span style="color: rgb(0, 176, 80); font-family: 宋体, SimSun; font-size: 20px;">2015商业车险新规亮点一：机动车按实价投保</span></strong><br/>　　按照现行的车险条款，旧车车主在购买车损险确定保险金额时，如果按照车辆折旧后的实际价值投保，一旦发生部分损失，保险公司要按照保险金额与投保时的新车购置价比例计算赔偿，即车主无法获得足额的维修费用。但即使旧车车主选择按照新车购置价投保，一旦车辆全损，也只能按照出险时车辆的实际价值获得赔偿。<br/><br/>　　而按照《通知》，保险公司和车主应当按照市场公允价值协商确定被保险机动车的实际价值，并协商约定保险金额。中保协在去年10月发布的《机动车辆保险示范条款(征求意见稿)》中更规定，车损险的保险金额按投保时保险机动车的实际价值确定；保险机动车发生全部损失，保险人按保险金额进行赔偿；保险机动车发生部分损失，保险人按实际修复费用在保险金额内计算赔偿。<br/><br/>　　这样，“高保低赔”的问题就有望在新车险中得到解决。但业内人士也表示，由于新车损险的保险责任有所扩大，相应费率也可能进行调整。<br/><br/>　　<span style="color: rgb(0, 176, 80); font-family: 宋体, SimSun; font-size: 20px;"><strong>2015商业车险新规亮点二 无责也可先行获赔</strong></span><br/>　　现在车主购买了车损险，保险公司通常只在车主在事故中负有责任的情况下，才对车辆的损失进行赔偿，车主无责任时则不赔偿。这就是所谓的“无责不赔”。<br/><br/>　　而按照《通知》，因第三者对被保险机动车的损害而造成保险事故的，保险公司自向车主赔偿保险金之日起，在赔偿金额范围内代位行使车主对第三者请求赔偿的权利。保险公司不得通过放弃代位求偿权的方式拒绝履行保险责任。<br/><br/>　　这样，以后豪车车主购买了新车损险产品，一旦豪车被撞，而对方又无力赔偿时，豪车车主就有望先从保险公司获得维修费用，再由保险公司向肇事方追偿。<br/><br/>　　<span style="color: rgb(0, 176, 80); font-family: 宋体, SimSun; font-size: 20px;"><strong>2015商业车险新规亮点三 设置适当免赔额度</strong></span><br/>　　《通知》要求商业车险条款设置适当的免赔额和免赔率，应当依照防范道德风险、节约社会资源、促进被保险人防灾减损的目的，遵循条款清晰明确、风险共担比例公平合理、不损害被保险人合法权益的原则。<br/><br/>　　本市保险业人士分析说，免赔额和免赔率的设定体现了“风险共担”原则，即车主即使投保了车险，在出险时，也要自行承担一部分损失。这样，由于事关自身利益，车主在投保后，也会注意安全行驶。<br/><br/>　　<span style="color: rgb(0, 176, 80); font-family: 宋体, SimSun; font-size: 20px;"><strong>2015商业车险新规亮点四 索赔材料有所简化</strong></span><br/>　　车辆出险后，车主都会希望尽快拿到赔款，而收集齐全保险公司需要的索赔材料，让不少车主都感觉头疼。<br/><br/>　　《通知》规定，商业车险条款不得要求车主提供与确认保险事故的性质、原因、损失程度等无关的证明和资料。而中保协征求意见的《示范条款》已对商业车险的索赔资料进行了简化，例如不再要求车损险索赔提供营运许可证或道路运输许可证复印件，不再要求盗抢险索赔提供驾驶证复印件、行驶证正副本、全套原车钥匙等资料。这种简化有利于车主更快捷地办理索赔手续，提升车险理赔效率。<br/><br/>　　<span style="color: rgb(0, 176, 80); font-family: 宋体, SimSun; font-size: 20px;"><strong>2015商业车险新规亮点五 强调提示说明义务</strong></span><br/>　　一些车主反映，保险公司销售人员在推销车险产品时，大多会在保费折扣优惠方面“多说几句”，而对于免责条款则说得很少或者根本不提。有的保险公司虽然会将车险条款提供给车主，但由于条款描述通常比较专业，车主看过也常常是“一知半解”。<br/><br/>　　按照《通知》，新车险产品会在投保单首页最显著的位置，用红色四号以上字体增加“责任免除特别提示”，对保险条款中免除保险公司责任的条款作出足以引起车主注意的提示；工作人员还会采用通俗易懂的方式，对该条款的内容以书面或者口头形式向车主作出明确说明。同时，新车险条款会将所有涉及免除保险公司责任的条款集中放在责任免除项下列明，并采用加黑等足以引起车主注意的方式进行提示。<br/><br/>　　<span style="color: rgb(0, 176, 80); font-family: 宋体, SimSun; font-size: 20px;"><strong>2015商业车险新规亮点六 保费差距有望扩大</strong></span><br/>　　据了解，当前各家保险公司的商业车险产品，基本都是在中保协拟定的三款车险条款、费率中选用其一，而协会拟定的这三款车险产品，本身差别也不太大，因此不同保险公司销售的车险产品条款非常类似，费率也相差无几。<br/><br/>　　而此次《通知》规定了三种商业车险条款费率开发模式。保险公司设计新车险产品时，可以参考和使用协会示范条款和行业参考纯损失率拟订本公司的商业车险条款费率；如果达到一定标准，还可以在协会示范条款基础上适当增加商业车险条款的保险责任，甚至根据自有数据独立拟订商业车险条款和费率。<br/><br/>　　保险业人士表示，新车险产品问世以后，市场中可能会出现一些富有特色的车险条款，费率表可能会划分得比现在更加细致。由此，车主购买不同保险公司的车险产品，支付的保费差距也会扩大。<br/><br/>　　<span style="color: rgb(0, 176, 80); font-family: 宋体, SimSun; font-size: 20px;"><strong>2015商业车险新规亮点七 合理设置费率浮动</strong></span><br/>　　据了解，在当前的商业车险产品中，虽然保险公司也设置了众多费率浮动因子，但常用的只有以往保险年度索赔记录，即上年索赔次数。许多车主虽然已投保多年，但仍不知道保险公司对于指定驾驶人，驾驶人年龄、性别、驾龄，行驶区域，平均年行驶里程等方面的费率浮动政策。<br/><br/>　　按照《通知》规定，商业车险费率浮动因子应当根据机动车辆和驾驶人的风险状况等合理设置，明确规范。这样，如果车主在投保时根据自身情况指定了驾驶人或者指定了行驶区域，就可以减少一部分保费支出。<br/><br/>　　也有保险业人士预期，随着机动车市场的丰富，新车险在车型系数方面的规定将更加细致，对于有些出险频繁、维修费用高的车型，保险公司可能会提高保费标准。<br/><br/>　　<span style="color: rgb(0, 176, 80); font-family: 宋体, SimSun; font-size: 20px;"><strong>2015商业车险新规亮点八 附加费用率不超35%</strong></span><br/>　　《通知》规定，保险公司拟订商业车险费率，原则上预定附加费用率不得超过35%。<br/><br/>　　据了解，所谓“附加费用”，就是保险公司的各种经营、销售费用，支付给中介机构的代理费就包括其中。以往保险公司为了争取中介机构的销售支持，常常会向其支付相当可观的代理费，甚至为此引发“恶性竞争”，导致理赔服务质量无法保证。现在保监会对“附加费用率”作出上限规定，保险公司就会倾向于加强经营、销售方面的成本管理，从而使得新车险产品保费下降成为可能。<br/><br/>　　<span style="color: rgb(0, 176, 80); font-family: 宋体, SimSun; font-size: 20px;"><strong>2015商业车险新规亮点九 不同渠道费率不同</strong></span><br/>　　前些年，车主购买车险产品，基本都是通过保险中介机构，或者是到保险公司直接购买。而最近几年，车险产品的电话销售和网络销售模式迅速普及。通过电销或者网销的模式购买车险，车主既可以享受与传统车险相同的理赔服务，又可以节省大约15%的保费支出。<br/><br/>　　此次《通知》也规定，保险公司可以根据电话、网络、门店等不同的销售渠道，拟订不同的附加费用率水平。这样一来，保险公司可能会更多地采用电话、网络等直销模式销售新车险产品，将原先支付给中介机构的代理费用节省下来，让利给车主。<br/><br/>　　<span style="color: rgb(0, 176, 80); font-family: 宋体, SimSun; font-size: 20px;"><strong>2015商业车险新规亮点十 条款费率动态调整</strong></span><br/>　　以往的车险条款和费率，大多是一经制定、审批，就保持几年不变。<br/><br/>　　而新车险将建立条款费率的动态调整机制。《通知》规定保险公司应当根据历史经验数据、经营情况和准备金提取等实际情况，每年对商业车险费率进行合理性评估验证。这样，新车险条款费率就能适应市场变化，及时调整。</span></p><p><span style="font-family: 宋体, SimSun;">来源：网络</span></p>'),
(25, '<p>“事故双方自行报案”处理程序以及相关手续：在道路上发生交通事故，未造成人身伤亡，当事人双方对事实及成因无争议的，按照以下步骤处理：</p><p>　　 ①、撤出事故现场，迅速恢复交通；</p><p>　　 ②、由责任方通知保险公司进行定损；</p><p>　　 ③、双方写明事故经过；</p><p>　　 ④、事故双方带上驾驶证、行驶证、保险公司定损单及其复印件，共同前往交警分局事故大队处理；<span style="font-size: 16px;">&nbsp; &nbsp;</span></p><p>　　 ⑤、交警部门对事故进行核实后，由事故责任方赔偿损失。</p><p>交警快速处理交通事故的程序以及相关手续：在道路上发生交通事故，当事人对交通事故事实及成因有争议的，</p><p>按照以下步骤处理：</p><p>　①、迅速报警，交警进行现场勘查后，当场做出事故认定，撤出事故现场，恢复交通；<span style="font-size: 16px;">&nbsp; &nbsp; &nbsp; &nbsp;</span></p><p>&nbsp; ②、由责任方通知保险公司做出车辆损失鉴定；</p><p>&nbsp; ③、双方共同前往交警分局事故大队，并提供驾驶证、行驶证、定损单的原件及其复印件，写出事故经过；<span style="font-size: 16px;">&nbsp; &nbsp; &nbsp;</span></p><p>&nbsp; ④、由责任方赔偿损失，无责方将事故维修费用发票交给责任方；</p><p>&nbsp; ⑤、无责方离去，交警部门依据《道路交通安全法》对责任方造成事故的违法事实做出处罚；<span style="font-size: 16px;">&nbsp; &nbsp; &nbsp;</span></p><p>&nbsp; ⑥、交警部门对责任方出具有效凭证，责任方依据该凭证找保险公司理赔。</p><p><br/></p>'),
(26, '<p>&nbsp; &nbsp; 投保机动车辆保险无疑是转移事故风险最可行的办法，因此机动车辆驾驶者、所有人应合理搭配险种，在尽量节省保险费的前提下，最大限度的转移事故风险。如何正确的给自己爱车选择一份适合的保险，既能把损失降到最低、又不多掏冤枉钱，的确是摆在新老车主们面前的一个问题。车险要想买得省钱,首先要了解各险种,才知自己的车需要买什么,不需要买什么。 &nbsp;&nbsp;</p><p>&nbsp;&nbsp;</p><p>&nbsp; &nbsp;&nbsp;</p><p>&nbsp; &nbsp; &nbsp;&nbsp;</p><p>&nbsp; &nbsp;&nbsp;</p><p><br/></p>'),
(27, '<p><span style="font-size: 16px;">机动车保险主要分为基本险和附加险两部分。基本险分为车辆损失险，第三者责任险。附加险分为盗抢险，司乘意外伤害险和玻璃单独破碎险、自燃损失险、不计免赔特约险等。在此对机动车辆的险种略作分析:</span><br/></p><p><span style="font-size: 16px;"></span></p><p>①、交强险(法定强制性保险)：是《机动车交通事故责任强制保险条例》规定的法定强制性保险，由保险公司对被保险机动车发 &nbsp; &nbsp; 生道路交通事故造成本车人员、被保险人以外的受害人的人身伤亡、财产损失，在责任限额内予以赔偿的强制性责任保险。 &nbsp; &nbsp;对未参加机动车交通事故责任强制保险的机动车，机动车管理部门不得予以登记，机动车安全技术检验机构不得予以检验。</p><p><br/></p><p>②、第三者责任险 (主险)：指合格驾驶员在使用被保险车辆过程中发生意外事故而造成第三者的财产直接损失与人员伤亡的， &nbsp; &nbsp; &nbsp; 依法应当由被保险人承担的经济赔偿责任，保险人负责赔偿。以现在的赔付标准,建议最少买10万,最好买20万,&nbsp;因5万、10 &nbsp; &nbsp; &nbsp; 万、20万的三者险价钱相差不大,总之这个险种买大的自己安心。&nbsp;&nbsp;</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">③、车辆损失险(主险)：指保险车辆遭受保险责任范围内的自然灾害(不包括地震)&nbsp;或意外事故等，造成保险车辆本身损失，保 &nbsp; &nbsp; &nbsp; 险人依据保险合同的规定给予赔偿。这个险种与第三者刚好相反，因为三者险是保险他人的，而车损险是保自己的,记得车损 &nbsp; &nbsp; 险应该买。</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp;&nbsp;</p><p style="white-space: normal;">④、盗抢险(主险) ：如果你的车在日常使用过程中一直都在比较安全的停车场中停放，上下班路途中也没有什么特别僻静的路 &nbsp; &nbsp; &nbsp; 段，就可以考虑不保盗抢险(对于所住地区治安不佳、没有固定停车场的车，或者你的车属于很常见的、丢失率比较高的车 &nbsp; &nbsp; &nbsp; 型，那一定要保盗抢险)。</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp;&nbsp;</p><p style="white-space: normal;">⑤、车上人员责任险 (附加险)</p><p style="white-space: normal;">&nbsp; &nbsp;车上人员责任险并不建议买，因为该险种费率较高，保障范围还比较窄。建议单独考虑人寿保险的产品，保障范围和保险费一 &nbsp; &nbsp;般都更低更好!如果你的车经常有家人、朋友坐或者是营运车辆，那你也可以考虑买一点，不过不用买太多，保障额度在1万-2 &nbsp; &nbsp;万元/座就够了。</p><p><br/></p><p>⑥、玻璃单独碎险 (附加险)：指使用过程中发生本车玻璃单独破碎。注意&quot;单独“两字,如是其它事故引起的,车损险里有赔,如 &nbsp; &nbsp; &nbsp;系国产车,玻璃不贵,想省保费可不买，想要进口的玻璃一定要特别说明。&nbsp; &nbsp; &nbsp;&nbsp;<br/></p><p>&nbsp; &nbsp; &nbsp;</p><p>⑦、自燃险 (附加险,有的条款包含在车损险中)：车辆在行驶过程中,因本车电器、线路、供油系统发生故障及载运货物自燃原因 &nbsp; &nbsp; 起火燃烧,造成车辆损失以及施救所支付的合理费用。知名品牌且新车建议不买，三年以上的车建议考虑, 也有的保险公司赠 &nbsp; &nbsp;送自燃险或者包含在车损险里面。&nbsp; &nbsp;&nbsp;</p><p>&nbsp; &nbsp; &nbsp;</p><p style="white-space: normal;">⑧、划痕险 (附加险)</p><p style="white-space: normal;">&nbsp; &nbsp; 在使用过程中,被他人刮划(无明显碰撞痕迹)需要修复的费用。一般新手开新车就应该买。</p><p>&nbsp;<br/></p><p>⑨、不计免赔 (附加险)：车辆发生车辆损失险或第三者责任险的保险事故造成赔偿，对应由被保险人承担的免赔金额，由保险公 &nbsp; &nbsp; 司负责赔。&nbsp;不计免赔率/ 额险几乎是个必保的好险种，建议加上!特别是新手，加上了会有用的，尤其在你碰到大事故时， &nbsp; &nbsp; 这个险种可以大大减少你的损失。&nbsp; &nbsp; &nbsp;</p><p>&nbsp; &nbsp; &nbsp;&nbsp;</p><p>&nbsp; &nbsp; &nbsp;</p><p>&nbsp;&nbsp;<span style="font-size: 16px;">&nbsp; &nbsp;&nbsp;</span></p><p>&nbsp; &nbsp; &nbsp;&nbsp;</p><p>&nbsp; &nbsp; &nbsp;&nbsp;</p><p>&nbsp;&nbsp;<span style="font-size: 16px;">&nbsp; &nbsp; &nbsp;&nbsp;</span></p><p>&nbsp; &nbsp; &nbsp;</p><p>&nbsp; &nbsp;&nbsp;</p><p><span style="font-size: 16px;"></span></p><p><br/></p><p>&nbsp; &nbsp; &nbsp;</p><p>&nbsp; &nbsp; &nbsp;&nbsp;</p><p>&nbsp; &nbsp;&nbsp;</p><p>&nbsp;</p><p>&nbsp; &nbsp; &nbsp;<span style="font-size: 16px;">&nbsp;</span></p><p><br/></p><p>&nbsp; &nbsp; &nbsp;</p><p>&nbsp; &nbsp; &nbsp;</p><p>&nbsp; &nbsp;&nbsp;</p><p><br/></p><p>&nbsp; &nbsp;</p><p><br/></p><p>&nbsp; &nbsp;&nbsp;</p><p>&nbsp; &nbsp;&nbsp;</p><p>&nbsp; &nbsp;</p><p><span style="font-size: 16px;"><br/></span><br/></p><p><br/></p>'),
(28, '<p>鉴于上述各险种的分析, 根据车龄、驾驶员驾龄的不同，把各类险种进行合理搭配后，提供几种车险组合方式供大家选择:</p><p>&nbsp; &nbsp; &nbsp;①、基本型保障方案：单买交强险，最省保险费，适用于车辆使用较长时间、&nbsp;驾驶技术娴熟、不跑长途、愿意自己承担大 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;部分风险、减少保费支出的车主。<span style="font-size: 16px;">&nbsp; &nbsp; &nbsp;&nbsp;</span></p><p>&nbsp; &nbsp; &nbsp;②、经济型保障方案1：交强险+第三者10万+车损+不计免赔率/额(既省钱又对己对人有保障，适合有安全保障的停车位、司 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;机有一定驾龄、愿意自己承担部分风险的车主。)&nbsp; &nbsp;<span style="font-size: 16px;">&nbsp; &nbsp;</span></p><p>&nbsp; &nbsp; &nbsp;③、经济型保障方案2：交强险+第三者20万+车损+盗抢+不计免赔率/ 额+玻璃+划痕+车上人员责任险(适合新车、新手)<span style="font-size: 16px;">&nbsp; &nbsp;&nbsp;</span></p><p>&nbsp; &nbsp; &nbsp;④、全面保障方案：交强险+商业三责险(50万元)+车损险+车上人员责任险+&nbsp;盗抢险+玻璃单独破碎险+不计免赔特约+车身划 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;痕损失险+其他个性化附加险。适用于新车新手、高档车及需要全面保障的车主。&nbsp; &nbsp;<span style="font-size: 16px;">&nbsp;&nbsp;</span></p><p>最后一个重要问题是车价,它是计算保费的基数,车价的高低决定保费的多少,大家不要以为你报价高,就会多赔,其实车价无论报多少, 都是按现时该车购买购置的价格标准按年份折旧赔偿的,所以报高了白多交保费,报低了会赔偿不足, 这点很重要。</p><p>****理财网小贴示：车辆保险不宜“一女二嫁”，交强险、三者险最好选用同一家保险公司。</p><p>否则一旦发生交通事故，索赔时会很麻烦。在两家或两家以上的保险公司进行投保，投保车辆一旦出现事故，投保人要给两家或两家以上的保险公司报案，同时要准备两份或两份以上的索赔资料，交警出具的事故责任书、历史单证往往只有一份，这意味着其他保险公司只能用复印件。</p>');
INSERT INTO `plf_article_data` (`id`, `content`) VALUES
(29, '<p>①、报案要及时。出现交通事故后，首先就要保护现场、抢救人员并及时电话报案。</p><p><span style="font-size: 16px;">&nbsp; &nbsp;</span></p><p>②、报案后应当提供以下证明或单据：在有效期内的保单正本;被保险人身份证;经过年检合格的被保险车辆行驶证;发生事故时驾 &nbsp; &nbsp; 驶人的驾驶证，此驾驶证必须经过年审合格并确定在准驾车型范围内;属于道路交通事故的，应提供交管部门出具的事故证 &nbsp; &nbsp; &nbsp; 明;属于非道路交通事故的，应提供相应的事故证明;因事故而产生的损失清单以及有关的费用单据。</p><p><br/></p><p><span style="font-size: 16px;">③、保险公司定损的金额并不是肇事者赔偿的依据，由物价局价格鉴定中心做出的鉴定结论公信力更高。</span><span style="font-size: 16px;">&nbsp;</span></p><p><span style="font-size: 16px;">&nbsp;&nbsp; &nbsp; &nbsp;&nbsp;</span></p><p>④、 10日内需提交索赔单证：以上手续备齐后，就可以到被保险人的承保公司或有定损资格的汽车专修厂进行拍照、定损、理 &nbsp; &nbsp; &nbsp; &nbsp;赔。所有损失在修复之前，必须经有定损这一环节，以核定损失项目及金额。定损完毕后，&nbsp;即可修理受损车辆。事故处理 &nbsp; &nbsp; &nbsp;完毕后，10日内将索赔单证交给保险公司，由保险公司计算赔款;然后保险公司会通知领取赔款。</p><p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p><br/></p>'),
(30, '<p>大多数车主都以为买了保险就万事大吉，今后有什么问题都能找保险公司索赔。 &nbsp;&nbsp;</p><p>&nbsp; 但业内人士指出，千万不要以为买了保险后您的爱车就进了保险箱，有些情况保 &nbsp;</p><p>&nbsp; 险公司是不予理赔的。</p><p>　　①、未年检</p><p>　　 &nbsp; 保险只对合格车辆生效，对于未年检的车辆只能视为不合格车辆，在这种情况下，即使买了保险也无济于事。</p><p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>　　②、未年审</p><p>　　 &nbsp; &nbsp;驾驶员没有年审，所开车辆属于不合格车辆，保险公司可以根据保险合同拒绝任何理赔。</p><p>&nbsp; &nbsp; &nbsp; &nbsp;</p><p>　　③、无牌照车辆在出险时，保险车辆理赔必须具备两个条件：一是保险车辆须有公安交通管理部门核发的行驶证或号牌；二 &nbsp; &nbsp; &nbsp; &nbsp; 是在规定期间内经公安交通管理部门检验合格。异地购车在提车途中出险得不到赔偿就是这个原因。</p><p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<span style="font-size: 16px;">&nbsp;</span></p><p>　　④、无过错</p><p>　　 &nbsp; &nbsp;《保险法》规定：“必须有责任认定”，保险公司才能赔付。即使被保险人有一定过错，也必须先向第三方索赔，才有 &nbsp; &nbsp; &nbsp; &nbsp;可能获得保险公司的赔偿。一旦放弃了向第三方追偿的权利，也就放弃了向保险公司要求赔偿的权利。</p><p>&nbsp; &nbsp; &nbsp;<span style="font-size: 16px;">&nbsp;&nbsp;</span></p><p>&nbsp; &nbsp;⑤、自家人</p><p>　　 &nbsp; &nbsp;第三者责任险中的第三者通俗地讲，就是排除4种人：即保险人、被保险人、本车发生事故时的驾驶员及其家庭成员、被 &nbsp; &nbsp; &nbsp; &nbsp;保险人的家庭成员。</p><p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>　 ⑥、收费停车场</p><p>　　 &nbsp;按照保险公司的规定，凡是车辆在收费停车场或营业性修理厂中被盗，保险公司一概不负责赔偿。因为上述场所对车辆有 &nbsp; &nbsp; &nbsp;保管的责任，在保管期间，因保管人保管不善造成车辆损毁、丢失的，保管人应承担责任。保险公司不负责赔偿。因此，无 &nbsp; &nbsp; &nbsp;论是车丢了，还是被划了，保险公司一概不管。 &nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp;</p><p><br/></p>'),
(31, '<p>①、己方全责</p><p>&nbsp; 并线时没有避让直行车辆造成事故，你应负全责。这时找交警开交通事故责任认定书，有可能被扣分罚款，所以300元以下的 &nbsp; &nbsp;小剐小碰强烈建议私了。如果你实在不想再掏钱修车，可以按照单方事故索赔。如果事故比较严重，当然只能请交警同志了， &nbsp; &nbsp;然后扣分罚款开事故单报案，双方一起去保险公司定损索赔。如果是自己手潮倒车撞在了树上，那就是名正言顺的的单方</p><p>&nbsp;事故了，立刻报案。几天之内定损员出现场时，会通过电话让你把车开到事故现场，然后将车的损伤部位和树凑在一起拍张照 &nbsp; 片，后面就是正常的定损理赔程序。 &nbsp; &nbsp; &nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p style="white-space: normal;">②、对方全责</p><p style="white-space: normal;">&nbsp;正常行驶突然被从胡同中拐出来的车撞到，对方又自认全责，第一选择是和肇事方私了，由对方现场掏修车钱然后一拍两散，以后抽个时间自己把车修好，这也是最理想的解决途径。有些人拿了修车钱后还去保险公司走单方事故，反而利用事故赚了钱，这种做法反正我们不提倡。如果刚好碰上损失比较大交警同志过来后，要积极指认对方的违章行为，然后和肇事车一起去对方的保险公司定损。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">③、责任对等或“肇事方”逃逸</p><p style="white-space: normal;">&nbsp;对等责任是最好解决的一类事故，请交警同志过来开事故单，然后各自报案索赔。如果交通事故发生后“交通肇事方”逃 &nbsp; &nbsp; &nbsp;逸，那麻烦就比较大了。尤其在损失很大的情况下，无法走单方事故，只能请交警同志过来勘验现场立案侦查，然后由保险公司 &nbsp;代为追偿。</p><p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br/></p><p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p><span style="font-size: 16px;">&nbsp;</span><br/></p><p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br/></p><p>&nbsp; &nbsp; &nbsp; &nbsp;</p><p>&nbsp; &nbsp; &nbsp;&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp;</p><p>&nbsp; &nbsp; &nbsp;&nbsp;</p><p>&nbsp;<span style="font-size: 16px;">&nbsp;</span></p><p>&nbsp; &nbsp; &nbsp; &nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp;</p><p><br/></p>'),
(37, '<p>&nbsp;①、被鉴定人应携带加盖办案单位公章和办案人签字的伤残鉴定申请书；</p><p>&nbsp;②、携带县级以上医院的诊断证明，检查结果以及受伤初期和治疗终结后的CT、X片及诊断报告；</p><p>&nbsp;③、从治疗医院借阅有关手术病历和检查记录；</p><p>&nbsp;④、对被抚养人的劳动能力进行评定时，还应携带被评定人的身份证及户籍证明和有关政府部门的说明；</p><p>&nbsp;⑤、评定时应以事故直接所致的损伤或确定的并发症治疗终结为准，对治疗尚未终结，因调解需要提供赔偿依据的，在申请书中说明；</p><p>&nbsp;⑥、被鉴定人需要亲自接受检查并缴纳规定的鉴定费用。</p><p>&nbsp;&nbsp;交通事故的当事人因伤致残的，在治疗终结后十五日内，可以向公安机关申请伤残评定。公安机关应当根据医院证明和公安部关于道路交通事故伤残评定的标准，在接到伤残评定申请书后三十日内评定伤残等级或者向当事人推荐鉴定机构由当事人自行选择。当事人对伤残评定不服的，可以在接到评定书后十五日内，向上一级公安机关申请重新评定。上一级公安机关在接到重新评定申请书后三十日内，应当作出重新评定的决定。</p>'),
(38, '<p>众所周知，酒后驾车时导致交通事故的一大重要诱因，那么它的危害到底都多大呢？</p><p>世界卫生组织的事故调查显示，大约50%至60%的交通事故与酒后驾驶有关。酒后驾驶已经被世界卫生组织列为车祸致死的首要原因</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p><br/></p>'),
(39, '<p>仅仅喝了一听350毫升的啤酒，半个小时之后，在专业仪器的测试下，三位司机“遇险”后刹车反应时间均延长了两倍左右。清华大学汽车碰撞实验室曾进<span style="font-size: 16px;">行了“远离酒后驾驶”的活动，在实验室证明了酒后驾驶的危险性。在饮一听350毫升的啤酒前，他们的刹车反应时间分别为0.75秒、0.56秒和0.56秒。饮酒30分钟后，酒精开始在体内发挥作用，同样的机器测试结果显示，三人的反应时间分别提高到1.22秒、1.38秒和1.05秒。</span></p><p><br/></p>'),
(40, '<p>根据国家质量监督检验检疫局发布的《车辆驾驶人员血液、呼气酒精含量阈值与检验》(gb19522—2004)中规定，驾驶人员每100毫升血液酒精含量大于或等于20毫克，并每100毫升血液酒精含量小于80毫克为饮酒后驾车;每100毫升血液酒精含量大于或等于80毫克为醉酒驾车。</p>'),
(41, '<p>1、视觉障碍:一般人在平常状态下的外围视界可达180度，如果酒精含量超过0.08%，驾驶员的视野就会缩小。在这种情况下，人 &nbsp; &nbsp;已经不具备驾驶能力。至于醉酒的驾驶员，甚至只能感觉到周围环境的很小一部分。</p><p>2、运动反射神经迟钝:慢了一两秒。如车速为60km/h，一秒钟车子就已经跑了16.67米，必然会产生严重后果。</p><p>3、触觉能力降低:饮酒后驾车，因酒精麻醉作用，人的手、脚触觉较平时降低，往往无法正常控制油门、刹车及方向盘。</p><p>4、使判断能力和操作能力降低:饮酒后，人对光、声刺激的反应时间延长，从而无法正确判断距离和速度。</p><p>5、使心理变态。酒精刺激下，人有时会过高估计自己，对周围人劝告常不予理睬，往往做出力不从心的事。</p><p>6、易疲劳。饮酒后由酒精的作用，80%人易出现肝留迷，也就是人们常说的困倦、打磕睡，表现为行驶不规范、空间视觉差等疲 &nbsp; &nbsp;劳驾驶的行为而引发交通事故。</p><p><span style="font-family: Simsun; font-size: 14px; line-height: 22px; text-indent: 28px; background-color: rgb(249, 252, 254);"><br/></span></p>'),
(42, '<p>一杯啤酒即为酒后驾驶，三两低度白酒或两瓶啤酒即为醉酒驾驶</p><p><br/></p>'),
(43, '<p>&nbsp;① 、饮酒驾驶机动车辆，罚款1000元—2000元、记12分并暂扣驾照6个月;饮酒驾驶营运机动车，罚款5000元，记12分，处以15 &nbsp; &nbsp; &nbsp; 日以下拘留，并且5年内不得重新获得驾照。</p><p>&nbsp;②、醉酒驾驶机动车辆，吊销驾照，5年内不得重新获取驾照，经过判决后处<span style="font-size: 16px;">以拘役，并处罚金;醉酒驾驶营运机动车辆，吊销驾 &nbsp; &nbsp; &nbsp;照，10年内不得重新获取驾照，</span><span style="font-size: 16px;">终生不得驾驶营运车辆，经过判决后处以拘役，并处罚金。</span></p><p><br/></p>'),
(44, '<p>&nbsp; &nbsp; 喝一瓶啤酒或半两白酒，最好等到6-10个小时后再开车，喝2瓶啤酒或低度白酒3两，最好在10-24个小时后再开车，如果喝酒的酒精度数更高、量更大，就要过24小时间才可以开车。</p>'),
(45, '<p>①、行走回转法：测试的人先将左脚置于直线上，再将右脚置于左脚前，其右脚跟须紧邻左脚趾，双手平贴身体两侧，必须根据 &nbsp; &nbsp; 此要领行走九步，然后回转，再往回走九步，测试者在行走时，双手必须平贴身体两侧，&nbsp;并喊出行走步数，眼睛随时注视脚 &nbsp; &nbsp; 步，回转时，前脚应置于直线上，并以其为回转轴，依方向小步回转。以行走回转法测试时，只要违反上述其中一项规定， &nbsp; &nbsp; 就记一点，多过一点，就显示测试者血液中的酒精浓度已超过标准。</p><p><br/></p><p style="white-space: normal;">②、同心圆法：测试者在印制好的三重圆圈图上，直径分别是四、四点三、四点六公分，先听指示将笔尖放于内圈，维持上述动 &nbsp; &nbsp;作于原位置，直到指示开始动作为止;在平衡阶段，测试者接获「开始动作」的指示后，即沿内圈开始画线，画完一圈为止。 &nbsp; &nbsp;测试者画圈时间超过十五秒或所画之圆圈不连续、相临圆圈接触点超过六点以上，显示测试者的呼气酒精浓度已超过了规定。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">③、单脚站立法：测试时，测试者应先保持立正姿势，未接受动作命令前，都保持此一姿势，然后进行行走测试，此时，测试者 &nbsp; &nbsp;应双手平贴身体两侧，举起右脚或左脚，离地十五公分，眼睛注视举起的脚，同时开始大声读秒计数，直到卅秒为止，如果测 &nbsp; &nbsp;试者计数过快或过慢，即停止测试。以此一方法测试时，违反上述规定一项就记一点，超过一点，其血液中的酒精浓度就可</p><p style="white-space: normal;">&nbsp; &nbsp;能已超过所规定的标准。至于「同心圆法」，则分为指示与平衡阶段。&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br/></p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br/></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>&nbsp; &nbsp; &nbsp;</p><p>&nbsp;&nbsp;</p><p><br/></p>'),
(46, '<p>事故私了，是指发生交通事故后，受害者以及肇事者不经过司法手续而私下了结</p><p>一、保护现场、维护自身安全</p><p><br/></p><p>　　发生事故保护现场是处理事故的第一个程序和环节，主要作用是：一、能在相对安全</p><p><br/></p><p>的范围内“私了”事故，防止二次事故的发生；二、一旦“私了”不成，由警察介入调查</p><p><br/></p><p>时，保护现场有利于澄清事故事实，分清事故责任，同时也是当事人应尽的责任。</p><p><br/></p><p>二、了解双方车内是否有人员受伤</p><p><br/></p><p>　　根据相关法律规定，发生交通事故未造成人身伤亡，或当事人仅受轻微伤的，都可以</p><p><br/></p><p>“私了”。由此看来，如何判断当事人的伤情成了“私了”能否继续进行下去的关键。交</p><p><br/></p><p>通事故造成的人体轻微伤的种类很多。若当事人仅有皮下淤血和表皮擦伤，自认为伤情轻</p><p><br/></p><p>微，做好记录，双方签字后，才可以当场“私了”。其他的伤（包括其他轻微伤）最好马</p><p><br/></p><p>上到附近的医疗机构进行治疗，并且立即报警，听候处理。</p><p><br/></p><p>三、确定是“私了”还是“公了”</p><p><br/></p><p>&nbsp; &nbsp; 为了确定究竟是选择“私了”还是“公了”，我们有必要了结一下两者的区别。</p><p><br/></p><p>&nbsp; &nbsp; 1、“私了”事故时，当事人之间对事故事实或对责任确定看法不一致，可保留现场“</p><p><br/></p><p>招”警察介入；“公了”事故时，只要警察认为事故事实清楚并已确定了责任，就必须撤</p><p><br/></p><p>除现场，即使当事人不同意撤除，警察也可以强制撤除。</p><p><br/></p><p>　　2、“私了”事故时，当事人之间可以就赔偿问题“讨价还价”；“公了”事故时，警</p><p><br/></p><p>察只按照责任的划分及法律规定作出原则性的结论，而不参与当事人之间具体的“讨价还</p><p><br/></p><p>价”和转交现金。</p><p><br/></p><p>　　3、“私了”事故，不存在对违法行为进行处罚的问题；“公了”事故时，警察必须履</p><p><br/></p><p>行职责，对证据确凿的当事人违法行为必须按照法律的相关规定进行处罚。</p><p><br/></p><p>由此看来，“私了”和“公了”各有所长。而磕磕碰碰在所难免，遇到小的交通事故，与</p><p><br/></p><p>其怄气吵架或报警，让成百上千辆车堵在路上“陪绑”，还不如双方共同选择“私了”的</p><p><br/></p><p>方法解决事故。而若发生了人员伤亡，还是等待警察介入进行“公了”吧。</p><p><br/></p><p>四、固定、采集有关证据</p><p><br/></p><p>&nbsp; &nbsp;“私了”交通事故所涉及的内容虽然不多，方法也简单，但是一些能够证明交通事故发生</p><p><br/></p><p>真实情况的相关证据，还是必须固定和采集。这对保护双方当事人的合法权益是至关重要</p><p><br/></p><p>的。具体作用在于：</p><p><br/></p><p>&nbsp; &nbsp; 1、双方对事故事实有争议“招”警察介入时，可以据理力争</p><p>&nbsp; &nbsp; 2、向保险公司进行索赔时有根有据</p><p>&nbsp; &nbsp; 3、防止对方在撤除现场后“变卦”而造成麻烦</p><p><br/></p><p>五、共同认可事故发生的事实</p><p><br/></p><p>　事故当事人双方不能就交通事故问题进行协商，共同认可，就会产生分歧。一般说来，</p><p><br/></p><p>如果在第二个环节中，双方共同选择“私了”的方式处理事故，那么就应当采取理智的、</p><p><br/></p><p>诚信的态度对事故发生的事实尽快达成共识，不要在一些枝节末梢上纠缠不休。若是在某</p><p><br/></p><p>些细节上产生了分歧，可以寻找附近的路人或者摆摊人进行询问。</p><p><br/></p><p>六、撤除现场协商赔偿</p><p><br/></p><p>&nbsp; &nbsp;现场勘查完毕，双方共同认可了事故事实后，应当自行移动车辆至不妨碍交通的地点，</p><p><br/></p><p>然后进行赔偿问题的协商（具体的赔偿问题见第八讲）。建议按照下列的方法将事故车辆</p><p><br/></p><p>移至不妨碍交通的地点：</p><p><br/></p><p>　　1、开启危险报警闪光灯，设置警告标志，夜间还需要开启示宽灯和尾灯；</p><p><br/></p><p>　　2、在高速公路上，要将车辆移至就近的服务区、应急车道内或者硬路肩上；</p><p><br/></p><p>　　3、在城市快速路上，要将车辆移至就近的应急车道内或者辅路的非机动车道内；</p><p><br/></p><p>　　4、在其他道路上，要将车辆移至就近的非机动车道或者人行道上。</p><p><br/></p><p>　　在采取以上安全措施工作后，就可以在不妨碍交通的情况下，协商解决赔偿事宜了。</p><p><br/></p>'),
(47, '<p>一、要理智地面对事故现实</p><p><br/></p><p>　　发生了事故，见到自己的爱车受到损坏，难免心生怒火、情绪急躁。有的当事人情急之中，忘了保护现场、勘查现场的正事，在没有获取证据的情况下直接和对方去理论是非，往往话不投机，发生口角，更有甚者还拳脚相加。结果，重要证据灭失，小事变大，非但事故无法“私了”，还要为此付出沉重的代价。</p><p><br/></p><p>二、遇到人员受伤不要轻易“私了”</p><p><br/></p><p>&nbsp; &nbsp; 遇到有人员受伤的事故要谨慎行事，不要轻易选择“私了”的方法处理事故。实践中常遇到这样的情形，即事故发生时，当事人只是感觉身体某个部位不适，以为仅仅是软组织挫伤而已，于是简单对事故进行了“私了”。但是当天晚上或第二天伤情加重，甚至死亡。</p><p><br/></p><p>三、“私了”事故时要防止财物的丢失</p><p><br/></p><p>　　“私了”事故时间虽然短暂，但是双方都是在车外进行勘查、记录和协商，注意力都集中在了处理事故当中，而且视线也会游离于自己的财物。此时如果遇到扒窃者，就会祸不单行，造成更大的损失。</p><p><br/></p><p>四、怀疑对方“碰瓷”不要“私了”</p><p><br/></p><p>&nbsp; &nbsp; 泛指一些投机取巧、敲诈勒索的行为。“碰瓷”现象在事故发生前一般是很隐蔽的，“碰瓷”的手段也是多种多样的，其主要特点有：</p><p>&nbsp; &nbsp;1、在慢速行驶或行走中进行“碰瓷”</p><p>&nbsp; &nbsp;2、“碰瓷”者的行驶路线“正常”。</p><p>&nbsp; &nbsp;3、“碰瓷”者虽称受伤，但不肯去医院救治。</p><p>&nbsp; &nbsp;4、索要赔偿时，“碰瓷”者“狮子大开口”而且只要现金。外地司机遭遇本地车辆“碰瓷”的事情较多</p><p><br/></p><p>五、遇到对方交通肇事逃逸怎么办?</p><p>&nbsp; &nbsp; 交通肇事逃逸行为主要有两种表现形式。一、发生事故后驾车逃逸;二、发生事故后当事人弃车逃逸。虽然说可以“私了”的交通事故后果均不严重，但是这两种逃逸行为在“私了”事故中也时有发生。</p><p>&nbsp; &nbsp; 因为“私了”中的逃逸者一般都与当事人见过面、接触过，所以遇到对方逃逸，当事人应当可以、并力求记住对方车辆及对方的以下几种特征并及时报警：</p><p><br/></p><p>&nbsp; &nbsp; 1、车辆的型号。如：小客车、吉普车、旅行车、大客车、大货车、小货车等。</p><p><br/></p><p>　　2、车辆的颜色。如：红色、绿色、白色、黑色、黄色等。</p><p><br/></p><p>　　3、车辆号牌。包括：颜色(如：小客车为蓝色，大客车为黄色)、号码(最好记全，无法记全也应当记住 &nbsp; &nbsp; &nbsp; 其中前面或后面的两个数字)。</p><p><br/></p><p>　　4、车辆的其他主要特征。如：车身上的图案、文字;有无装载物，装载物的名称等。</p><p><br/></p><p>　　5、逃逸者本人的主要特征。如：身高、体态(胖瘦)、年岁(青年、中年、老年或约多少岁)、长相(身体 &nbsp; &nbsp; &nbsp; 外露的部位是否有疤痕、纹身、黑痣等)、衣着等。</p><p><br/></p><p>六、要核实准确对方的身份</p><p>&nbsp; &nbsp;“私了”中非常需要注意的一点就是准确核实对方的身份及一些相关的情况，可以分为以下几个方面通过询问、观察、核对去查明：</p><p>　 1、通过居民身份证进行核实</p><p>&nbsp; &nbsp;2、通过机动车驾驶证进行核实</p><p>&nbsp; &nbsp;3、注意了解对方的确切住址</p><p>&nbsp; &nbsp;4、注意驾驶证上的“单位”和“职业”</p><p>&nbsp; &nbsp;5、注意分辩对方的驾驶人与乘车人</p><p><br/></p><p>七、与外国人发生事故“私了”时应当注意的问题</p><p><br/></p><p>　　随着我国对外开放的进一步扩大和国际交往的日益频繁，到中国来访问、工作、学习、旅游和生活的外国人不断增加，他们在中国发生交通事故的几率也逐年上升。</p><p>&nbsp; &nbsp; 从法律意义上讲，外国人分为两类：享有外交特权与豁免权的外国人和不享有外交特权与豁免权的外国人，一般称之为“特殊身份外国人”和“普通身份外国人”。外交特权与豁免，是指外交代表机关及其人员根据国际法或有关协议在接受国所享有的特别权利和优惠待遇的总称。</p><p>&nbsp; &nbsp; 那么，对于同外国人的“私了”，我们需要注意一些什么呢？</p><p>&nbsp; &nbsp; 1、首先通过肇事车辆的号牌、驾驶证和外国人的护照等确认外国当事人的身份。</p><p><br/></p><p>　　2、如果对方是普通外国人，“私了”的方法完全等同于国人之间发生交通事故时“私了”的方法。</p><p><br/></p><p>　　3、如果对方是特殊外国人(有外交身份的外国人)，“私了”的方法基本等同于国人之间发生交通事故时 &nbsp; &nbsp; “私了”的方法，但应注意以下事项：</p><p><br/></p><p>　　①如双方未就经济赔偿达成协议，应立即报警由警察进行调解，不得强行向外国当事人索要赔偿款;</p><p><br/></p><p>　　②由于语言不同和思维方式的差异，在实践中有可能出现外国当事人驾车驶离现场的情况，遇有这种情 &nbsp; &nbsp; &nbsp;况要保持冷静，迅速报警并记下肇事车辆的车号，而不要强行拦截肇事车辆避免造成冲突，进而引发 &nbsp; &nbsp; &nbsp;外交事件;</p><p><br/></p><p>　　③不得进入或损毁的外交肇事车辆;</p><p><br/></p><p>　　④不得扣留外交人员的车辆、驾驶证、外交官身份证和护照等证件;</p><p><br/></p><p>　　⑤外国当事人有饮酒嫌疑的，如其不配合警察进行酒精检测的，按照有关国际公约的规定，警察不得对 &nbsp; &nbsp; &nbsp;其采取任何强制性措施，而要通过外交途径予以解决，这一点特别需要国内当事人给予理解，而不要 &nbsp; &nbsp; &nbsp;认为警察袒护外国人。</p><p><br/></p><p>　　总之，与外国人发生交通事故应做到礼貌待人，切忌感情用事，体现我国礼仪之邦的风范。同时，不要因为对方是外国人就“漫天要价”。</p><p><br/></p>'),
(48, '<p>此类事件在实际生活中数不胜数，经常会有当事人反映在“私了”事故时，会怀疑对方是故意“碰瓷”</p><p>其实许多碰瓷族都会有一些奇怪的特征，我们可以根据以下特征来进行判断<br/></p><p><br/></p><p>1、细微剐蹭车辆严重受损</p><p><br/></p><p>碰瓷车辆紧跟目的车辆，在其变道时猛踩油门撞上去，与目的车悄悄剐蹭，但车上的零部件会呈现严重断裂</p><p><br/></p><p>或破损，然后以此讨取修理费。</p><p><br/></p><p>2、 慢如蜗牛等候被追尾</p><p><br/></p><p>碰瓷车辆成心开在目的车辆后面，与目的车辆贴得很近，然后找时机紧急制动，形成目的车追尾。</p><p><br/></p><p>3、不报警要私了</p><p><br/></p><p>很多碰瓷车辆往往都是中高档的二手汽车。事故发作后，碰瓷车辆或碰瓷人通常会提出不要报警并且用钱“</p><p><br/></p><p>私了”的要求。</p><p><br/></p><p>4、人成心撞车侧部</p><p><br/></p><p>假如是成心撞车的碰瓷人，通常会在目的车辆车速很慢时撞上车辆，而碰撞部位往往都在车辆的正面，并且</p><p><br/></p><p>躺倒在车辆的正面，由于这样可以防止发作真正的人身风险。</p><p><br/></p><p>如果怀疑对方有“碰瓷”的嫌疑，我们应该如何应对呢？</p><p>&nbsp; &nbsp; 1、当你觉得交通事故有些蹊跷时，一定要保留现场，并立即报警，同时要把车门锁好，并在车内等候警&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp;察出现场，同时最好叫上几个好朋友过来帮忙。</p><p>&nbsp; &nbsp; 2、带对方看病，不能去他们指定的医院，一定要去三级甲等医院。</p><p>&nbsp; &nbsp; 3、在看完病以后，一定要把事故处理单要回来，在医院只花看病，开药的钱，其他的一概不要答应。</p><p>&nbsp; &nbsp; 4、若对方索要误工费，其他赔偿费时，让他们准备连续3个月的完税证明。</p><p><br/></p>'),
(49, '<p>&nbsp; &nbsp; 相关的交通法律法规虽然允许并鼓励当事人对事故进行“私了”，但是，正如事事都有一个界限和范围</p><p>一样，交通事故并非都可以“私了”，这也是相关法律法规中所明确规定的。如《交通事故处理程序规定》</p><p>第十三条和《北京市道路交通事故简易程序处理规定》第七条就规定了七种情形的事故，应当保护现场并立</p><p>即报警。这七种情形是：</p><p>&nbsp; &nbsp;(1)机动车无号牌、无检验合格标志、无保险标志的;</p><p><br/></p><p>　 (2)驾驶人无有效机动车驾驶证的;</p><p><br/></p><p>　 (3)机动车驾驶人饮酒、服用国家管制的精神药品或者麻醉药品的;</p><p><br/></p><p>　 (4)对交通事故事实或者成因有争议的;</p><p><br/></p><p>　 (5)当事人不能自行移动车辆的;</p><p><br/></p><p>　 (6)碰撞建筑物、公共设施或者其他设施的;</p><p><br/></p><p>　 (7)车辆单方发生交通事故的。</p><p><br/></p><p>&nbsp; &nbsp; 前三项情形当事人不得自行协商解决，是因为这几项行为都属于严重违法行为，尤其是(2)、(3)项所列</p><p>行为对交通安全的潜在危害极大，必须予以严厉打击和惩处。如果允许当事人自行协商解决，实际上就是放</p><p>纵行为人的违法行为，与交通事故处理的基本原则背道而驰。</p><p>　　上述第(4)、(5)项情形当事人不得自行协商解决，这是由相关法律对“私了”适用范围所决定的。第(6)</p><p>、(7)项情形当事人不得自行协商解决，主要是因为包括许多单方事故在内，车辆碰撞的固定物一般是交通设</p><p>施及其他公共设施，往往造成了国家、集体财产的损失。为了保证国家、集体财产在受到侵害后能得到及时</p><p>有效赔偿，《北京市道路交通事故简易程序处理规定》对此类事故不允许当事人自行协商解决。</p><p><br/></p>'),
(50, '<p style="text-indent: 2em; padding: 0px; margin-top: 10px; margin-bottom: 0px; font-family: 宋体; font-size: 14px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);">1、自建自管未列入规划的城市巷弄或村间路，或者称自行修建并自行负责管理的路面；</p><p style="text-indent: 2em; padding: 0px; margin-top: 10px; margin-bottom: 0px; font-family: 宋体; font-size: 14px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);">2、用于田间耕作的农村铺设的水泥路、沥青路、砂石路等机耕路</p><p style="text-indent: 2em; padding: 0px; margin-top: 10px; margin-bottom: 0px; font-family: 宋体; font-size: 14px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);">3、村民宅前宅后建造的路段或自然通车形成的路面；</p><p style="text-indent: 2em; padding: 0px; margin-top: 10px; margin-bottom: 0px; font-family: 宋体; font-size: 14px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);">4、封闭式住宅小区内楼群之间的路面；</p><p style="text-indent: 2em; padding: 0px; margin-top: 10px; margin-bottom: 0px; font-family: 宋体; font-size: 14px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);">5、机关、团体、单位的内部路面，厂矿、企事业单位，火车站、机场、港口、货场内的专用路面；</p><p style="text-indent: 2em; padding: 0px; margin-top: 10px; margin-bottom: 0px; font-family: 宋体; font-size: 14px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);">6、撤村建居后尚未移交公安交通部门管理的路段；</p><p style="text-indent: 2em; padding: 0px; margin-top: 10px; margin-bottom: 0px; font-family: 宋体; font-size: 14px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);">7、凉晒作 物的场院内；</p><p style="text-indent: 2em; padding: 0px; margin-top: 10px; margin-bottom: 0px; font-family: 宋体; font-size: 14px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);">8、断路施工而且未竣工或已竣工未移交公安交通部门管理的路段；</p><p style="text-indent: 2em; padding: 0px; margin-top: 10px; margin-bottom: 0px; font-family: 宋体; font-size: 14px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);">9、其他未列入公共交通管理范围的路段</p><p style="text-indent: 2em; padding: 0px; margin-top: 10px; margin-bottom: 0px; font-family: 宋体; font-size: 14px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);">凡乡、村自行修建的道路（机耕道）和自然通车形成的道路以及住宅楼群道路、机关团体单位的内部道路、厂矿企事业专用道路以及尚未交付使用的新建道路等，均不属于法定道路。在这些路上发生的车辆事故（非道路交通事故），也不属于道路交通管理范围，公安交警部门不具有法定管理的职权。</p><p><br/></p>'),
(51, '<p>《道路交通安全法》第七十七条 车辆在道路以外通行时发生的事故，公安机关交通管理部门接到报案的，参</p><p>照本法有关规定办理的规定，将非道路交通事故也交由公安交警部门比照道路交通事故进行处理。但是处理</p><p>时仍需要注意以下几方面。</p><p><br/></p><p>&nbsp; &nbsp; 1、比照道路交通事故案进行调查、取证 对非道路交通事故进行现场勘察，对证人、当事人进行询（讯</p><p>）问 ，对车辆的检验以及伤员的救治等前期处置，均可以比照道路交通事故的处理方法进行。</p><p><br/></p><p>&nbsp; &nbsp; 2、进行事故认定</p><p><br/></p><p>&nbsp; 对非道路交通事故，应进行责任认定，形成公安机关的调查结论，对事故进行成因分析，并告知当事人，</p><p>其损害赔偿可由交通管理部门调解或直接向人民法院提起民事诉讼。</p><p><br/></p><p>&nbsp; &nbsp; 3、对当事人的处罚不能适用交通管理法律法规</p><p><br/></p><p>如果需对当事人的某些严重违章行为进行处罚，比如酒后驾车、无证驾车等，可以依照《治安管理处罚条例</p><p>》的有关规定，对其违章行为单独处罚。&nbsp;</p><p>&nbsp; &nbsp; 如果需对造成重大伤亡事故过失致人死亡的当事人追究刑事责任，应依照刑法第134条、135条、233条的</p><p>规定移送司法机关定罪处罚，亦不能适用刑法第133条有关交通肇事罪的处罚规定</p><p><br/></p><p>&nbsp; &nbsp; 4、损害赔偿调解应以各方当事人自愿申请为原则</p><p><br/></p><p>&nbsp;非道路交通事故的损害赔偿，在告知当事人向人民法院提起民事诉讼之后，各方当事人仍然申请公安交警部</p><p>门进行调解的，公安交警部门可以进行调解，其损害赔偿的标准可参照道路交通事故的相关标准。至于调解</p><p>是否达成协议，达成协议后任何一方不履行的，当事人可向人民法院提起民事诉讼。</p><p><br/></p>'),
(52, '<p>&nbsp; &nbsp; 1、不触犯刑律的非道路交通事故。对不构成犯罪的，交巡警部门负责接处警，勘察事故现场， 固定有</p><p>关证据，分析事故原因，综合作出非道路交通事故认定书，由最初受理的单位应当事人申请进行调解，调解</p><p>不成功出现纠纷时，通知当事人向人民法院提起民事诉讼；或者不组织调解工作，直接告知 当事人向法院提</p><p>起民事诉讼。</p><p><br/></p><p>&nbsp; &nbsp; 2、触犯刑律的非道路交通事故。交巡警部门和公安派出所共同负责接处警，负责事故现场前期处置工作</p><p>，勘察事故现场，调查取证，固定证据，交巡警部门向派出所、刑侦部门提供《非道路交通事故认定书》，</p><p>分析事故原因，同时根据案情发展情况及案件性质，及时移交刑侦部门按照最高人民法院《关于审理交通肇</p><p>事刑事案件具体应用法律若干问题的解释》（2000）第33号第八条第二款规定，应定过失致人死亡罪定性处</p><p>罚，追究肇事者相应的刑事责任。</p><p><br/></p><p>&nbsp; &nbsp; 非道路交通事故犯罪的特征，犯罪主体是一般主体，不作交通运输人员和非交通运输人员的区别；犯罪</p><p>主观方面 是具有过失；客观方面特征主要有两个方面：一是造成他人重伤、死亡或公私财产遭受重大损失；</p><p>二是在法律的“道路”以外发生的事故。</p><p><br/></p><p>&nbsp; &nbsp; 它与交通肇事罪虽有相似之处，但在主观方面行为人负遵守道路运输管理法规 的法定义务不如交通肇事</p><p>罪那样严格，其次发生地是在法律规定的“道路”以外，这是非道路交通事故犯罪 与道路交通事故犯罪的主</p><p>要区别。两者在量刑上也不相同，重大责任事故罪、重大劳动安全事故罪、过失致人死亡罪最高法定刑是七</p><p>年，而交通肇事罪中因逃逸致人而死亡的，可处七年以上有期徒刑</p><p><br/></p>'),
(62, '<p style="white-space: normal;"><img src="/data/upload/article/201505/14307267337149.jpg" title="1430884301113992.png" alt="p11.png"/></p><p style="white-space: normal;">进出或穿越道路时未让行，要承担全部责任</p>'),
(63, '<p style="white-space: normal;"><img src="/data/upload/article/201505/14307267827710.jpg" title="1430884187882077.png" alt="p12.png"/></p><p style="white-space: normal;">进出或穿越环岛车辆未让行</p>'),
(64, '<p style="white-space: normal;"><img src="/data/upload/article/201505/14307268242622.png" title="1430884094281071.png" alt="p13.png"/></p><p style="white-space: normal;">有灯路口未让先被放行的车</p><p style="white-space: normal;"><br/></p>'),
(65, '<p style="white-space: normal;"><img src="/data/upload/article/201505/14307268771530.png" title="1430884039732566.png" alt="p14.png"/></p><p style="white-space: normal;">无灯路口未按提示标志让行</p>'),
(66, '<p style="white-space: normal;"><img src="/data/upload/article/201505/14307269579830.png" title="1430883986501415.png" alt="p15.png"/></p><p style="white-space: normal;">无信号灯路口未按提示标志让行</p>'),
(67, '<p style="white-space: normal;"><img src="/data/upload/article/201505/14307270002309.jpg" title="1430883888548297.png" alt="p16.png"/></p><p style="white-space: normal;">无信号灯路口右转车未让左转车</p>'),
