(70, '<p style="white-space: normal;"><img src="/data/upload/article/201505/14307271083982.jpg" title="1430883612694613.png" alt="p20.png"/></p><p style="white-space: normal;">右侧超车</p>'),
(71, '<p><img src="/data/upload/article/201505/14307271474215.jpg" title="1430883303202249.jpg" alt="moren.jpg"/></p><p>超越左转弯与掉头车辆</p>'),
(72, '<p>山西元坤电子商务有限公司位于山西省运城市空港新区。是一家集软件开发、网络技术服务、信息咨询服务，理财规划、企业管理策划咨询服务、电子商务服务、销售等为一体的高新技术服务企业。目前，在全国拥有子公司12家，分布河南、河北、山西、陕西、四川、内蒙等。在中国率先推出&quot;个人对个人（&quot;Peer to Peer&quot;或称&quot;P2P&quot;）的《互联网借贷平台》及《共通积分（便利）兑换商城》、《供销商城》等创新型电子商务交易（B2B、B2C、C2C、C2B、O2O）商业模式优势于一体的综合服务平台。平台项目在国内处于领先地位，独一无二，无可替代。</p><p style="white-space: normal;"><strong>集团文化——礼 义 廉 耻&nbsp;</strong>&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp;礼是规规矩矩的态度，礼是严严整整的纪律，</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp;义是正正当当的行为，义是慷慷慨慨的牺牲，</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp;廉是清清楚楚的辨别，廉是实实在在的节约，</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp;耻是切切实实的觉悟，耻是轰轰烈烈的奋斗。</p><p style="white-space: normal;">三年战略 ： 忘掉过去、调整心态、</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 确定模式、寻找天才</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 本土化、同城化、行业化、品牌化</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 科技高地、人才高地</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 技术高地、产业高地</p><p style="white-space: normal;">目标：诚信和创新，提高企业核心竞争力，引领企业成为行业领头人！</p><p style="white-space: normal;">利益：严格按照以股东、员工、客户、家属、社会的利益序列，利益分配，发展运营。</p><p style="white-space: normal;">流程：内部物流化，外部连锁化</p><p style="white-space: normal;">管理：标准化、流程化、简单化、系统化</p><p style="white-space: normal;">集团模式：集资本运营导向模式和产业运作模式的结合，建设以服务实体经济为基础，资本运营为纽带的双核模式</p><p style="white-space: normal;"><img src="http://www.vcivc.cn/data/upload/ueditor/image/1/201412/1419927656433042.jpg" width="100%"/></p><p style="white-space: normal;"><img src="http://www.vcivc.cn/data/upload/ueditor/image/1/201412/1419927656847908.jpg" width="100%"/></p><p style="white-space: normal;"><img src="http://www.vcivc.cn/data/upload/ueditor/image/1/201412/1419927657788707.jpg" width="100%"/></p><p style="white-space: normal;"><img src="http://www.vcivc.cn/data/upload/ueditor/image/1/201412/1419927691942735.png" width="100%"/></p><p style="white-space: normal;"><strong>优势与专长</strong></p><p style="white-space: normal;">创业团队具有共同的事业价值观，集智商、情商、财商为一身，优势互补的经营、管理、执行团队。</p><p style="white-space: normal;">战略规划方向正确、目标定位准确，高瞻远瞩，放眼未来。</p><p style="white-space: normal;">团队具有自我创新意识，对市场经济有正确的洞察力和判断力。</p><p style="white-space: normal;">商业模式科学、先进，竞争优势突出，盈利模式多元化，风险控制能力强。</p><p style="white-space: normal;">灵活机动的战略战术，资源整合合作能力强。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">&quot;无需抵押担保、仅仅凭借个人征信评级、信用管理等服务模式&quot;,成为目前小额民间借贷市场最大的竞争优势。&quot;银行不好贷款,即便贷到款,审批程序也极其复杂和漫长,货币紧缩后,低端小额贷款更是难上加难。&quot;</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">在P2P的个人信贷理财模式里,所有的借款都是信用借款,不需要实物抵押。由于不吸储也不放贷,而是将有理财需求的出借人和有资金需求的借款人&quot;配对&quot;,提供一个自然人之间的借贷交流平台,以之后向借款人收取服务费作为收入来源之一。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">P2P的信贷模式从长远看,还会不断吸引新的机构进来,随着这些成熟机构的进一步创新,还将演变成信托机构,架起城乡信用融资的桥梁。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;"><strong>行业与发展</strong></p><p style="white-space: normal;">所属行业： 资本市场服务</p><p style="white-space: normal;">今天电子商务不是一个技术，不是一个商业模式，它是一场革命，它是一个生活方式和工作方式的变革，它只是刚刚开始。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">最近统计数据显示， 2013年中国电子商务市场交易规模达10.2万亿元，同比2012年的8.5万亿元，增长29.9%。2014年一季度限额以上单位网上零售额815亿元，增长51.7%。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">国内网络借贷平台已有数百家，国外有26家。国内主要分布在长三角、珠三角及北京、天津等发达地区。借贷平台客户多达数百万之众，年交易额实现数百亿人民币，单日交易额实现数亿人民币。《温州金融改革实验区》确定了金融服务平台的合法地位。互联网借贷平台的发展趋势日益形成。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">网络借贷指在网上实现借贷，借入者和借出者均可利用这个网络平台，实现借贷的&quot;在线交易&quot;。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">2012年P2P网贷入选&quot;2012年中国年度创新成长企业100强&quot;中唯一入选的金融信息服务企业。</p><p style="white-space: normal;">&nbsp; &nbsp;</p><p style="white-space: normal;">长时段来看，互联网金融才大潮初起，难免泥沙俱下，但潮涨潮落，不改一浪高过一浪的发展趋势。当前的鱼龙杂混、良莠不齐的情况一定不会长期持续下去。P2P健康发展的前提可能是要经历一些风雨，淘汰一批经营不善的网贷公司，甚至要打击掉一批借着P2P平台进行违法犯罪活动的团伙。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">我们相信，经过洗牌之后，一些巨型的、有实力的网贷公司或许将兼并一些中小型网贷公司，并且专注做平台的P2P公司将引进和培育一批金融服务机构。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;"><strong>产品服务</strong></p><p style="white-space: normal;">主营业务：自主研发电子商务交易平台、P2P借贷平台系统，为创业者和传统企业提供全方位、多选项的电子商务解决方案。在中国率先推出&quot;个人对个人（&quot;Peer to Peer&quot;或称&quot;P2P&quot;）的《信用借贷平台》及《共通积分（便利）兑换商城》、《供销商城》等创新型电子商务交易（B2B、B2C、C2C、C2B、O2O）商业模式优势于一体的综合服务平台。</p><p style="white-space: normal;">主要产品与服务：可定制型《P2P借贷平台系统》；电子商务交易平台系统《共通积分（便利）兑换商城》、《供销商城》。</p><p><br/></p>');
