(73, '<p style="white-space: normal;">手机客户端</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">1.通过用手机扫描此二维码，获得手机客户端下载地址。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">（安卓手机用户客户端下载，请用浏览器扫描下面二维码）&nbsp;</p><p style="white-space: normal;">&nbsp;<img src="/data/upload/ueditor/image/8/201506/1433576562496210.png" title="1433576562496210.png" alt="cli_300px.png" width="264" height="269" style="width: 264px; height: 269px;"/></p><p style="white-space: normal;">（苹果手机越狱用户客户端下载，非越狱手机无法安装，请用浏览器扫描下面二维码）</p><p style="white-space: normal;"><img src="/data/upload/ueditor/image/1/201505/1432985296889828.png" title="1432985296889828.png" alt="1432985296889828.png" width="280" height="280" border="0" vspace="0" style="width: 280px; height: 280px;"/></p><p style="white-space: normal;">&nbsp;</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">2.在手机浏览器中输入此地址，下载商城手机客户端。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">安卓手机用户客户端下载：<a href="http://jinyuan.vcivc.cn/data/app/che.2.apk" target="_blank" textvalue="http://jinyuan.vcivc.cn/data/app/che.2.apk">http://jinyuan.vcivc.cn/data/app/che.2.apk</a></p><p style="white-space: normal;">苹果手机越狱用户客户端下载：<a href="http://jinyuan.vcivc.cn/data/app/che.2.ipa" target="_blank" textvalue="http://jinyuan.vcivc.cn/data/app/che.2.ipa">http://jinyuan.vcivc.cn/data/app/che.2.ipa</a></p><p style="white-space: normal;"><br/></p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">3.如果您的手机不支持直接下载，那么您可以点击（苹果手机用户客户端下载）或（安卓手机用户客户端下载），先将手机客户端下载到您的电脑中，然后再用数据线或读卡器传输到您的手机中。</p><p><br/></p>'),
(74, '<p>&nbsp; &nbsp;（一)延安高架路</p><p>　　1、禁行范围：全线禁止外省市号牌小客车、出租空车、实习车7:30—9:30和16:30—18:30(除周六、日及国定假日外)通行。</p><p>　　2、通行提示：</p><p>　　(1)外滩隧道虹口方向来车(禁行车辆)禁止进入延安高架路主线;</p><p>　　(2)G50、S20往市区方向车辆禁止进入延安高架路主线。</p><p>　　(二)南北高架路、卢浦大桥</p><p>　　1、禁行范围：中环路/共和新路立交——鲁班立交及卢浦大桥全线，禁止外省市号牌小客车、出租空车、实习车7:30—9:30和16:30—18:30(除周六、日及国定假日外)通行。</p><p>　　2、通行提示：</p><p>　　(1)北向南行驶上述车辆在禁行时段必须由汶水路下匝道驶离南北高架主线，并禁止进入中环路;</p><p>　　(2)新闸路、永兴路上匝道允许上述车辆经天目立交(转盘)跨越铁路和苏州河，但禁止驶入南北高架主线。</p><p>　　(三)内环高架路</p><p>　　1、禁行范围：全线(除杨浦大桥、南浦大桥越江通道外)，禁止外省市号牌小客车、出租空车、实习车7:30—9:30和16:30—18:30(除周六、日及国定假日外)通行。</p><p>　　2、通行提示：</p><p>　　(1)杨浦大桥：</p><p>　　浦东往浦西方向：允许上述车辆从浦东大道入口、罗山路/杨高路立交各方向入口经杨浦大桥越江。车辆越江后应经临青路出口、周家嘴路出口、黄兴路出口驶离内环主线。</p><p>　　浦西往浦东方向：允许上述车辆从中山北路入口、黄兴路入口、周家嘴路入口、河间路入口经杨浦大桥越江。车辆越江后应经浦东大道出口、杨高中路出口、锦绣路出口驶离内环主线。</p><p>　　(2)南浦大桥：</p><p>　　浦东往浦西方向：允许上述车辆从杨高南路入口、浦东南路入口经南浦大桥越江。车辆越江后应经由中山东一路出口、中山南一路出口、陆家浜路出口驶离内环主线。</p><p>　　浦西往浦东方向：允许上述车辆从中山南路/董家渡路入口、南车站路入口、陆家浜路入口经南浦大桥越江。车辆越江后应经杨高南路出口、浦东南路出口驶离内环主线。</p><p>　　(四)逸仙高架路</p><p>　　1、禁行范围：北向南，场中路下匝道至内环高架路，禁止外省市号牌小客车、出租空车、实习车7:30—9:30和16:30—18:30(除周六、日及国定假日外)通行。</p><p>　　2、通行提示：</p><p>　　北向南方向：上述车辆应由场中路下匝道驶离主线。</p><p>　　南向北方向：上述车辆可以由中山北二路入口进入逸仙高架路主线，但禁止进入中环主线。</p><p>　　(五)沪闵高架路</p><p>　　禁行范围：全线禁止外省市号牌小客车、出租空车、实习车7:30—9:30和16:30—18:30(除周六、日及国定假日外)通行。</p><p>　　(六)中环路</p><p>　　禁行范围：全线禁止外省市号牌小客车、出租空车、实习车7:30—9:30和16:30—18:30(除周六、日及国定假日外)通行。</p><p>　　(七)华夏高架路</p><p>　　禁行范围：全线禁止外省市号牌小客车、出租空车、实习车7:30—9:30和16:30—18:30(除周六、日及国定假日外)通行。</p><p>　　对违法的驾驶员，交管部门将按照《道路交通安全法》的有关规定处以200元罚款。</p><p><br/></p>'),
(75, '<p>核定载质量为1吨以上(含1吨)的货车、核定载客13座以上(含13座)的客车和二轮摩托车每日7：30时至22：00时在以下起至道路的区域范围内禁止、限制通行：东起建国路、西至新宁路；南起夏都大街、南关街和西关大街；北至七一路、胜利路、小桥大街和门源路。</p><p>　　核定载质量为5吨以上(含5吨)的货车、核定载客30座以上(含30座)的客车和低速载货汽车、三轮车、拖拉机每日7：30时至22：00时以下起至道路的区域范围内禁止、限制通行：东起湟中路、西至海湖路；南起昆仑大道、北至祁连路，并包含昆仑中路。</p><p>　　核定载质量为10吨以上(含10吨)的大型货车、重型货车全天候在以下起至道路的区域范围内禁止通行:东起明杏路、西至海湖路；南起南山路、北至祁连路，并包含民和路、南山路、昆仑大道、生物园区纬二路、南川东路(奉青路以北)和南川西路(福禄巷以北)。</p><p>　　三轮摩托车和电动助力车每日7：30时至22：00时以下起至道路的区域范围内禁止、限制通行：东起建国路、西至冷湖路；南起西关大街和昆仑大道；北至滨河路、七一西路、胜利路和海晏路，并包含夏都大街、南关街、长江路、西关大街和小桥大街。 <br/></p><p><br/></p>'),
(76, '<p>限行时间：7时至21时</p><p>限行路段：江苏南路全段（西藏军区东大门至纪念碑）、北京东路、北京中路、林廓北路、林廓西路、林廓东路全段、朵森格路全段、娘热路南段、康昂路全段、宇拓路全段、德吉路全段、民族路（纪念碑至拉萨饭店十字路口）。</p><p>限行对象：1.5吨及以上货车、电动三轮车（包括正三轮摩托车）和危险物品运输车辆将限时限段通过城市主干道。</p><p><br/></p>'),
(77, '<p>限行范围：南昌市主城区</p><p>&nbsp;</p><p>限行时间：每日7:00-21:00(除公休日法定节假日外）</p>'),
(78, '<p>限行范围：解放路路段（含解放东路和解放西路）</p><p>&nbsp;</p><p>限行时间：每日8:00-20:00</p><p>&nbsp;</p><p>限行对象：黄色环保检验合格标志汽车，无环保标志汽车</p><p>&nbsp;</p><p>特殊通行：执行紧急任务的军车，警用车，消防车，救护车，工程抢险车，环卫工程车。</p>'),
(79, '<p>限行范围：</p><p>留祥路—石祥路—石桥路—秋涛路—复兴路—老复兴路—虎跑路—满觉陇路—五老峰隧道—吉庆山隧道—梅灵北路—九里松隧道—灵溪南路—灵溪隧道—西溪路—紫金港路—文一西路—古墩路构成的合围区域内所有道路以及高架（含匝道以及附属桥梁、隧道）。其中留祥路、石祥路、石桥路、秋涛路、复兴路、老复兴路、紫金港路、文一西路和古墩路不含。<br/></p><p>限行规则；<br/>1、浙A号牌机动车<br/>机动车在工作日按机动车号牌（含临时号牌）最后一位阿拉伯数字对应，在“错峰限行”区域内，按“错峰限行”时段禁止通行。<br/>2、非浙A号牌机动车<br/>工作日高峰时段实行机动车全号段禁行<br/></p><p>限行时间：<br/>(上午7:00-9:00，下午16:30-18:30)，全号段禁行<br/></p><p>特殊情况：<br/>尾号为字母的按前一位管理<br/></p><p><br/></p>'),
(80, '<p>限行范围：<br/>三环路（含）与二环路（含）之间区域内所有道路</p><p>限行时间：<br/>周一至周五工作日7:30-20;00</p><p>限行车辆<br/>所有“川A”及外地号牌汽车</p><p>特殊情况<br/>全体公民放假的节日，如果恰逢星期六，星期日而变更为工作日的，则按对应工作日实施“尾号限行”。尾号为字母车牌，按前一位数字管理。</p><p><br/></p>'),
(81, '<p>限行范围<br/>东岗立交桥以西，南山路、工林路、兰工坪路、<br/>晏家坪北路以北，武威路、敦煌路、七里河黄河大桥以<br/>东，黄河以南（含区间内各跨河桥梁）范围内（含上述<br/>路段，南山路、晏家坪北路、武威路除外），以及北滨<br/>河路（雁滩大桥至七里河大桥）。</p><p>限行时间<br/>每日7:00-20;00</p><p>从5月25日起至7月20日（含双休日、法定节假日和调休日）每日7时至20时，在兰州中心城区道路实施单双号限行措施，按照机动车号牌为数，单号单日通行，双号双日通行。限行车型为核载不足9人的本市号牌小型及微型载客汽车（执行任务的警车、消防车、救护车、工程救险车和本市客运出租车除外）。限行区域同目前尾号限行区域一致。即：东岗立交桥以西、南山路、工林路、兰工坪路、晏家坪北路以北，武威路、敦煌路、七里河黄河大桥以东，黄河以南（含区间内各跨河桥梁）范围内（含上述路段，南山路、工林路、兰工坪路、晏家坪北路、武威路除外），以及北滨河路（雁滩大桥至七里河大桥）。</p><p><br/></p>'),
(82, '<p>限行范围<br/>长春市人民大街，自由大路，吉林大路和人民广场等处</p><p>限行时间<br/>每日6:00-20:00</p><p>限行对象<br/>机动车（不含出租车，公交车，中型和大型客车）</p><p>限行规则：按车牌尾号每月禁行三天，即车牌尾号与日期尾号相同的车辆禁行。如每月1日，11日和21日，车牌尾号为1的禁行。31日不做限制。尾号为字母的限行按4号管理。</p><p><br/></p>'),
(83, '<p>限行对象</p><p>本地、异地号牌黄标车。</p>'),
(84, ''),
(85, '<p>限行范围</p><p>维明街（含）以东、体育大街（含）以西、裕华路（含）以北，和平路（含）以南区域内道路</p><p>&nbsp;</p><p>限行时间</p><p>7:00-21:00</p><p>&nbsp;</p><p>限行对象</p><p>黄标车</p>'),
(86, '<p>一）重中型（黄牌）载货汽车限行规定<br/>&nbsp;&nbsp;&nbsp; 1.二环路（含）以内道路：全天24小时禁止通行。<br/>&nbsp;&nbsp;&nbsp; 2.三环路全线（含）和二环路与三环路之间道路：7∶00-21∶00禁止通行，其中江滨大道（东起君竹路口西至杨桥西路口）、闽江大道（北起洪塘路口南至尤溪洲大桥下）、南江滨大道（西起鳌峰大桥下东至海峡国际会展中心）、南江滨休闲路（北起上下店路口南至中联水岸名居口）、水岸名居口南侧通道（西起闽江大道东至南江滨休闲路）、金榕南路（南起凤冈路口北至金山大道路口）、金祥路（东起闽江大道路口西至金榕南路口）、凤冈路（东起闽江大道路口西至金榕南路口）、东山路（南起化工路口北至园中大桥南侧）等9条道路禁止重中型载货汽车24小时通行规定不变。<br/>&nbsp;（二）轻型（蓝牌）载货汽车限行规定<br/>&nbsp;&nbsp;&nbsp; 二环路（含）以内道路：7∶00-21∶00禁止轻型载货汽车[除载重量在0.5吨（含）以下外]通行。<br/>&nbsp;&nbsp;&nbsp; 三环路（含）以内道路：7∶00-21∶00禁止轻型自卸货车通行，其中江滨大道（东起君竹路口西至杨桥路口）24小时禁止轻型自卸货车通行。<br/>&nbsp;&nbsp;&nbsp; （三）外地轻型货车限行规定<br/>&nbsp;&nbsp;&nbsp; 三环路（不含）以内道路：全天24小时禁止非福州市行政辖区（即挂外地牌照）的轻型载货汽车通行，但允许通过三环路借道过境。<br/>&nbsp;&nbsp;&nbsp; （四）大型载客汽车通行规定<br/>&nbsp;&nbsp;&nbsp; 公路客运、旅游客运等营运大型载客汽车进出市区至客运场站的，二环路以内道路按指定线路通行，二环路以内其他道路禁止通行。<br/>&nbsp;&nbsp;&nbsp; 禁止大型载客汽车上二环路高架桥（除尤溪洲高架桥和鹤林高架桥外）通行。</p><p><br/>&nbsp;</p><p><br/></p>'),
(87, '<p>限行规则</p><p>8:00-22:00</p><p>河滩快速路（苏州路立交桥至人民路立交桥之间路段）禁止轻型、微型货运车辆（含已配发通行证车辆）及外埠号牌车辆通行（含已配发通行证车辆）</p><p>8;00-24；00</p><p>禁止中型、重型货运车辆通行（含已配发通行证车辆）</p>'),
(88, '<p>限行范围<br/>一环以内（含一环线上），一环路指由北京路、宝山路、市南路、解放路、浣纱路、枣山路及由其合围成的道路。</p><p>限行时间<br/>7:00-21:00</p><p>限行对象<br/>1.5吨及以上货车、电动三轮车（包括正三轮摩托车）和危险物品运输车辆。</p><p>特殊情况<br/>市外车辆进入我市<br/>由“开三停五”变为“开四停四”<br/>自7月7日起，普通号牌车辆每日7:00至21:00禁止驶入一环(含一环)以内道路，其他时间允许驶入。<br/>临时驶入我市一环路(含一环路)以内道路的非本市9座以下载客汽车(含临时号牌车辆)，连续行驶时间最长不得超过4天，再次驶入须间隔4天以上(即由原来的“开三停五”调整为“开四停四”)。计算时间不中断，此前的通行和停驶时间计入新调整期限。<br/></p><p><br/></p>'),
(89, '<p>限行时间<br/>每日7:00-22;00(其中知音桥每日限行时间为7:00-20;00)</p><p>限行范围<br/>长江大桥，江汉桥，知音桥</p><p>限行规则<br/>长江一桥、江汉一桥、江汉二桥（知音桥）是单双号限行，<br/>尾号为单即单号日子可走；<br/>&nbsp; <br/>长江二桥、长江隧道是工作日（节假日除外）前后号限行，<br/>尾号为当日所对应的前后号不能走，例如今天11号工作日，尾号为<br/>0、2的禁止通行。</p><p><br/></p>'),
(90, '<p>限行范围</p><p>持黄色环保检验合格标志的机动车七点到晚上十点在三环路（不含三环路）内禁止通行；无标机动车禁止在西安市区域内上路行驶。</p><p>&nbsp;</p><p>限行时间</p><p>从2013年10月1日起七点到晚上十点</p><p>&nbsp;</p><p>限行对象</p><p>黄标车、无标车。</p>'),
(91, '<p>限行时间<br/>工作日7:00-9:00、17:00-19:00</p><p>限行范围<br/>在大观路(广汕路至中山大道至东圃大桥段)、珠江水道(东圃大桥至长洲岛)，珠江水道(海珠区南面、长洲岛北面)。<br/>西面：白云区、荔湾区与佛山市交界处<br/>北面：广汕路(大观路至华南快速干线段，不含)华南快速干线(广汕路至春岗立交段，华南快速干线三期，鸦岗大道(不含）<br/>&nbsp;<br/>限行车辆<br/>非本市籍载客汽车（含临时号牌车辆）</p><p><br/></p>'),
(92, '<p>自2015年1月11日起，工作日(法定节假日除外)每日7时至9时和16时至19时，禁止外埠牌照机动车在外环线(不含)以内道路通行。自2015年1月11日起，每日7时至19时，禁止货运机动车在外环线上通行。</p><p style="TEXT-ALIGN: left; TEXT-INDENT: 0px">  <span style="color: rgb(227, 108, 9);">√</span>&nbsp;<strong>限行范围 限行时<span style="color: rgb(227, 108, 9);"></span>段</strong></p><p style="TEXT-ALIGN: left; TEXT-INDENT: 0px">  自2015年1月11日至2016年4月9日，工作日（法定节假日除外）每日7时至19时，天津及外埠牌照机动车在外环线（不含）以内道路，继续实施按车牌尾号区域限行交通管理措施。按车牌尾号工作日（法定节假日除外）区域限行的机动车号牌（含临时号牌）尾号分为5组，定期轮换限行日，分别为：</p><p style="TEXT-ALIGN: left; TEXT-INDENT: 0px">  （一）自2015年1月11日至2015年4月11日，星期一至星期五限行机动车号牌尾号（机动车号牌尾号为英文字母的按0号管理，下同）分别为2和7、3和8、4和9、5和0、1和6；</p><p style="TEXT-ALIGN: left; TEXT-INDENT: 0px">  （二）自2015年4月12日至2015年7月11日，星期一至星期五限行机动车号牌尾号分别为1和6、2和7、3和8、4和9、5和0；</p><p style="TEXT-ALIGN: left; TEXT-INDENT: 0px">  （三）自2015年7月12日至2015年10月10日，星期一至星期五限行机动车号牌尾号分别为5和0、1和6、2和7、3和8、4和9；</p><p style="TEXT-ALIGN: left; TEXT-INDENT: 0px">  （四）自2015年10月11日至2016年1月9日，星期一至星期五限行机动车号牌尾号分别为4和9、5和0、1和6、2和7、3和8；</p><p style="TEXT-ALIGN: left; TEXT-INDENT: 0px">  （五）自2016年1月10日至2016年4月9日，星期一至星期五限行机动车号牌尾号分别为3和8、4和9、5和0、1和6、2和7。</p><p style="TEXT-ALIGN: left; TEXT-INDENT: 0px">  <span style="color: rgb(227, 108, 9);">√&nbsp;</span><strong>不受限行的车辆</strong></p><p style="TEXT-ALIGN: left; TEXT-INDENT: 0px">  以下机动车不受上述措施限制：警车、消防车、救护车、工程救险车等4类特种车辆；大中型客车（含公共汽车、班车、长途汽车等）、出租汽车（不含租赁车辆）、邮政专用车（持公安交管部门核发的邮政通行证）；各国驻华使、领馆和国际组织驻华机构机动车（“使”字号牌车辆）；环卫、园林、道路养护等专项作业车辆；殡仪馆的殡葬车辆。</p><p><!--正文 end--></p><p><br/></p>'),
(93, '<p>廊坊主城区环线南龙道、北凤道、东安路、西昌路(含)以内7时至20时实行机动车限行。10月8日限行尾号为1和6;10月9日为2和7;10月10日为3和8;10月11日为5和0;尾号为字母的按“0”管理;黄标车禁止上路行驶。</p>'),
(94, '<p>奥迪是一个国际高品质汽车研发商和制造商。现为大众汽车公司的子公司，总部设在德国的英戈尔施塔特，奥迪主要量产车系有A系列（涵盖AO级别、A级别、B级别、C级别、D级别车型）、Q系列、R系列、TT系列、S系列、RS系列及尤A系列繁衍出的Allroad系列。</p>'),
(95, '<p>巴伐利亚发动机制造厂股份有限公司（德语：Bayerische Motoren Werke AG），通称BMW，在中国区又常称为宝马，是德国一家跨国豪华汽车、摩托车和引擎制造商，总部位于德国巴伐利亚州的慕尼黑。宝马经常被昵称为Bimmer。宝马集团除了以“BMW”作为品牌商标销售各式汽车与摩托车外，也收购过多家外国汽车公司。目前宝马集团是宝马、MINI、Rolls-Royce三个品牌的拥有者。2012年宝马集团全品牌共生产1,845,186汽车和117,109摩托车。</p>'),
(96, '<p>保时捷，德国汽车品牌，公司的创始人费迪南德·保时捷（又译作费迪南德·波尔舍）在24岁时（1899年）已经发明了电动轮套马达，在第二年的巴黎国际展览会上，保时捷已经名扬四海。保时捷汽车具有鲜明的特色，甲壳虫式的车形，后置式发动机和优异的性能，令它很快成为知名</p><p>的汽车。1963年法兰克福国际汽车展览会上，展示了保时捷911车型，这个设计直到现在还有广泛的市场。它的车体设计者是费利，保时捷的大儿子，费迪南德·亚历山大·保时捷，保时捷带后齿轮箱底盘和V-8发动机的928型，新技术959型，以及带电子调整的四轮驱动系统和无升力车身的911 Carrera 4型，是近几年来最重要的发展。</p><p><br/></p><p>极少有品牌能够如保时捷一样，像出售必需品一样出售奢侈品。在新款汽车保时捷911的广告中有这样一句广告词：“在一个充满多余和肤浅的时代，在一个充满轻浮与粗糙的年代，唯有保时捷911是真正的必需品。无可替代。”</p><p><br/></p><p>保时捷的英文车标引采用德国保时捷公司创始人费迪南德·保时捷的姓氏。图形车标采用公司所在地斯图加特市的盾形市徽。“PORSCHE”字样在商标的最上方，表明该商标为保时捷设计公司所拥有；商标中的“STUTTGART”字样在马的上方，说明公司总部在斯图加特市；商标中间是一匹骏马，表示斯图加特这个地方盛产一种名贵种马；商标的左上方和右下方是鹿角的图案，表示斯图加特曾经是狩猎的好地方；商标右上方和左下方的黄色条纹代表成熟了的麦子颜色，喻指五谷丰登，商标中的黑色代表肥沃土地，商标中的红色象征人们的智慧与对大自然的钟爱，由此组成一幅精湛意深、秀气美丽的田园风景画，展现了保时捷公司辉煌的过去，并预示了保时捷公司美好的未来，保时捷跑车的出类拔萃。</p><p><br/></p>'),
(97, '<p>梅赛德斯-奔驰（Mercedes-Benz）是世界知名的德国汽车品牌，创立于1900年，总部设在斯图加特，创建人为卡尔·本茨（Karl Benz）和戈特利布·戴姆勒（Gottlieb Daimler）。梅赛德斯-奔驰以高质量、高性能的汽车产品闻名于世，除了高档豪华轿车外，奔驰公司还是世界上最著名的大客车和重型载重汽车的生产厂家。目前，梅赛德斯-奔驰为戴姆勒（Daimler AG）旗下的一个部门。</p><p>2015年3月15日，央视315晚会曝光，奔驰4S店会故意虚报和夸大车辆故障，从中牟取暴利。2015年4月23日，江苏省物价局对奔驰公司罚款3.5亿元，对部分经销商罚款786.9万元。奔驰成为中国汽车反垄断处罚史上单品牌最高罚单</p><p><br/></p>'),
(98, '<p>大众汽车（德语：Volkswagen），台湾译为福斯汽车，港澳译为大众汽车或福士汽车，马新译为大众汽车，意思是“人民的汽车”，故又常简称为“VW”。大众汽车是一家总部位于德国沃尔夫斯堡的汽车制造公司，它也是世界四大汽车生产商之一的大众集团的核心企业。2009年5月，在经过长达4年之久的收购大战之后，保时捷和大众的控股家族达成了初步协议。这两家公司将合二为一，打造出一家拥有10大品牌的欧洲最大汽车制造商。2012年3月，质检负责人就DSG变速器故障一事约谈公司相关代表，要求采取措施解决该问题。</p>'),
(99, '<p>劳伦士(LORINSER)是一个专业音响品牌，系列产品针对高级商用、KTV、娱乐业而量身定制。LORINSER专业音响系统的研发，参照了国际专业音响制造的成功案例，结合当今世界人们对音响设备提出的新要求，利用当前最先进的技术方法和技术成果，制造出了完全符合现代娱乐环境近乎苛刻要求的新一代技术产品，在现代流行艺术和大众文化娱乐领域产生出的一个完美而实用的技术结晶。</p>'),
(100, '<p>迈巴赫（德文：Maybach）与迈巴赫发动机制造厂（德文：Maybach-Motorenbau GmbH）是一曾经在1921年到1940年间活跃于欧洲地区的德国超豪华汽车品牌与制造厂，车厂创始人卡尔·迈巴赫（Karl Maybach）的父亲威廉·迈巴赫（Wilhelm Maybach）曾担任戴姆勒发动机公司（今日戴姆勒·克莱斯勒集团前身）的首席技术总监，两厂渊源甚深。1997年戴姆勒·克莱斯勒集团在东京车展会场中展出一辆以Maybach为名的概念性超豪华四门轿车，正式让这个德国汽车品牌在销声匿迹多年后再次复活。今日的迈巴赫（车厂名已改为Maybach Manufaktur，迈巴赫制造厂）是戴姆勒·克莱斯勒汽车集团底下，等级最高的豪华房车专用品牌，但在车辆的机械结构方面，其实与同集团的梅赛德斯·奔驰（Mercedes-Benz）有非常高度的共通性。</p>'),
(101, '<p>OPEL在中国大陆称为欧宝、在台湾称为欧普。德国欧宝公司是美国通用汽车公司的子公司，是通用公司在欧洲的一个窗口。它由Adam Opel，即亚当·欧宝(欧普)所创立，至今已有百多年历史。欧宝自1993年进入中国。目前已停止在中国销售。</p>'),
(102, '<p>smart中的S代表了斯沃奇(Swatch)，M代表了戴姆勒集团(Mercedes-Benz)，而art则是英文中艺术的意思，合</p><p>起来可以理解为，这部车代表了斯沃奇和戴姆勒合作的艺术，而smart车名本身在英文中也有聪明伶俐的意思，这也契合了smart公司的设计理念。　smart对环境的危害是很小的，戴姆勒-克莱斯勒强调该车几乎所有的部件都由人造的东西组成。钢底盘为粉末涂层而非常规的油漆, 因此没有溶剂，没有油漆污染，也没有废水流出。同时他是有标准件的产品，超过85%的东西可以循环再造。</p><p>因此，smart是环保，经济，而且容易停车，现在右肽版本也已经出来了。第一次坐进smart的驾驶室，你仍然会对它的驾驶乐趣感到惊讶不已。很显然，在郊外它看上去更像一个吵闹的盒子，用它来做长途旅行是很容易令人疲惫的。它没有提供现代小汽车的令人轻松的驾驶乐趣以及只有很小的行李空间证明这确实是一台城市的汽车：用来代步或者购物的。不过，在电子控制作用下，该车的最高时速可达137公里（加强的钢铁硬度使它成为了小车级别中最安全的汽车之一），如果有需要，smart完全有能力长途旅行。</p><p>smart没有提供很大的发动机功率（从44匹到61匹），但它有一个优势，6速自动变速箱。SOFTIP按照标准来进行换档动作。车子没有离合器踏板：只要简单地向前推排档杆就换到高档位了，而当向后拉排档杆就换入低档了。做为买家，可以选择SOFTOUCH自动变速系统，他可以让驾驶者简单的在自动与手动模式中切换，只要轻触位于排挡杆上端的按钮就可以完成切换。</p><p><br/></p>'),
(103, '<p>“标致”（PEUGEOT）曾译名为 “别儒”，公司采用 “狮子”作为汽车的商标。1848年，阿尔芒·别儒家族在法国巴黎创建了一家工厂，主要生产拉锯、弹簧和齿轮等。1896年，别儒在蒙贝利亚尔创建了标致汽车公司。1976年该公司与雪铁龙汽车公司组成标致集团，是欧洲第三大汽车公司。</p><p>标致品牌在全球160个国家建立了销售网络，拥有1万家销售网点。标致汽车集卓越、魅力和情感于一身.2013年，标致在全球一共售出了155.3万辆汽车，加快了在新兴市场的国际化步伐，并继续发力高端市场。标致采用e-HDi柴油微混技术，并推出了三款HYbrid4强混柴油动力新车型，不断坚持自身的环境承诺。</p><p><br/></p>'),
(104, '<p><br/></p><p>布加迪是世界著名的老牌运动车品牌，1909年意大利人埃托尔·布加迪（Ettore Bugatti）在法国创建布加迪公司，专门生产运动跑车和高级豪华轿车。 &nbsp;</p><p><br/></p><p>这家车厂是以精巧的造车技术出名，其高级汽车的制造更是一流。布加迪是汽车大奖赛（F1的前身）的常胜军，它们是第一届摩纳哥大奖赛的冠军；布加迪也是利曼24小时耐久赛的常胜军，Jean-Pierre Wimille为其二度夺下冠军而Robert Benoist和Pierre Veyron（日后的Veyron车款就是为了纪念他）也各为布加迪拿下一冠。</p><p><br/></p>'),
(105, '<p>√ 限行范围 <br/>市区三环以内（中州大道、西三环、南三环、北三环以内区域，均不含本路）<br/>√ 限行时间<br/>2014年5月4日至2016年2月15工作日7:00—20:00<br/>√ 限行规则<br/>悬挂郑州车牌的所有机动车按车牌（含临时时号牌）最后一位阿拉伯数字，单号单日、双号双日通行。<br/>悬挂外地牌号机动车在工作日早晚高峰期按车牌（含临时时号牌）最后一位阿拉伯数字，在市区三环以内单号单日、双号双日通行。早晚高峰具体时段为，早高峰：工作日的7:00—9:00、晚高峰：夏季（5月1日至9月30日）工作日的18:00—20:00;冬季（10月1日至次年4月30日）工作日的17:00-19:00.</p>'),
(106, '<p style="white-space: normal;">坤通金融服务外包有限公司位于郑州市高新区。是一家集软件开发、网络技术服务、信息咨询服务，理财规划、企业管理策划咨询服务、电子商务服务、销售等为一体的高新技术服务企业。目前，在全国拥有子公司12家，分布河南、河北、山西、陕西、四川、内蒙等。在中国率先推出&quot;个人对个人（&quot;Peer to Peer&quot;或称&quot;P2P&quot;）的《互联网借贷平台》及《共通积分（便利）兑换商城》、《供销商城》等创新型电子商务交易（B2B、B2C、C2C、C2B、O2O）商业模式优势于一体的综合服务平台。平台项目在国内处于领先地位，独一无二，无可替代。</p><p style="white-space: normal;"><strong>集团文化——礼 义 廉 耻&nbsp;</strong>&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp;礼是规规矩矩的态度，礼是严严整整的纪律，</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp;义是正正当当的行为，义是慷慷慨慨的牺牲，</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp;廉是清清楚楚的辨别，廉是实实在在的节约，</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp;耻是切切实实的觉悟，耻是轰轰烈烈的奋斗。</p><p style="white-space: normal;">三年战略 ： 忘掉过去、调整心态、</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 确定模式、寻找天才</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 本土化、同城化、行业化、品牌化</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 科技高地、人才高地</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 技术高地、产业高地</p><p style="white-space: normal;">目标：诚信和创新，提高企业核心竞争力，引领企业成为行业领头人！</p><p style="white-space: normal;">利益：严格按照以股东、员工、客户、家属、社会的利益序列，利益分配，发展运营。</p><p style="white-space: normal;">流程：内部物流化，外部连锁化</p><p style="white-space: normal;">管理：标准化、流程化、简单化、系统化</p><p style="white-space: normal;">集团模式：集资本运营导向模式和产业运作模式的结合，建设以服务实体经济为基础，资本运营为纽带的双核模式</p><p style="white-space: normal;"><img src="http://www.vcivc.cn/data/upload/ueditor/image/1/201412/1419927656433042.jpg" width="100%"/></p><p style="white-space: normal;"><img src="http://www.vcivc.cn/data/upload/ueditor/image/1/201412/1419927656847908.jpg" width="100%"/></p><p style="white-space: normal;"><img src="http://www.vcivc.cn/data/upload/ueditor/image/1/201412/1419927657788707.jpg" width="100%"/></p><p style="white-space: normal;"><img src="http://www.vcivc.cn/data/upload/ueditor/image/1/201412/1419927691942735.png" width="100%"/></p><p style="white-space: normal;"><strong>优势与专长</strong></p><p style="white-space: normal;">创业团队具有共同的事业价值观，集智商、情商、财商为一身，优势互补的经营、管理、执行团队。</p><p style="white-space: normal;">战略规划方向正确、目标定位准确，高瞻远瞩，放眼未来。</p><p style="white-space: normal;">团队具有自我创新意识，对市场经济有正确的洞察力和判断力。</p><p style="white-space: normal;">商业模式科学、先进，竞争优势突出，盈利模式多元化，风险控制能力强。</p><p style="white-space: normal;">灵活机动的战略战术，资源整合合作能力强。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">&quot;无需抵押担保、仅仅凭借个人征信评级、信用管理等服务模式&quot;,成为目前小额民间借贷市场最大的竞争优势。&quot;银行不好贷款,即便贷到款,审批程序也极其复杂和漫长,货币紧缩后,低端小额贷款更是难上加难。&quot;</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">在P2P的个人信贷理财模式里,所有的借款都是信用借款,不需要实物抵押。由于不吸储也不放贷,而是将有理财需求的出借人和有资金需求的借款人&quot;配对&quot;,提供一个自然人之间的借贷交流平台,以之后向借款人收取服务费作为收入来源之一。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">P2P的信贷模式从长远看,还会不断吸引新的机构进来,随着这些成熟机构的进一步创新,还将演变成信托机构,架起城乡信用融资的桥梁。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;"><strong>行业与发展</strong></p><p style="white-space: normal;">所属行业： 资本市场服务</p><p style="white-space: normal;">今天电子商务不是一个技术，不是一个商业模式，它是一场革命，它是一个生活方式和工作方式的变革，它只是刚刚开始。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">最近统计数据显示， 2013年中国电子商务市场交易规模达10.2万亿元，同比2012年的8.5万亿元，增长29.9%。2014年一季度限额以上单位网上零售额815亿元，增长51.7%。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">国内网络借贷平台已有数百家，国外有26家。国内主要分布在长三角、珠三角及北京、天津等发达地区。借贷平台客户多达数百万之众，年交易额实现数百亿人民币，单日交易额实现数亿人民币。《温州金融改革实验区》确定了金融服务平台的合法地位。互联网借贷平台的发展趋势日益形成。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">网络借贷指在网上实现借贷，借入者和借出者均可利用这个网络平台，实现借贷的&quot;在线交易&quot;。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">2012年P2P网贷入选&quot;2012年中国年度创新成长企业100强&quot;中唯一入选的金融信息服务企业。</p><p style="white-space: normal;">&nbsp; &nbsp;</p><p style="white-space: normal;">长时段来看，互联网金融才大潮初起，难免泥沙俱下，但潮涨潮落，不改一浪高过一浪的发展趋势。当前的鱼龙杂混、良莠不齐的情况一定不会长期持续下去。P2P健康发展的前提可能是要经历一些风雨，淘汰一批经营不善的网贷公司，甚至要打击掉一批借着P2P平台进行违法犯罪活动的团伙。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">我们相信，经过洗牌之后，一些巨型的、有实力的网贷公司或许将兼并一些中小型网贷公司，并且专注做平台的P2P公司将引进和培育一批金融服务机构。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;"><strong>产品服务</strong></p><p style="white-space: normal;">主营业务：自主研发电子商务交易平台、P2P借贷平台系统，为创业者和传统企业提供全方位、多选项的电子商务解决方案。在中国率先推出&quot;个人对个人（&quot;Peer to Peer&quot;或称&quot;P2P&quot;）的《信用借贷平台》及《共通积分（便利）兑换商城》、《供销商城》等创新型电子商务交易（B2B、B2C、C2C、C2B、O2O）商业模式优势于一体的综合服务平台。</p><p style="white-space: normal;">主要产品与服务：可定制型《P2P借贷平台系统》；电子商务交易平台系统《共通积分（便利）兑换商城》、《供销商城》。</p><p><br/></p>'),
(107, '<p style="white-space: normal;">手机客户端</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">1.通过用手机扫描此二维码，获得手机客户端下载地址。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">（安卓手机用户客户端下载，请用浏览器扫描下面二维码）&nbsp;</p><p style="white-space: normal;">&nbsp;<img src="/data/upload/ueditor/image/8/201506/1433576686521789.png" title="1433576686521789.png" alt="cli_300px.png" width="265" height="274" style="width: 265px; height: 274px;"/></p><p style="white-space: normal;">（苹果手机越狱用户客户端下载，非越狱手机无法安装，请用浏览器扫描下面二维码）</p><p style="white-space: normal;"><img src="/data/upload/ueditor/image/1/201506/1433556818121613.png" title="1433556818121613.png" alt="code.png" width="280" height="280" border="0" vspace="0" style="width: 280px; height: 280px;"/></p><p style="white-space: normal;">&nbsp;</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">2.在手机浏览器中输入此地址，下载商城手机客户端。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">安卓手机用户客户端下载：<a href="http://kuntong.vcivc.cn/data/app/che.5.apk" target="_blank" textvalue="http://kuntong.vcivc.cn/data/app/che.5.apk">http://kuntong.vcivc.cn/data/app/che.5.apk</a></p><p style="white-space: normal;">苹果手机越狱用户客户端下载：<a href="http://kuntong.vcivc.cn/data/app/che.5.ipa" target="_blank" textvalue="http://kuntong.vcivc.cn/data/app/che.5.ipa">http://kuntong.vcivc.cn/data/app/che.5.ipa</a></p><p style="white-space: normal;"><br/></p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">3.如果您的手机不支持直接下载，那么您可以点击（苹果手机用户客户端下载）或（安卓手机用户客户端下载），先将手机客户端下载到您的电脑中，然后再用数据线或读卡器传输到您的手机中。</p><p><br/></p>');
INSERT INTO `plf_article_data` (`id`, `content`) VALUES
(109, '<p style="white-space: normal;"><br/></p><p style="white-space: normal;">本协议是使用璞胜车务的车主（以下简称车主）和璞胜车务就道路救援等相关事宜所订立的道路救援服务协议，请您仔细阅读本协议，您勾选“已阅读并同意”复选框后，本协议即构成对双方有约束力的法律文件。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">一、协议声明</p><p style="white-space: normal;">1.本协议由璞胜车务统一管理，协议条款是处理双方权利义务的协议，始终有效，法律另有强制性规定或双方另有特别约定的除外。</p><p style="white-space: normal;">2.您勾选道路救援页面下“已阅读道路救援协议并同意”复选框后，即视为您已阅读、了解并完全同意本协议的各项内容，并具有独立承担法律责任的能力。</p><p style="white-space: normal;">3.璞胜车务在必要时可修改本协议，并在璞胜车务软件上进行公告，即公告之日起生效。如您继续使用道路救援服务，则视为您已接受修订的救援协议。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">二、服务说明</p><p style="white-space: normal;">1.璞胜车务通过互联网依法为用户提供道路救援服务，用户在完全同意本协议及橙牛规定的情况下，方有权使用璞胜车务的道路救援服务。</p><p style="white-space: normal;">2.璞胜车务道路救援服务适用车辆定义：</p><p style="white-space: normal;">1)仅限私家车、（非营运）公用四轮机动车辆：</p><p style="white-space: normal;">2)摩托车、（小）中巴／客车(12座及以上的)、轻型／中型／重型运货车等不属救援服务对象：</p><p style="white-space: normal;">3)出租／营运性质的载人载货车辆（如公共汽车，出租车，货运车）不属于救援服务对象。</p><p style="white-space: normal;">3.覆盖事件：由于机械电子故障、驾驶员失误以及交通事故导致的车辆无法继续行驶的状况，或者由于事故导致车辆偏离正常行驶道路的状况。</p><p style="white-space: normal;">4.服务区域：仅限中国大陆地区（不合港澳台地区）。</p><p style="white-space: normal;">5.故障种类包括：机械或电器故障一驾驶员失误一蓄电池问题：电压不足一燃料问题：没有燃料，燃料错误，或燃料受污染一钥匙问题：钥匙被锁在里面，丢失，或被损坏一轮胎问题：爆胎、扎胎以及与气门相关的问题一由于交通事故而不能继续行驶</p><p style="white-space: normal;">(l)拖车服务</p><p style="white-space: normal;">若车主车辆因机械故障无法恢复安全行驶或无法在30分钟内现场修理，橙牛道路救援中心将负责安排将车主的故障车辆拖至最近的、具备合适能力的服务站或修理厂，并支付50km以内拖车费用。拖车距离是指拖车拖载用户车辆行驶的里程。超出部分按每公里1 0元计算，由车主直接支付给服务商。该服务不包括交通部门或其他部门规定限制第三方道路救援活动的路段以及在高速公路、隧道、大桥、高架道路等收费路段产生的路桥费及空驶费等其他费用。</p><p style="white-space: normal;">(2)搭电服务</p><p style="white-space: normal;">若车主车辆因电池亏电、发电机不发电无法启动，璞胜车务道路救援中心将提供电瓶充电服务启动车辆。璞胜车务道路救援中心支付前往救援地点的人工费及出车费用，此服务无公里数限制。</p><p style="white-space: normal;">(3)更换轮胎</p><p style="white-space: normal;">若车主车辆因轮胎损坏无法行驶的，橙牛道路救援中心将派遣技术人员为车主提供免费更换备胎的服务。车主须自备足气正常备胎。需用轮胎螺丝钥匙或特殊轮胎更换工具的，用户需自备。配件或其它材料的供应或更换费用由车主自行承担。此服务无</p><p style="white-space: normal;">公里数限制。如因客观条件不具备导致更换轮胎无法安全进行时，则将用户车辆拖至最近维修网点，橙牛道路救援中心将按照本协议中详述的拖车牵引服务内容为甲方车主提供拖车服务。</p><p style="white-space: normal;">(4)紧急送油</p><p style="white-space: normal;">当车主车辆发生行驶途中燃油耗尽的情况，璞胜车务道路救援中心将派遣技术人员提供紧急送油服务，并承担相关服务费用。车主每次可以免费享受最多10升燃油的递送服务，但油费需要客人按照当日购买燃油的加油站的油价自行承担，并支付给橙牛璞胜车务道路救援中心服务商。车主如有其它服务需求，应承担所有相关费用并直接支付给璞胜车务道路救援中心服务商。此项服务无公里数限制。如因特殊情况无法提供桶装送油，璞胜车务道路救援中心将采用拖车将车主车辆拖至距离最近的加油站进行燃油加注。璞胜车务道路救援中心将按照本协议中详述的拖车牵引服务内容为车主提供拖车服务。</p><p style="white-space: normal;">(5)紧急送水</p><p style="white-space: normal;">如车主车辆在道路行驶过程中水箱缺水的，璞胜车务道路救援中心负责免费加水。璞胜车务道路救援中心将承担服务人员前往救援地点的交通费用与工时费用。任何配件或其它材料的供应或更换均不包含其中。此项服务无公里数限制。</p><p style="white-space: normal;">(6)路边快修</p><p style="white-space: normal;">针对油、机、电路故障在行车前不能启动或途中因机械故障无法继续安全行驶的、车辆异响、水温高等原因，可在30分钟以内对故障车故障部位不解体、不换件前提下实施的路面紧急救援，璞胜车务道路救援中心支付派遣一名修理工前往救援地点并承担人工费和交通费，但更换零配件的相关费用由车主自行承担。此项服务无公里数限制。在因特殊情况现场不具备修理条件，璞胜车务道路救援中心将采用拖车将车主车辆拖至距离最近的维修站进行修理。璞胜车务道路救援中心将按照本协议中详述</p><p style="white-space: normal;">的拖车牵引服务内容为甲方车主提供拖车服务。</p><p style="white-space: normal;">(7)备用钥匙递送</p><p style="white-space: normal;">如车主的车辆被锁或丢失或损坏钥匙，若车主有备用钥匙，璞胜车务道路救援中心将派遣一位技术人员将备用钥匙派送到车主指定地点，或派送到车辆停放地点。此服务限同城且备用钥匙存放地与车主指定备用钥匙派送地点或者车辆停放点之间的距离不超过50公里。如要求异地派送或超50公里派送，车主需与璞胜车务道路救援中心服务商沟通并承担相关费用。</p><p style="white-space: normal;">6.车主需完成璞胜车务注册或认证，即可购买道路救援服务：</p><p style="white-space: normal;">7.如有疑问，请咨询客服热线4008066330。</p><p style="white-space: normal;">三、服务质量标准</p><p style="white-space: normal;">1.璞胜车务道路救援中心实行一年365天，每天24小时的全国汽车非事故道路救援服务。</p><p style="white-space: normal;">2.璞胜车务道路救援中心应对故障车的现场维修应控制在30分钟内（其中包括现场小修、更换轮胎、电瓶充电、开锁等服务）。</p><p style="white-space: normal;">3.若璞胜车务道路救援中心救援的机械专家判定的车辆故障在现场无法排除，或现场维修超过30分钟，璞胜车务道路救援中心坐席人员将与车主协商后，按照商议的结果，将车辆拖车到当时距离救援地点最近的具有维修资质的汽车修理厂进行维修。璞胜车务道路救援中心按照本协议中的拖车牵引服务内容为车主提供拖车服务。</p><p style="white-space: normal;">4.自接受救援案件开始计算直到服务商到达救援现场，在城市范围内正常情况下，不超过45分钟，在需要通过高速公路的情况下不超过1个小时。</p><p style="white-space: normal;">5.若在救援过程中遇到特殊的状况，救援中心坐席人员应连线供应商救援车辆和车主，三方通话约定具体到达救援地点的时间。特殊情况包括但不限于：</p><p style="white-space: normal;">·交通管制地段；</p><p style="white-space: normal;">·交通高峰时间、道路堵塞；</p><p style="white-space: normal;">·施工路段；</p><p style="white-space: normal;">·禁行时间或区域；</p><p style="white-space: normal;">·特殊气候条件下以及其它非人力可以抗拒的情况下；</p><p style="white-space: normal;">·或因保证救援质量的需要，进行必要的器材或设备调配的情况。</p><p style="white-space: normal;">出现上述特殊情况，璞胜车务道路救援中心须及时与车主联系，经取得车主理解后与车主重新约定到达救援现场时间：如璞胜车务道路救援中心未与车主联系并自行更改原约定的到达时间，璞胜车务道路救援中心承担相应责任。</p><p style="white-space: normal;">四、二次服务计费方式</p><p style="white-space: normal;">在特殊情况下，如车主在致电璞胜车务道路救援呼叫中心要求服务后的10分钟内取消服务，车主可联系璞胜车务道路救援呼叫中心取消此服务。如在致电璞胜车务道路救援呼叫中心要求服务后的10分钟后取消服务，则此次服务被视为“放空”，车主将承担相应费用。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">&nbsp;情况描述 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 计费方式</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">1.取消 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p style="white-space: normal;">服务商派遣后1 0分钟之内车主取消 &nbsp;无需付费</p><p style="white-space: normal;">服务</p><p style="white-space: normal;">服务商派遣后1 0分钟之后车主取消 &nbsp;50%案件费（对应各案件费用）</p><p style="white-space: normal;">服务</p><p style="white-space: normal;">&nbsp; &nbsp;&nbsp;</p><p style="white-space: normal;">2.服务商到达事故地点后车主已经 &nbsp;100%案件费（对应备案件费用）</p><p style="white-space: normal;">离开并且没有事先通知的情况下 &nbsp; &nbsp;</p><p style="white-space: normal;">（需要与车主确认） &nbsp;</p><p style="white-space: normal;">&nbsp;&nbsp;</p><p style="white-space: normal;">3.道路救援中心对所需救援服务判 &nbsp;只需支付派送正确（第二次）服务费用</p><p style="white-space: normal;">断错误或者派遣错误的服务商后再 &nbsp;</p><p style="white-space: normal;">次派遣服务商解决问题</p><p style="white-space: normal;">&nbsp; &nbsp;</p><p style="white-space: normal;">4.车主没有按照建议来确定车辆的 &nbsp; 车主承担第二次服务费用</p><p style="white-space: normal;">问题造成的第二次服务</p><p style="white-space: normal;">（如燃油、电池等）</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">五、免责条款</p><p style="white-space: normal;">车主需严格遵守《中华人民共和国道路交通安全法》、《中华人民共和国道路交通安全法实施条例》及其他适用的中国大陆地区的法律法规。如车主存在以下任一情况或因违法而造成的需要救援服务，车主的服务需求将不被璞胜车务道路救援中心受</p><p style="white-space: normal;">理：</p><p style="white-space: normal;">1.当车主车辆的驾驶人员处于下列任一情况者：</p><p style="white-space: normal;">1)处于醉酒状态中。如果车主车辆的驾驶人员的血液中的酒精含量超过交通法、机动车行驶法、道路安全法或者《中华人民共和国道路交通安全法》、《中华人民共和国道路交通安全法实施条例》的相关规定的，则视为醉酒。</p><p style="white-space: normal;">a)当车主车辆驾驶人员处于毒品、毒物、非处方的麻醉剂的影响下。</p><p style="white-space: normal;">b)不具车主车辆类别应有的驾驶证或相应证件，或驾驶证等证件因违规而被吊销或吊扣的。</p><p style="white-space: normal;">c)当车主非法使用车辆的，如：违犯交通规则、超过12个月未对车辆进行规定的保养、未按照汽车厂商用户手册中的规定正确使用车辆（例如未更换故障电池或未进行必要维修等）。</p><p style="white-space: normal;">2.车主或车主委托的驾驶人员因超员、运载物品或动物的重量超重、乘载或安排方式不合理而违规，导致事故或损失。</p><p style="white-space: normal;">3.当车主车辆不具备应有的文件或证明（包括技术检验及强制性保险）或不符合法定的、受益人车辆运行公共道路交通的要求的。</p><p style="white-space: normal;">4.当车主车辆运载碳氢燃料、易燃易爆或有毒矿物质或其它物料造成损失的。</p><p style="white-space: normal;">5.有空调系统引起的或与空调系统有关的任何车身损坏，且并未致使车辆不能行使的。</p><p style="white-space: normal;">6.当车主车辆作为救护车运载伤员或作为灵车运载死者的。</p><p style="white-space: normal;">7.当车主车辆所承载的行李未做良好包装或承载了易碎易腐物品的。</p><p style="white-space: normal;">8.当车主车辆参加赛车比赛、体育运动、试车、训练或任何具有明显危险性的体育或娱乐等活动。</p><p style="white-space: normal;">9.当车主车辆发生交通事故时，璞胜车务道路救援中心对交通法规规定的车主车辆保险赔付范围内的项目不承担责任。</p><p style="white-space: normal;">10.服务仅限于重量在3500千克以内的车辆。</p><p style="white-space: normal;">11.公共交通工具（出租车、公交车）、以经营为目的使用的摩托车、乘用车、公交车、出租车、货车、卡车、重型车、及所有公共、出租及营运为目的的车辆均不在服务对象之列。</p><p style="white-space: normal;">12.由非专业维修机构的错误维修所造成的车辆故障。</p><p style="white-space: normal;">13.非原装或未被车辆制造商允许的配件造成的车辆故障。</p><p style="white-space: normal;">14.任何拖车车辆均不在服务对象之列。</p><p style="white-space: normal;">15.因罢工，战争，敌国入侵，武装冲突（不论是否正式宣战），内战，内乱，叛乱，恐怖行动，政变，暴动，群众骚动，政治或行政干预直接或间接造成的损失或破坏。</p><p style="white-space: normal;">16.所有援助提供方认为有危险的服务请求。</p><p style="white-space: normal;">17.受益人自身造成的或为获得服务的故意行为，在检测车辆问题的救援服务发生之后仍然无法对车辆进行维修，或其他一切恶意使用道路救援服务的行为。</p><p style="white-space: normal;">六、协议争议</p><p style="white-space: normal;">本协议之效力、解释、变更、执行与争议解决均适用中华人民共和国法律。如缔约方就本协议内容或其执行发生任何争议，双方应尽力友好协商解决：协商不成时，任何一方均可向有管辖权的中华人民共和国大陆地区法院提起诉讼。璞胜车务保留对协议的最终解释权与修改权。</p>'),
(110, '<p style="white-space: normal;">本协议是使用璞胜车务的车主（以下简称车主）和璞胜车务就加油卡充值等相关事宜所订立的油卡充值服务协议，请您仔细阅读本协议，您勾选“已阅读并同意”复选框后，本协议即构成对双方有约束力的法律文件。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">一、协议声明</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">1、璞胜车务通过互联网依法为用户提供油卡充值、订单查询等服务，用户在完全同意本协议及璞胜车务规定的情况下，方有权使用璞胜车务的油卡充值服务。</p><p style="white-space: normal;">2、您勾选充值页面下“已阅读充值协议并同意”复选框后，即视为您已阅读、了解并完全同意本协议的各项内容，并具有独立承担法律责任的能力。</p><p style="white-space: normal;">3、璞胜车务在必要时可修改本协议，并在璞胜车务软件上进行公告，即公告之日起生效。如您继续使用油卡充值服务，则视为您已接受修订的充值协议。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">二、服务说明</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">1、璞胜车务通过互联网依法为用户提供油卡充值、订单查询等服务，用户在完全同意本协议及璞胜车务规定的情况下，方有权使用璞胜车务的油卡充值服务。</p><p style="white-space: normal;">2、璞胜车务油卡充值服务仅支持中国石油发行的个人记名卡主卡和车队卡主卡、中国石化多用户卡中的主卡和单用户卡。</p><p style="white-space: normal;">3、中石化油卡不支持增值税发票类型的单位卡、副卡、不记名卡的充值。</p><p style="white-space: normal;">4、中石油昆仑卡不支持副卡、司机卡、失效卡、不记名卡、过期卡的充值。</p><p style="white-space: normal;">5、车主需完成璞胜车务注册，即可启用油卡充值服务。</p><p style="white-space: normal;">6、充值完成后请您携加油卡到中国石油、中国石化任意发卡充值网点，将油卡充值资金圈存到加油卡中，即可使用充值资金。</p><p style="white-space: normal;">7、油卡充值发票需到开户地任意发卡充值网点领取，具体以网店咨询为主。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">三、免责条款</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">璞胜车务不承担任何责任，包括但不仅限于：</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">1、因不可抗力、系统故障、通讯故障、网络拥堵、供电系统故障、恶意攻击等造成璞胜车务未能及时、准确、完整地提供油卡充值服务。</p><p style="white-space: normal;">2、如用户利用系统差错、故障或其他原因导致的漏洞，损害璞胜车务的权益，璞胜车务将中止为该用户提供油卡充值服务，并保留法律追究的权利。</p><p style="white-space: normal;">3、璞胜车务负责对璞胜车务上的信息进行审核与更新，但并不就信息的时效性、准确性以及服务功能的完整性和可靠性承担任何义务和赔偿责任。</p><p style="white-space: normal;">4、如果璞胜车务发现有影响用户信息安全的行为，璞胜车务有权采取对用户信息实施保护的措施。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">璞胜车务对以下情形不做任何承诺，包括但不仅限于：</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">1、服务一定能符合您的要求：服务不会受中断：服务的安全性、及时性、完整性和准确性。</p><p style="white-space: normal;">2、车主应妥善保管账户、密码等信息资料，非因璞胜车务原因造成您的用户信息泄露，由此给您带来的损失璞胜车务不承担任何责任。</p><p style="white-space: normal;">3、您在使用璞胜车务服务时，因个人原因产生的损失，璞胜车务不承担任何责任。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">四、协议争议</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">本协议之效力、解释、变更、执行与争议解决均适用中华人民共和国法律。如缔约方就本协议内容或其执行发生任何争议，双方应尽力友好协商解决；协商不成时，任何一方均可向有管辖权的中华人民共和国大陆地区法院提起诉讼。璞胜车务保留对协议的最终解释权与修改权。</p>'),
(111, '<p>自实行新车六年免检政策以来，很多司机认为六年内不用验车了。 其实是错误的! <span style="margin: 0px; padding: 0px; color: rgb(255, 0, 0); -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">绝对不是</strong></span><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; color: rgb(255, 0, 0); -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">六年只年检1次！</span></strong><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p>　　近期在全国已经发生多起机动车因为年审过期导致出了事故之后，保险公司不予理赔的情况。很多都是好几万的大单。 而这些车辆都有一个特点，就是误以为6年内不用年检！</p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p>　　六年免检实质是在规定期限内，符合条件的车辆不用去检测场上线检测了（这种年度检测，我们称作<span style="margin: 0px; padding: 0px; color: rgb(255, 0, 0); -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">“年检”</strong></span>，但必须在规定的年检月份内去车管所领取年检标。这种年度审验，我们称作<strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; color: rgb(255, 0, 0); -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">“年审”</span></strong>（年审月份就是你当初买车的那个月份，之前没有免检政策，统一称作“年检”。）</p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p>　　不论是否上检测线，你都要去车管所进行年审，所以，提醒各位司机朋友：</p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">　　</strong>如果行驶本上的登记日期是2010年9月1日之后的，你就踏踏实实的在2年一次的年检的月份里，去车管所进行<span style="margin: 0px; padding: 0px; color: rgb(255, 0, 0); -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">年审，</span>领取新的“年检合格标”。如果你应该上线检测，现场就会告诉你。 如果你不用上线，现场就会让你填个单子然后给你新的年检标了。（2010年8月31日之前的，到期全部上检测线，不属于免检范围）。</p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p>去的时候带上：</p><p>1、《机动车检验标志申请表》（这个不用带，现场提供，直接填写）；</p><p>2、机动车行驶证；</p><p>3、交强险保险凭证；</p><p>4、车船税纳税或者免税证明（一般和交强险一起买的，在交强险保单里能找到这项，找不到的问一下保险公司，有些地区会分开交）；</p><p>5、车主身份证。如他人代办的，代办人需携带自己的身份证。</p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p>　　请大家务必记住，<span style="margin: 0px; padding: 0px; color: rgb(255, 0, 0); -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">“6年免检”</span>是指<span style="margin: 0px; padding: 0px; color: rgb(255, 0, 0); -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">符合条件</span>的车辆，免上检测线了，但是绝对不是什么都不用做了，还是需要<span style="margin: 0px; padding: 0px; color: rgb(255, 0, 0); -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">每2年去车管所</span>填个表格领取新的年检标志（即“年审”）。 否则逾期会被视为“未按规定年检”车辆。 <span style="margin: 0px; padding: 0px; color: rgb(255, 0, 0); -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">每延误一个月，扣3分，罚款200（路上摄像头自动记录），每月拍照记录一次。</span></p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p>　　同时，<span style="margin: 0px; padding: 0px; color: rgb(255, 0, 0); -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">如</span><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; color: rgb(255, 0, 0); -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">未年审</span></strong><span style="margin: 0px; padding: 0px; color: rgb(255, 0, 0); -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">车辆发生交通事故，保险公司可以拒赔。</span> 譬如开头所说的，最近已经发生很多起万元大单拒赔案例了。大家一定不要忘记到期进行“<span style="margin: 0px; padding: 0px; color: rgb(255, 0, 0); -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">年审</strong></span>”！</p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p>　　注：反正是不是属于免检车辆，都要去车管所进行年审。所以，小编就不在这里详细解释哪年的车该上检测线，哪年的车仅仅需要年审就可以了。您就踏踏实实的，到月份就去车管所办理年审，准保不会出问题！（“月份”即您驾驶本上注册登记日期里的月份）</p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p>　　这个事情很重要，望大家尽量转给身边的司机朋友们， 否则一旦在“未年审”状态出现事故，保险公司真的是一分钱不掏的！</p>'),
(112, '<p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: 宋体; font-size: 14px; background: rgb(255, 255, 255);"></span></p><p style="text-indent:28px"><span style=";font-family:宋体;font-size:14px"></span></p><p style="text-indent:28px"><span style=";font-family:宋体;font-size:14px">唐山凯丰华鼎投资咨询有限责任公司成立于<span style="font-family:Times New Roman">2011</span><span style="font-family:宋体">年</span><span style="font-family:Times New Roman">5</span><span style="font-family:宋体">月，</span></span><span style=";font-family:宋体;font-size:14px">位于河北省唐山市，隶属于</span><span style=";font-family:宋体;font-size:14px">郑州璞胜金投电子商务有限公司</span><span style=";font-family:宋体;font-size:14px">（已在前海股权交易所挂牌）</span><span style=";font-family:宋体;font-size:14px">。</span><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">在中国率先推出<span style="font-family:Times New Roman">&quot;</span><span style="font-family:宋体">个人对个人（</span><span style="font-family:Times New Roman">&quot;Peer&nbsp;to&nbsp;Peer&quot;</span><span style="font-family:宋体">或称</span><span style="font-family:Times New Roman">&quot;P2P&quot;</span><span style="font-family:宋体">）的《互联网借贷平台》及《共通积分（便利）兑换商城》、《供销商城》等创新型电子商务交易（</span><span style="font-family:Times New Roman">B2B</span><span style="font-family:宋体">、</span><span style="font-family:Times New Roman">B2C</span><span style="font-family:宋体">、</span><span style="font-family:Times New Roman">C2C</span><span style="font-family:宋体">、</span><span style="font-family:Times New Roman">C2B</span><span style="font-family:宋体">、</span><span style="font-family:Times New Roman">O2O</span><span style="font-family:宋体">）商业模式优势于一体的综合服务平台。平台项目在国内处于领先地位，独一无二，无可替代。</span></span></p><p style="text-indent:28px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)"><span style="font-family:宋体"><br/></span></span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-weight: bold; font-size: 14px; background: rgb(255, 255, 255);">集团文化——<span style="font-family: 宋体;">礼&nbsp;义&nbsp;廉&nbsp;耻</span>&nbsp;</span><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">&nbsp;</span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-family: 宋体;">礼是规规矩矩的态度，礼是严严整整的纪律，</span></span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-family: 宋体;">义是正正当当的行为，义是慷慷慨慨的牺牲，</span></span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-family: 宋体;">廉是清清楚楚的辨别，廉是实实在在的节约，</span></span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-family: 宋体;">耻是切切实实的觉悟，耻是轰轰烈烈的奋斗。</span></span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">三年战略&nbsp;： &nbsp; 忘掉过去、调整心态、</span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-family: 宋体;">确定模式、寻找天才</span></span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-family: 宋体;">本土化、同城化、行业化、品牌化</span></span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-family: 宋体;">科技高地、人才高地</span></span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-family: 宋体;">技术高地、产业高地</span></span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">目标：诚信和创新，提高企业核心竞争力，引领企业成为行业领头人！</span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">利益：严格按照以股东、员工、客户、家属、社会的利益序列，利益分配，发展运营。</span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">流程：内部物流化，外部连锁化</span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">管理：标准化、流程化、简单化、系统化</span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">集团模式：集资本运营导向模式和产业运作模式的结合，建设以服务实体经济为基础，资本运营为纽带的双核模式</span></p><p style="white-space: normal;"><img src="http://www.vcivc.cn/data/upload/ueditor/image/8/201506/1435024864520970.jpg" title="1435024864520970.jpg"/></p><p style="white-space: normal;"><img src="http://www.vcivc.cn/data/upload/ueditor/image/8/201506/1435024864419776.jpg" title="1435024864419776.jpg"/></p><p style="white-space: normal;"><img src="http://www.vcivc.cn/data/upload/ueditor/image/8/201506/1435024865952843.jpg" title="1435024865952843.jpg"/></p><p style="white-space: normal;"><br/></p><p style="white-space: normal;"><img src="http://www.vcivc.cn/data/upload/ueditor/image/8/201506/1435024866270793.jpg" title="1435024866270793.jpg"/></p><p style="white-space: normal;"><img src="http://www.vcivc.cn/data/upload/ueditor/image/8/201506/1435024865874424.jpg" title="1435024865874424.jpg"/></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-weight: bold; font-size: 14px; background: rgb(255, 255, 255);">优势与专长</span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">创业团队具有共同的事业价值观，集智商、情商、财商为一身，优势互补的经营、管理、执行团队。</span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">战略规划方向正确、目标定位准确，高瞻远瞩，放眼未来。</span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">团队具有自我创新意识，对市场经济有正确的洞察力和判断力。</span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">商业模式科学、先进，竞争优势突出，盈利模式多元化，风险控制能力强。</span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">灵活机动的战略战术，资源整合合作能力强。</span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">&quot;<span style="font-family: 宋体;">无需抵押担保、仅仅凭借个人征信评级、信用管理等服务模式</span>&quot;,<span style="font-family: 宋体;">成为目前小额民间借贷市场最大的竞争优势。</span>&quot;<span style="font-family: 宋体;">银行不好贷款</span>,<span style="font-family: 宋体;">即便贷到款</span>,<span style="font-family: 宋体;">审批程序也极其复杂和漫长</span>,<span style="font-family: 宋体;">货币紧缩后</span>,<span style="font-family: 宋体;">低端小额贷款更是难上加难。</span>&quot;</span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">在P2P<span style="font-family: 宋体;">的个人信贷理财模式里</span>,<span style="font-family: 宋体;">所有的借款都是信用借款</span>,<span style="font-family: 宋体;">不需要实物抵押。由于不吸储也不放贷</span>,<span style="font-family: 宋体;">而是将有理财需求的出借人和有资金需求的借款人</span>&quot;<span style="font-family: 宋体;">配对</span>&quot;,<span style="font-family: 宋体;">提供一个自然人之间的借贷交流平台</span>,<span style="font-family: 宋体;">以之后向借款人收取服务费作为收入来源之一。</span></span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background-color: rgb(255, 255, 255);">P2P</span><span style="font-size: 14px; font-family: 宋体;">的信贷模式从长远看</span><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px;">,</span><span style="font-size: 14px; font-family: 宋体;">还会不断吸引新的机构进来</span><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px;">,</span><span style="font-size: 14px; font-family: 宋体;">随着这些成熟机构的进一步创新</span><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px;">,</span><span style="font-size: 14px; font-family: 宋体;">还将演变成信托机构</span><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px;">,</span><span style="font-size: 14px; font-family: 宋体;">架起城乡信用融资的桥梁。</span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-weight: bold; font-size: 14px; background: rgb(255, 255, 255);">行业与发展</span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">所属行业：&nbsp;资本市场服务</span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">今天电子商务不是一个技术，不是一个商业模式，它是一场革命，它是一个生活方式和工作方式的变革，它只是刚刚开始。</span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">最近统计数据显示，&nbsp;2013<span style="font-family: 宋体;">年中国电子商务市场交易规模达</span>10.2<span style="font-family: 宋体;">万亿元，同比</span>2012<span style="font-family: 宋体;">年的</span>8.5<span style="font-family: 宋体;">万亿元，增长</span>29.9%<span style="font-family: 宋体;">。</span>2014<span style="font-family: 宋体;">年一季度限额以上单位网上零售额</span>815<span style="font-family: 宋体;">亿元，增长</span>51.7%<span style="font-family: 宋体;">。</span></span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">国内网络借贷平台已有数百家，国外有26<span style="font-family: 宋体;">家。国内主要分布在长三角、珠三角及北京、天津等发达地区。借贷平台客户多达数百万之众，年交易额实现数百亿人民币，单日交易额实现数亿人民币。《温州金融改革实验区》确定了金融服务平台的合法地位。互联网借贷平台的发展趋势日益形成。</span></span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">网络借贷指在网上实现借贷，借入者和借出者均可利用这个网络平台，实现借贷的&quot;<span style="font-family: 宋体;">在线交易</span>&quot;<span style="font-family: 宋体;">。</span></span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">2012<span style="font-family: 宋体;">年</span>P2P<span style="font-family: 宋体;">网贷入选</span>&quot;2012<span style="font-family: 宋体;">年中国年度创新成长企业</span>100<span style="font-family: 宋体;">强</span>&quot;<span style="font-family: 宋体;">中唯一入选的金融信息服务企业。</span></span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">长时段来看，互联网金融才大潮初起，难免泥沙俱下，但潮涨潮落，不改一浪高过一浪的发展趋势。当前的鱼龙杂混、良莠不齐的情况一定不会长期持续下去。P2P<span style="font-family: 宋体;">健康发展的前提可能是要经历一些风雨，淘汰一批经营不善的网贷公司，甚至要打击掉一批借着</span>P2P<span style="font-family: 宋体;">平台进行违法犯罪活动的团伙。</span></span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">我们相信，经过洗牌之后，一些巨型的、有实力的网贷公司或许将兼并一些中小型网贷公司，并且专注做平台的P2P<span style="font-family: 宋体;">公司将引进和培育一批金融服务机构。</span></span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-weight: bold; font-size: 14px; background: rgb(255, 255, 255);">产品服务</span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background: rgb(255, 255, 255);">主营业务：自主研发电子商务交易平台、P2P<span style="font-family: 宋体;">借贷平台系统，为创业者和传统企业提供全方位、多选项的电子商务解决方案。在中国率先推出</span>&quot;<span style="font-family: 宋体;">个人对个人（</span>&quot;Peer&nbsp;to&nbsp;Peer&quot;<span style="font-family: 宋体;">或称</span>&quot;P2P&quot;<span style="font-family: 宋体;">）的《信用借贷平台》及《共通积分（便利）兑换商城》、《供销商城》等创新型电子商务交易（</span>B2B<span style="font-family: 宋体;">、</span>B2C<span style="font-family: 宋体;">、</span>C2C<span style="font-family: 宋体;">、</span>C2B<span style="font-family: 宋体;">、</span>O2O<span style="font-family: 宋体;">）商业模式优势于一体的综合服务平台。</span></span></p><p style="margin-top: 12px; margin-bottom: 30px; white-space: normal; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background-color: rgb(255, 255, 255);">主要产品与服务：可定制型《</span><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px;">P2P</span><span style="font-size: 14px; font-family: 宋体;">借贷平台系统》；电子商务交易平台系统《共通积分（便利）兑换商城》、《供销商城》。</span></p>'),
(113, '<p style="white-space: normal;">手机客户端</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">1.通过用手机扫描此二维码，获得手机客户端下载地址。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">（安卓手机用户客户端下载，请用浏览器扫描下面二维码）&nbsp;</p><p style="white-space: normal;">&nbsp;<img src="/data/upload/ueditor/image/8/201506/1434681754580575.png" title="1434681754580575.png" alt="cli_300px.png" width="264" height="269" style="width: 264px; height: 269px;"/></p><p style="white-space: normal;">（苹果手机越狱用户客户端下载，非越狱手机无法安装，请用浏览器扫描下面二维码）</p><p style="white-space: normal;"><img src="/data/upload/ueditor/image/8/201506/1434681773649203.png" title="1434681773649203.png" alt="唐城IPA.png" width="280" height="280" border="0" vspace="0" style="width: 280px; height: 280px;"/></p><p style="white-space: normal;">&nbsp;</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">2.在手机浏览器中输入此地址，下载商城手机客户端。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">安卓手机用户客户端下载：<a href="http://tangchengdai.vcivc.cn/data/app/che.4.apk" target="_blank" textvalue="http://tangchengdai.vcivc.cn/data/app/che.4.apk">http://tangchengdai.vcivc.cn/data/app/che.4.apk</a></p><p style="white-space: normal;">苹果手机越狱用户客户端下载：<a href="http://tangchengdai.vcivc.cn/data/app/che.4.ipa" target="_blank" textvalue="http://tangchengdai.vcivc.cn/data/app/che.4.ipa">http://tangchengdai.vcivc.cn/data/app/che.4.ipa</a></p><p style="white-space: normal;"><br/></p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">3.如果您的手机不支持直接下载，那么您可以点击（苹果手机用户客户端下载）或（安卓手机用户客户端下载），先将手机客户端下载到您的电脑中，然后再用数据线或读卡器传输到您的手机中。</p><p><br/></p>');
INSERT INTO `plf_article_data` (`id`, `content`) VALUES
(114, '<p style="white-space: normal; text-indent: 28px; text-align: justify;"><span style="font-family: 宋体; font-size: 14px;"></span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:宋体;font-size:14px;background:rgb(255,255,255)">河北萍聚电子商务有限公司位于河北省邯郸市经济开发区，注册资金</span><span style=";font-family:宋体;font-size:14px;background:rgb(255,255,255)">500<span style="font-family:宋体">万。是一家集电子商务、新一代技术服务为一体的高新技术服务企业。</span></span><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">在中国率先推出<span style="font-family:Times New Roman">&quot;</span><span style="font-family:宋体">个人对个人（</span><span style="font-family:Times New Roman">&quot;Peer&nbsp;to&nbsp;Peer&quot;</span><span style="font-family:宋体">或称</span><span style="font-family:Times New Roman">&quot;P2P&quot;</span><span style="font-family:宋体">）的《互联网借贷平台》及《共通积分（便利）兑换商城》、《供销商城》等创新型电子商务交易（</span><span style="font-family:Times New Roman">B2B</span><span style="font-family:宋体">、</span><span style="font-family:Times New Roman">B2C</span><span style="font-family:宋体">、</span><span style="font-family:Times New Roman">C2C</span><span style="font-family:宋体">、</span><span style="font-family:Times New Roman">C2B</span><span style="font-family:宋体">、</span><span style="font-family:Times New Roman">O2O</span><span style="font-family:宋体">）商业模式优势于一体的综合服务平台。平台项目在国内处于领先地位，独一无二，无可替代。</span></span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-weight:bold;font-size:14px;background:rgb(255,255,255)">集团文化<span style="font-family:Times New Roman">——</span><span style="font-family:宋体">礼&nbsp;义&nbsp;廉&nbsp;耻</span><span style="font-family:Times New Roman">&nbsp;</span></span><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">&nbsp;</span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-family:宋体">礼是规规矩矩的态度，礼是严严整整的纪律，</span></span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-family:宋体">义是正正当当的行为，义是慷慷慨慨的牺牲，</span></span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-family:宋体">廉是清清楚楚的辨别，廉是实实在在的节约，</span></span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-family:宋体">耻是切切实实的觉悟，耻是轰轰烈烈的奋斗。</span></span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">三年战略&nbsp;： &nbsp; 忘掉过去、调整心态、</span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-family:宋体">确定模式、寻找天才</span></span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-family:宋体">本土化、同城化、行业化、品牌化</span></span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-family:宋体">科技高地、人才高地</span></span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-family:宋体">技术高地、产业高地</span></span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">目标：诚信和创新，提高企业核心竞争力，引领企业成为行业领头人！</span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">利益：严格按照以股东、员工、客户、家属、社会的利益序列，利益分配，发展运营。</span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">流程：内部物流化，外部连锁化</span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">管理：标准化、流程化、简单化、系统化</span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">集团模式：集资本运营导向模式和产业运作模式的结合，建设以服务实体经济为基础，资本运营为纽带的双核模式</span></p><p><img src="/data/upload/ueditor/image/8/201506/1435024864520970.jpg" style="" title="1435024864520970.jpg"/></p><p><img src="/data/upload/ueditor/image/8/201506/1435024864419776.jpg" style="" title="1435024864419776.jpg"/></p><p><img src="/data/upload/ueditor/image/8/201506/1435024865952843.jpg" style="" title="1435024865952843.jpg"/></p><p><br/></p><p><img src="/data/upload/ueditor/image/8/201506/1435024866270793.jpg" style="" title="1435024866270793.jpg"/></p><p><img src="http://www.vcivc.cn/data/upload/ueditor/image/8/201506/1435024865874424.jpg" title="1435024865874424.jpg" style="white-space: normal;"/></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-weight:bold;font-size:14px;background:rgb(255,255,255)">优势与专长</span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">创业团队具有共同的事业价值观，集智商、情商、财商为一身，优势互补的经营、管理、执行团队。</span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">战略规划方向正确、目标定位准确，高瞻远瞩，放眼未来。</span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">团队具有自我创新意识，对市场经济有正确的洞察力和判断力。</span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">商业模式科学、先进，竞争优势突出，盈利模式多元化，风险控制能力强。</span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">灵活机动的战略战术，资源整合合作能力强。</span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">&quot;<span style="font-family:宋体">无需抵押担保、仅仅凭借个人征信评级、信用管理等服务模式</span><span style="font-family:Times New Roman">&quot;,</span><span style="font-family:宋体">成为目前小额民间借贷市场最大的竞争优势。</span><span style="font-family:Times New Roman">&quot;</span><span style="font-family:宋体">银行不好贷款</span><span style="font-family:Times New Roman">,</span><span style="font-family:宋体">即便贷到款</span><span style="font-family:Times New Roman">,</span><span style="font-family:宋体">审批程序也极其复杂和漫长</span><span style="font-family:Times New Roman">,</span><span style="font-family:宋体">货币紧缩后</span><span style="font-family:Times New Roman">,</span><span style="font-family:宋体">低端小额贷款更是难上加难。</span><span style="font-family:Times New Roman">&quot;</span></span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">在<span style="font-family:Times New Roman">P2P</span><span style="font-family:宋体">的个人信贷理财模式里</span><span style="font-family:Times New Roman">,</span><span style="font-family:宋体">所有的借款都是信用借款</span><span style="font-family:Times New Roman">,</span><span style="font-family:宋体">不需要实物抵押。由于不吸储也不放贷</span><span style="font-family:Times New Roman">,</span><span style="font-family:宋体">而是将有理财需求的出借人和有资金需求的借款人</span><span style="font-family:Times New Roman">&quot;</span><span style="font-family:宋体">配对</span><span style="font-family:Times New Roman">&quot;,</span><span style="font-family:宋体">提供一个自然人之间的借贷交流平台</span><span style="font-family:Times New Roman">,</span><span style="font-family:宋体">以之后向借款人收取服务费作为收入来源之一。</span></span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background-color: rgb(255, 255, 255);">P2P</span><span style="font-size: 14px; font-family: 宋体;">的信贷模式从长远看</span><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px;">,</span><span style="font-size: 14px; font-family: 宋体;">还会不断吸引新的机构进来</span><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px;">,</span><span style="font-size: 14px; font-family: 宋体;">随着这些成熟机构的进一步创新</span><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px;">,</span><span style="font-size: 14px; font-family: 宋体;">还将演变成信托机构</span><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px;">,</span><span style="font-size: 14px; font-family: 宋体;">架起城乡信用融资的桥梁。</span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-weight:bold;font-size:14px;background:rgb(255,255,255)">行业与发展</span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">所属行业：&nbsp;资本市场服务</span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">今天电子商务不是一个技术，不是一个商业模式，它是一场革命，它是一个生活方式和工作方式的变革，它只是刚刚开始。</span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">最近统计数据显示，&nbsp;<span style="font-family:Times New Roman">2013</span><span style="font-family:宋体">年中国电子商务市场交易规模达</span><span style="font-family:Times New Roman">10.2</span><span style="font-family:宋体">万亿元，同比</span><span style="font-family:Times New Roman">2012</span><span style="font-family:宋体">年的</span><span style="font-family:Times New Roman">8.5</span><span style="font-family:宋体">万亿元，增长</span><span style="font-family:Times New Roman">29.9%</span><span style="font-family:宋体">。</span><span style="font-family:Times New Roman">2014</span><span style="font-family:宋体">年一季度限额以上单位网上零售额</span><span style="font-family:Times New Roman">815</span><span style="font-family:宋体">亿元，增长</span><span style="font-family:Times New Roman">51.7%</span><span style="font-family:宋体">。</span></span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">国内网络借贷平台已有数百家，国外有<span style="font-family:Times New Roman">26</span><span style="font-family:宋体">家。国内主要分布在长三角、珠三角及北京、天津等发达地区。借贷平台客户多达数百万之众，年交易额实现数百亿人民币，单日交易额实现数亿人民币。《温州金融改革实验区》确定了金融服务平台的合法地位。互联网借贷平台的发展趋势日益形成。</span></span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">网络借贷指在网上实现借贷，借入者和借出者均可利用这个网络平台，实现借贷的<span style="font-family:Times New Roman">&quot;</span><span style="font-family:宋体">在线交易</span><span style="font-family:Times New Roman">&quot;</span><span style="font-family:宋体">。</span></span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">2012<span style="font-family:宋体">年</span><span style="font-family:Times New Roman">P2P</span><span style="font-family:宋体">网贷入选</span><span style="font-family:Times New Roman">&quot;2012</span><span style="font-family:宋体">年中国年度创新成长企业</span><span style="font-family:Times New Roman">100</span><span style="font-family:宋体">强</span><span style="font-family:Times New Roman">&quot;</span><span style="font-family:宋体">中唯一入选的金融信息服务企业。</span></span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">长时段来看，互联网金融才大潮初起，难免泥沙俱下，但潮涨潮落，不改一浪高过一浪的发展趋势。当前的鱼龙杂混、良莠不齐的情况一定不会长期持续下去。<span style="font-family:Times New Roman">P2P</span><span style="font-family:宋体">健康发展的前提可能是要经历一些风雨，淘汰一批经营不善的网贷公司，甚至要打击掉一批借着</span><span style="font-family:Times New Roman">P2P</span><span style="font-family:宋体">平台进行违法犯罪活动的团伙。</span></span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">我们相信，经过洗牌之后，一些巨型的、有实力的网贷公司或许将兼并一些中小型网贷公司，并且专注做平台的<span style="font-family:Times New Roman">P2P</span><span style="font-family:宋体">公司将引进和培育一批金融服务机构。</span></span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-weight:bold;font-size:14px;background:rgb(255,255,255)">产品服务</span></p><p style="margin-top:12px;margin-right:0;margin-bottom:30px;margin-left:0;text-indent:28px;line-height:21px"><span style=";font-family:&#39;Times New Roman&#39;;font-size:14px;background:rgb(255,255,255)">主营业务：自主研发电子商务交易平台、<span style="font-family:Times New Roman">P2P</span><span style="font-family:宋体">借贷平台系统，为创业者和传统企业提供全方位、多选项的电子商务解决方案。在中国率先推出</span><span style="font-family:Times New Roman">&quot;</span><span style="font-family:宋体">个人对个人（</span><span style="font-family:Times New Roman">&quot;Peer&nbsp;to&nbsp;Peer&quot;</span><span style="font-family:宋体">或称</span><span style="font-family:Times New Roman">&quot;P2P&quot;</span><span style="font-family:宋体">）的《信用借贷平台》及《共通积分（便利）兑换商城》、《供销商城》等创新型电子商务交易（</span><span style="font-family:Times New Roman">B2B</span><span style="font-family:宋体">、</span><span style="font-family:Times New Roman">B2C</span><span style="font-family:宋体">、</span><span style="font-family:Times New Roman">C2C</span><span style="font-family:宋体">、</span><span style="font-family:Times New Roman">C2B</span><span style="font-family:宋体">、</span><span style="font-family:Times New Roman">O2O</span><span style="font-family:宋体">）商业模式优势于一体的综合服务平台。</span></span></p><p style="margin: 12px 0px 30px; text-indent: 28px; line-height: 21px;"><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px; background-color: rgb(255, 255, 255);">主要产品与服务：可定制型《</span><span style="font-family: &#39;Times New Roman&#39;; font-size: 14px;">P2P</span><span style="font-size: 14px; font-family: 宋体;">借贷平台系统》；电子商务交易平台系统《共通积分（便利）兑换商城》、《供销商城》。</span></p>'),
(115, '<p style="white-space: normal;">手机客户端</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">1.通过用手机扫描此二维码，获得手机客户端下载地址。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">（安卓手机用户客户端下载，请用浏览器扫描下面二维码）&nbsp;</p><p style="white-space: normal;">&nbsp;<img src="/data/upload/ueditor/image/8/201506/1434681958929813.png" title="1434681958929813.png" alt="cli_300px.png" width="264" height="269" style="width: 264px; height: 269px;"/></p><p style="white-space: normal;">（苹果手机越狱用户客户端下载，非越狱手机无法安装，请用浏览器扫描下面二维码）</p><p style="white-space: normal;"><img src="/data/upload/ueditor/image/8/201506/1434681974878424.png" title="1434681974878424.png" alt="冀商IPA.png" width="280" height="280" border="0" vspace="0" style="width: 280px; height: 280px;"/></p><p style="white-space: normal;">&nbsp;</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">2.在手机浏览器中输入此地址，下载商城手机客户端。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">安卓手机用户客户端下载：<a href="http://jishangdai.vcivc.cn/data/app/che.3.apk" target="_blank" textvalue="http://jishangdai.vcivc.cn/data/app/che.3.apk">http://jishangdai.vcivc.cn/data/app/che.3.apk</a></p><p style="white-space: normal;">苹果手机越狱用户客户端下载：<a href="http://jishangdai.vcivc.cn/data/app/che.3.ipa" target="_blank" textvalue="http://jishangdai.vcivc.cn/data/app/che.3.ipa">http://jishangdai.vcivc.cn/data/app/che.3.ipa</a></p><p style="white-space: normal;"><br/></p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">3.如果您的手机不支持直接下载，那么您可以点击（苹果手机用户客户端下载）或（安卓手机用户客户端下载），先将手机客户端下载到您的电脑中，然后再用数据线或读卡器传输到您的手机中。</p><p><br/></p>'),
(116, '<p>按照规定C1驾照可以驾驶小型汽车，包含<span style="font: inherit; margin: 0px; padding: 0px; border: 0px currentColor; border-image: none; vertical-align: baseline; font-size-adjust: inherit; font-stretch: inherit;">小型/微型载客汽车以及轻型/微型载货汽车、轻/小/微型专项作业车以及C2、C3、C4驾照允许驾驶的车型</span>。但是C1驾驶证究竟能开几座车？如果你的家里有一辆皮卡，而你只有C1驾照，究竟能不能开？</p><p><img style="font: inherit; margin: 0px auto; padding: 0px; border-radius: 4px; border: 0px currentColor; border-image: none; width: auto !important; height: auto !important; vertical-align: baseline; display: block; visibility: visible !important; font-size-adjust: inherit; font-stretch: inherit;" src="http://mmbiz.qpic.cn/mmbiz/JWJmeRMwfQriaqc9ImbcU4Ds0H5c5t1diavk1FtGXSLTSROhScqMIs03BPqNRCZ7Nw9PrvPVQ36pnLrIIzgRH80Q/640?wx_fmt=jpeg&wxfrom=5" img_width="640" img_height="450" data-type="jpeg" data-ratio="0.702755905511811" data-w="" data-src="http://mmbiz.qpic.cn/mmbiz/JWJmeRMwfQriaqc9ImbcU4Ds0H5c5t1diavk1FtGXSLTSROhScqMIs03BPqNRCZ7Nw9PrvPVQ36pnLrIIzgRH80Q/0?wx_fmt=jpeg"/></p><p><span style="font: inherit; margin: 0px; padding: 0px; border: 0px currentColor; border-image: none; vertical-align: baseline; font-size-adjust: inherit; font-stretch: inherit;">C1驾驶证能开几座车？</span></p><p>C1驾照可以驾驶手动档或自动档的9座(含9座)以下的小型面包车、商务车。</p><p><span style="font: inherit; margin: 0px; padding: 0px; border: 0px currentColor; border-image: none; vertical-align: baseline; font-size-adjust: inherit; font-stretch: inherit;">C1可以开皮卡吗？</span></p><p>福特猛禽、丰田坦途，提到这些词汇，很多车迷就会心头涌动，因为那些车都是他们的DreamCar。皮卡（pickups）作为多用途车型，在很多道路情况下的适应性都大大优于SUV。</p><p>在国内，皮卡很多情况下都被作为货运车辆使用，让很多人不得不放弃了它，但诸多限制并不能阻挡对它情有独钟的消费者。因其被列入货车之列，也就造成它们日常使用时和普通家用轿车有明显区别，上牌颜色也有蓝牌和黄牌的区别。</p><p><img style="font: inherit; margin: 0px auto; padding: 0px; border-radius: 4px; border: 0px currentColor; border-image: none; width: auto !important; height: auto !important; vertical-align: baseline; display: block; visibility: visible !important; font-size-adjust: inherit; font-stretch: inherit;" src="http://mmbiz.qpic.cn/mmbiz/JWJmeRMwfQriaqc9ImbcU4Ds0H5c5t1diaFAklQRUickwM6e2IGdp5Rdo8f8TQH2HGPwgZ8TQhdIo2NZ5UAAxSNeg/640?wx_fmt=jpeg&wxfrom=5" img_width="640" img_height="425" data-type="jpeg" data-ratio="0.6633858267716536" data-w="" data-src="http://mmbiz.qpic.cn/mmbiz/JWJmeRMwfQriaqc9ImbcU4Ds0H5c5t1diaFAklQRUickwM6e2IGdp5Rdo8f8TQH2HGPwgZ8TQhdIo2NZ5UAAxSNeg/0?wx_fmt=jpeg"/></p><p>▲ 蓝牌皮卡</p><p><img style="font: inherit; margin: 0px auto; padding: 0px; border-radius: 4px; border: 0px currentColor; border-image: none; width: auto !important; height: auto !important; vertical-align: baseline; display: block; visibility: visible !important; font-size-adjust: inherit; font-stretch: inherit;" src="http://mmbiz.qpic.cn/mmbiz/JWJmeRMwfQriaqc9ImbcU4Ds0H5c5t1dia1WHyMuGM02TicgRqE5FoHIkCvAh27xfB7ibicxGHDuSa3fibFefviaB8ibiaQ/640?wx_fmt=jpeg&wxfrom=5" img_width="640" img_height="425" data-type="jpeg" data-ratio="0.6633858267716536" data-w="" data-src="http://mmbiz.qpic.cn/mmbiz/JWJmeRMwfQriaqc9ImbcU4Ds0H5c5t1dia1WHyMuGM02TicgRqE5FoHIkCvAh27xfB7ibicxGHDuSa3fibFefviaB8ibiaQ/0?wx_fmt=jpeg"/></p><p>▲ 黄牌皮卡</p><p>皮卡依据长度、重量和核定载重质量划分为蓝牌皮卡和黄牌皮卡，<span style="font: inherit; margin: 0px; padding: 0px; border: 0px currentColor; border-image: none; vertical-align: baseline; font-size-adjust: inherit; font-stretch: inherit;">C1可以驾驶蓝牌照皮卡车</span>，但是黄牌照皮卡车是不能驾驶的。<span style="font: inherit; margin: 0px; padding: 0px; border: 0px currentColor; border-image: none; vertical-align: baseline; font-size-adjust: inherit; font-stretch: inherit;">蓝牌和黄牌划分标准：</span></p><p>小型货车：总质量4500KG、核定载重质量在1500KG、车长6米。小于、等于为蓝牌；大于为黄牌</p><p>小型客车：9座以下（含9座）为蓝牌；10座（含10座）以上小客车为黄牌</p><p><img style="font: inherit; margin: 0px auto; padding: 0px; border-radius: 4px; border: 0px currentColor; border-image: none; width: auto !important; height: auto !important; vertical-align: baseline; display: block; visibility: visible !important; font-size-adjust: inherit; font-stretch: inherit;" src="http://mmbiz.qpic.cn/mmbiz/JWJmeRMwfQriaqc9ImbcU4Ds0H5c5t1diaW5rbhvMm6zMBYLxs6aaQZCvNvNicnuGlFbl6icCBJ63pcoMYW48KxWBQ/640?wx_fmt=jpeg&wxfrom=5" img_width="595" img_height="360" data-type="jpeg" data-ratio="0.6043307086614174" data-w="" data-src="http://mmbiz.qpic.cn/mmbiz/JWJmeRMwfQriaqc9ImbcU4Ds0H5c5t1diaW5rbhvMm6zMBYLxs6aaQZCvNvNicnuGlFbl6icCBJ63pcoMYW48KxWBQ/0?wx_fmt=jpeg"/></p><p>来源：网络</p>'),
(117, '<p>2015车辆保险费率表：私家车6座以下950元，6座以上为1100元。实行酒后驾驶违法行为与交强险费率联系浮动制度。新车第一年的车辆强制保险费用是全国统一的，从第二年开始，就会根据上年是否有交通安全违法行为、是否有交通事故记录进行交强险费率浮动。<br/>　　酒后驾车与交强险费率具体关系：酒后驾车一次上浮的交强险费率控制在10%至15%之间，醉酒驾车一次上浮控制在20%至30%之间，累计上浮的费率不得超过60%。联合“双挂钩”的交强险计算公式为：车辆强制保险费用=基础保费×(1+与道路交通事故相联系的浮动比率)×(1+与交通安全违法行为相联系的浮动比率)。<br/>　　交强险费用计算例如：6座以下的私家车主一年内未发生有责任交通事故，但有过1次醉酒驾车，其第二年需要缴纳的车辆强制保险费用为：950×(1-10%)×(1+30%)=1228.5元。<br/>　　目前已有北京、内蒙古、上海、福建、河南、湖北、安徽、广西、海南、四川、甘肃、青海等12个省(区、市)开始实行交强险计算“双挂钩”制度。<br/>　　车险计算器提醒车主：由于交强险是以机动车作为收取对象，也就是说，处罚是认车不认人，与以往的酒驾处理方式有很大不同。因此，借车给别人的私家车主就要小心了，哪怕违规的是真正开车的人，埋单的也只能是车主本人。<br/>　　交强险优惠费率表<br/>　　例如第一年的交强险保费是1000元<br/>　　那么第二年的交强险保费就是1000乘以0.9=900元<br/>　　第三年的交强险保费就是1000乘以0.8=800元<br/>　　第四年的交强险保费就是1000乘以0.7=700元<br/>　　注:无出险记录无过户记录方可享受交强险优惠费率表标示的优惠费率价</p><p>来源：网络</p>');
INSERT INTO `plf_article_data` (`id`, `content`) VALUES
(118, '<p>网上经常有小伙伴讲述自己的开车经历，其中提及“<strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">车语</strong>”的重要性，这里就为各位小伙伴们普及一下“<strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">车语</strong>”的知识，方便司机沟通，避免造成误会。</p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><blockquote class="wxqq-borderTopColor wxqq-borderRightColor wxqq-borderBottomColor wxqq-borderLeftColor"><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important;">以下内容来自网友反馈：</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important;">我周末去郊区玩，晚上回城的时候高速有点堵，跟在我车后面的是一辆出租车，出租师傅连闪了三下大灯，我开始很生气，心想堵车又不是我闹的，闪我干嘛。后面师傅并道过来跟我说，刹车灯不亮了，让我赶紧换新的。我这愧疚，一个劲儿的谢师傅。</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important;"><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p></blockquote><p>　　看了上面小伙伴的故事，想必大家也意识到了车语的重要性。为了广大车友们的和谐共处，今天我们一起来了解一下常见的汽车灯语的含义。</p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p><img width="auto" style="margin: 0px; padding: 0px; width: auto !important; height: auto !important; visibility: visible !important; -ms-word-wrap: break-word !important; box-sizing: border-box !important;" src="http://mmbiz.qpic.cn/mmbiz/l213TIsjia3Njt7WqWOxxE2g6Q3Mib1oYgWIbHeOh9ySHibfHDLiaQ8RicfULOEgibfPlmTJu9zaAkq6tIWziapI2eRJg/640?wx_fmt=jpeg&wxfrom=5" _width="auto" data-s="300,640" data-type="jpeg" data-ratio="0.5525" data-w="400" data-src="http://mmbiz.qpic.cn/mmbiz/l213TIsjia3Njt7WqWOxxE2g6Q3Mib1oYgWIbHeOh9ySHibfHDLiaQ8RicfULOEgibfPlmTJu9zaAkq6tIWziapI2eRJg/0?wx_fmt=jpeg"/><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><blockquote><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; color: rgb(192, 0, 0); -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">何为车语？人与人之间靠语言交流，车与车之间是需要打灯交流。不要忽略别人的善意提醒。</strong></span></p></blockquote><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p style="padding: 0px; height: 32px; text-align: justify; color: rgb(0, 187, 236); line-height: 18px; font-family: 微软雅黑; margin-top: 8px; margin-bottom: 0px; border-bottom-color: rgb(227, 227, 227); border-bottom-width: 1px; border-bottom-style: solid; white-space: normal; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span class="wxqq-borderBottomColor" style="margin: 0px; padding: 0px 2px 3px; line-height: 28px; border-bottom-color: rgb(0, 187, 236); border-bottom-width: 2px; border-bottom-style: solid; float: left; display: block; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><span class="wxqq-bg" style="margin: 0px 8px 0px 0px; padding: 4px 10px; border-radius: 80% 100% 90% 20%; color: rgb(255, 255, 255); -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important; background-color: rgb(0, 187, 236);">问题：</span></span><span class="wxqq-borderBottomColor" style="margin: 0px; padding: 0px 2px 3px; color: rgb(38, 38, 38); line-height: 28px; border-bottom-color: rgb(0, 187, 236); border-bottom-width: 2px; border-bottom-style: solid; float: left; display: block; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><strong class="wxqq-color" style="margin: 0px; padding: 0px; color: rgb(60, 117, 45); line-height: 24px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">提醒前车，绿灯已亮</strong></span></p><p style="padding: 0px; height: 32px; text-align: justify; color: rgb(0, 187, 236); line-height: 18px; font-family: 微软雅黑; margin-top: 8px; margin-bottom: 0px; white-space: normal; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px 2px 3px; line-height: 28px; float: left; display: block; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><span class="wxqq-bg" style="margin: 0px 8px 0px 0px; padding: 4px 10px; border-radius: 80% 100% 90% 20%; color: rgb(255, 255, 255); -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important; background-color: rgb(0, 187, 236);">车语：</span><strong class="wxqq-color" style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">闪一下大灯</strong></span></p><p><img width="auto" style="margin: 0px; padding: 0px; width: auto !important; height: auto !important; visibility: visible !important; -ms-word-wrap: break-word !important; box-sizing: border-box !important;" src="http://mmbiz.qpic.cn/mmbiz/l213TIsjia3Njt7WqWOxxE2g6Q3Mib1oYgyTzCh68Nypttmkwa08MvB6tq5ia8V8BmlTZmwE4vMibaKKKjzt3hDVjA/640?wx_fmt=jpeg&wxfrom=5" _width="auto" data-s="300,640" data-type="jpeg" data-ratio="0.745" data-w="400" data-src="http://mmbiz.qpic.cn/mmbiz/l213TIsjia3Njt7WqWOxxE2g6Q3Mib1oYgyTzCh68Nypttmkwa08MvB6tq5ia8V8BmlTZmwE4vMibaKKKjzt3hDVjA/0?wx_fmt=jpeg"/><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p>很多时候在路口等灯，绿灯已经亮了前车却没有启动的迹象，这时候想提醒前车该走了怎么办？闪一下大灯就可以。如果前车司机在被闪后还无反应，那就只能按喇叭啦。</p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p style="padding: 0px; height: 32px; text-align: justify; color: rgb(0, 187, 236); line-height: 18px; font-family: 微软雅黑; margin-top: 8px; margin-bottom: 0px; border-bottom-color: rgb(227, 227, 227); border-bottom-width: 1px; border-bottom-style: solid; white-space: normal; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span class="wxqq-borderBottomColor" style="margin: 0px; padding: 0px 2px 3px; line-height: 28px; border-bottom-color: rgb(0, 187, 236); border-bottom-width: 2px; border-bottom-style: solid; float: left; display: block; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><span class="wxqq-bg" style="margin: 0px 8px 0px 0px; padding: 4px 10px; border-radius: 80% 100% 90% 20%; color: rgb(255, 255, 255); -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important; background-color: rgb(0, 187, 236);">问题：</span><strong class="wxqq-color" style="margin: 0px; padding: 0px; color: rgb(60, 117, 45); line-height: 24px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">夜晚，提醒对面车辆换近光灯</strong></span></p><p style="padding: 0px; height: 32px; text-align: justify; color: rgb(0, 187, 236); line-height: 18px; font-family: 微软雅黑; margin-top: 8px; margin-bottom: 0px; white-space: normal; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px 2px 3px; line-height: 28px; float: left; display: block; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><span class="wxqq-bg" style="margin: 0px 8px 0px 0px; padding: 4px 10px; border-radius: 80% 100% 90% 20%; color: rgb(255, 255, 255); -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important; background-color: rgb(0, 187, 236);">车语：</span><strong class="wxqq-color" style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">闪两次大灯，如果无反应，则需要开双闪及减慢车速</strong></span></p><p><img width="auto" style="margin: 0px; padding: 0px; width: auto !important; height: auto !important; visibility: visible !important; -ms-word-wrap: break-word !important; box-sizing: border-box !important;" src="http://mmbiz.qpic.cn/mmbiz/l213TIsjia3Njt7WqWOxxE2g6Q3Mib1oYgmWKjvhbzCryeAiabhpAQOtF2zZwpExMWYx0icUULmRUksabK5cqIjXiaw/640?wx_fmt=jpeg&wxfrom=5" _width="auto" data-s="300,640" data-type="jpeg" data-ratio="0.7825" data-w="400" data-src="http://mmbiz.qpic.cn/mmbiz/l213TIsjia3Njt7WqWOxxE2g6Q3Mib1oYgmWKjvhbzCryeAiabhpAQOtF2zZwpExMWYx0icUULmRUksabK5cqIjXiaw/0?wx_fmt=jpeg"/><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p>晚上开车遇到开远光灯的童鞋怎么办？很简单，闪两次大灯，提醒对方你晃到我了。如果对方没有反应，那就直接开双闪，放慢车速。</p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p style="padding: 0px; height: 32px; text-align: justify; color: rgb(0, 187, 236); line-height: 18px; font-family: 微软雅黑; margin-top: 8px; margin-bottom: 0px; border-botto