; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><strong class="wxqq-color" style="margin: 0px; padding: 0px; color: rgb(60, 117, 45); line-height: 24px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">感谢前车让路</strong></span></p><p style="padding: 0px; height: 32px; text-align: justify; color: rgb(0, 187, 236); line-height: 18px; font-family: 微软雅黑; margin-top: 8px; margin-bottom: 0px; white-space: normal; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px 2px 3px; line-height: 28px; float: left; display: block; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><span class="wxqq-bg" style="margin: 0px 8px 0px 0px; padding: 4px 10px; border-radius: 80% 100% 90% 20%; color: rgb(255, 255, 255); -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important; background-color: rgb(0, 187, 236);">车语：</span><strong class="wxqq-color" style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">按三次双闪灯即可</strong></span></p><p><img width="auto" style="margin: 0px; padding: 0px; width: auto !important; height: auto !important; visibility: visible !important; -ms-word-wrap: break-word !important; box-sizing: border-box !important;" src="http://mmbiz.qpic.cn/mmbiz/l213TIsjia3Njt7WqWOxxE2g6Q3Mib1oYgqib69ql4AIq57ellvqJxiaTxdMs8DDbA6Ol0dlZJ7Yz63WURmTvCmBJQ/640?wx_fmt=jpeg&wxfrom=5" _width="auto" data-s="300,640" data-type="jpeg" data-ratio="0.7275" data-w="400" data-src="http://mmbiz.qpic.cn/mmbiz/l213TIsjia3Njt7WqWOxxE2g6Q3Mib1oYgqib69ql4AIq57ellvqJxiaTxdMs8DDbA6Ol0dlZJ7Yz63WURmTvCmBJQ/0?wx_fmt=jpeg"/><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p>道路这么拥堵，前车司机还能给你让路。是不是应该感谢人家？如果感谢呢？按三下双闪就可以了。</p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p style="padding: 0px; height: 32px; text-align: justify; color: rgb(0, 187, 236); line-height: 18px; font-family: 微软雅黑; margin-top: 8px; margin-bottom: 0px; border-bottom-color: rgb(227, 227, 227); border-bottom-width: 1px; border-bottom-style: solid; white-space: normal; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span class="wxqq-borderBottomColor" style="margin: 0px; padding: 0px 2px 3px; line-height: 28px; border-bottom-color: rgb(0, 187, 236); border-bottom-width: 2px; border-bottom-style: solid; float: left; display: block; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><span class="wxqq-bg" style="margin: 0px 8px 0px 0px; padding: 4px 10px; border-radius: 80% 100% 90% 20%; color: rgb(255, 255, 255); -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important; background-color: rgb(0, 187, 236);">问题：</span></span><span class="wxqq-borderBottomColor" style="margin: 0px; padding: 0px 2px 3px; color: rgb(38, 38, 38); line-height: 28px; border-bottom-color: rgb(0, 187, 236); border-bottom-width: 2px; border-bottom-style: solid; float: left; display: block; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><strong class="wxqq-color" style="margin: 0px; padding: 0px; color: rgb(60, 117, 45); line-height: 24px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">提醒前车，车辆有故障</strong></span></p><p style="padding: 0px; height: 32px; text-align: justify; color: rgb(0, 187, 236); line-height: 18px; font-family: 微软雅黑; margin-top: 8px; margin-bottom: 0px; white-space: normal; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px 2px 3px; line-height: 28px; float: left; display: block; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><span class="wxqq-bg" style="margin: 0px 8px 0px 0px; padding: 4px 10px; border-radius: 80% 100% 90% 20%; color: rgb(255, 255, 255); -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important; background-color: rgb(0, 187, 236);">车语：</span><strong class="wxqq-color" style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">连续闪三次大灯</strong></span></p><p><img width="auto" style="margin: 0px; padding: 0px; width: auto !important; height: auto !important; visibility: visible !important; -ms-word-wrap: break-word !important; box-sizing: border-box !important;" src="http://mmbiz.qpic.cn/mmbiz/l213TIsjia3Njt7WqWOxxE2g6Q3Mib1oYgnJ1mdQK0AX3k00OcKiauLzy68FQtmJ4qx0XlKlWZVFfLrXOjTrseIFw/640?wx_fmt=jpeg&wxfrom=5" _width="auto" data-s="300,640" data-type="jpeg" data-ratio="0.6625" data-w="400" data-src="http://mmbiz.qpic.cn/mmbiz/l213TIsjia3Njt7WqWOxxE2g6Q3Mib1oYgnJ1mdQK0AX3k00OcKiauLzy68FQtmJ4qx0XlKlWZVFfLrXOjTrseIFw/0?wx_fmt=jpeg"/><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p>路上跟车，有时候能看见前车后备箱没关好、刹车灯不亮等情况，我们干着急，怎么做才能及时提醒司机呢？连闪3次大灯就可以了。</p><p>同理，如果您被后车连闪三次大灯，就一定要注意了，很可能你的车辆出现了问题。一定要路边停车，仔细检查。</p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p style="padding: 0px; height: 32px; text-align: justify; color: rgb(0, 187, 236); line-height: 18px; font-family: 微软雅黑; margin-top: 8px; margin-bottom: 0px; border-bottom-color: rgb(227, 227, 227); border-bottom-width: 1px; border-bottom-style: solid; white-space: normal; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span class="wxqq-borderBottomColor" style="margin: 0px; padding: 0px 2px 3px; line-height: 28px; border-bottom-color: rgb(0, 187, 236); border-bottom-width: 2px; border-bottom-style: solid; float: left; display: block; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><span class="wxqq-bg" style="margin: 0px 8px 0px 0px; padding: 4px 10px; border-radius: 80% 100% 90% 20%; color: rgb(255, 255, 255); -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important; background-color: rgb(0, 187, 236);">问题：</span></span><span class="wxqq-borderBottomColor" style="margin: 0px; padding: 0px 2px 3px; color: rgb(38, 38, 38); line-height: 28px; border-bottom-color: rgb(0, 187, 236); border-bottom-width: 2px; border-bottom-style: solid; float: left; display: block; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><strong class="wxqq-color" style="margin: 0px; padding: 0px; color: rgb(60, 117, 45); line-height: 24px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">抗议后车跟车太近</strong></span></p><p style="padding: 0px; height: 32px; text-align: justify; color: rgb(0, 187, 236); line-height: 18px; font-family: 微软雅黑; margin-top: 8px; margin-bottom: 0px; white-space: normal; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px 2px 3px; line-height: 28px; float: left; display: block; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><span class="wxqq-bg" style="margin: 0px 8px 0px 0px; padding: 4px 10px; border-radius: 80% 100% 90% 20%; color: rgb(255, 255, 255); -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important; background-color: rgb(0, 187, 236);">车语：</span><strong class="wxqq-color" style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">阶段性亮刹车灯</strong></span></p><p><img width="auto" style="margin: 0px; padding: 0px; width: auto !important; height: auto !important; visibility: visible !important; -ms-word-wrap: break-word !important; box-sizing: border-box !important;" src="http://mmbiz.qpic.cn/mmbiz/l213TIsjia3Njt7WqWOxxE2g6Q3Mib1oYge2wpUb3BgRwx1rJlAgibVBuNmWowo8ib3ibQPGeyFgdXXoJ0R6o2ukf4A/640?wx_fmt=jpeg&wxfrom=5" _width="auto" data-s="300,640" data-type="jpeg" data-ratio="0.63" data-w="400" data-src="http://mmbiz.qpic.cn/mmbiz/l213TIsjia3Njt7WqWOxxE2g6Q3Mib1oYge2wpUb3BgRwx1rJlAgibVBuNmWowo8ib3ibQPGeyFgdXXoJ0R6o2ukf4A/0?wx_fmt=jpeg"/><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p>如果你发现后车跟你太近时，别慌张。阶段性的轻踩刹车，就能提示后车保持安全车距。</p><p>来源：网络</p>'),
(119, '<p>&nbsp;&nbsp;&nbsp;&nbsp; 一般<a href="http://baike.baidu.com/view/26882.htm" target="_blank">保险公司</a>要求在48小时内报案，报案后保险公司会派查勘员到现场判定你的痕迹是否相符，如果相符，一般都是认可的。你将车驶离事发地点不远处，仍然可根据现场高度、痕迹这些测量的，不会有什么影响。但要在保险公司规定的报案时间内报案，如果报案迟了，就有可能会加扣部分免陪。<a href="http://baike.baidu.com/view/2595169.htm" target="_blank">车险理赔</a>[1]是汽车发生交通事故后，车主到保险公司理赔。理赔工作的基本流程包括：报案、查勘定损、签收审核索赔单证、理算复核、审批、赔付结案等步骤。</p><p></p><p><span style="font-size: 20px;"><strong>理赔流程</strong></span></p><p>出险-报案-查勘-定损-核价-核损-核赔-支付</p><p>1.报案：一般保险公司要求在事发48小时内报案。</p><p>(1)出险后，客户向保险公司理赔部门报案；</p><p>(2)内勤接报案后，要求客户将出险情况立即填写《业务出险登记表》(电话、传真等报案由内勤代填)；</p><p>(3)内勤根据客户提供的保险凭证或保险单号立即查阅保单副本并抄单以及复印保单、保单副</p><p><a title="" class="image-link nslog:9317" style="width: 220px; height: 115px;" href="http://baike.baidu.com/picture/4101571/4101571/0/d788d43f8794a4c268a368470cf41bd5ac6e39dd.html?fr=lemma&ct=single" target="_blank"><img style="width: 220px; height: 115px;" alt="" src="http://f.hiphotos.baidu.com/baike/s%3D220/sign=deaef3080b23dd542573a06ae108b3df/d788d43f8794a4c268a368470cf41bd5ac6e39dd.jpg"/></a></p><p>本和附表。查阅保费收费情况并由财务人员在保费收据(业务及统计联)复印件上确认签章(特约付款须附上协议书或约定)；</p><p>(4)确认保险标的在保险有效期限内或出险前特约交费，要求客户填写《出险立案查询表》，予以立案(如电话、传真等报案，由检验人员负责要求客户填写)，并按报案顺序编写立案号； (5)发放索赔单证。经立案后向被保险人发放有关索赔单证，并告知索赔手续和方法(电话、传真等报案，由检验人员负责)；</p><p>(6)通知检验人员，报告损失情况及出险地点。</p><p>以上工作在半个工作日内完成。</p><p>2.查勘定损</p><p>(1)检验人员在接保险公司内勤通知后1个工作日内完成现场查勘和检验工作(受损标的在外地的检验，可委托当地保险公司在3个工作日内完成)；</p><p>(2)要求客户提供有关单证；</p><p>(3)指导客户填列有关索赔单证.</p><p>3.签收审核索赔单证</p><p>(1)营业部、各保险支公司内勤人员审核客户交来的赔案索赔单证，对手续不完备的向客户说明需补交的单证后退回客户，对单证齐全的赔案应在“出险报告(索赔)书&quot;(一式二联)上签收后，将黄色联交还被保险人；</p><p>(2)将索陪单证及备存的资料整理后，交产险部核赔科。</p><p>4.理算复核</p><p>(1)核赔科经办人接到内勤交来的资料后审核，单证手续齐全的在交接本上签收；</p><p>(2)所有赔案必须在3个工作日内理算完毕，交核赔科负责人复核。</p><p>5.审批</p><p>(1)产险部权限内的赔案交主管理赔的经理审批；</p><p>(2)超产险部权限的逐级上报。</p><p>6.赔付结案</p><p>(1)核赔科经办人将已完成审批手续的赔案编号，将赔款收据和计算书交财务划款；</p><p>(2)财务对赔付确认后，除陪款收据和计算书红色联外，其余取回。</p><p></p>');
INSERT INTO `plf_article_data` (`id`, `content`) VALUES
(120, '<p>车辆发生保险事故后，要立即保护现场，抢救伤员和财产，保留相关证据；立即向公安机关交通管理部门报案。电话通知保险公司报案（车辆保险卡上有保险公司的报案电话），48小时内携带保险单正本、驾驶证、行驶证、被保险人的身份证到保险公司正式报案。</p><p><span class="headline-content">理赔程序</span><span class="text_edit editable-title" style="margin-left: 10px;" data-edit-id="6461072:%E8%BD%A6%E8%BE%86%E4%BF%9D%E9%99%A9%E7%90%86%E8%B5%94%E7%A8%8B%E5%BA%8F:1"><a title="编辑本段" class="nslog:1019" href="http://baike.baidu.com/link?url=DYnZKW83V9aVxBnMrW4_oxKHdNjCqwuBrNIRwCAjxy2dNRyGj3DTU8iJmS5Cg0Bh0hhrHQSVVOVZ841rfBKWc_#">编辑</a></span></p><p>不同保险公司在理赔程序上会有所不同，但理赔的基本步骤大部分还是相同的，基本流程包括有：报案、查勘定损、签收审核索赔单证、理算复核、审批、赔付结案等步骤。</p><h3 class="headline-2"><a name="1_1"></a><a name="sub1085397_1_1"></a><a name="理赔程序_迅速报案"></a><span class="headline-content">迅速报案</span></h3><p>车险条款通常规定在出险后 48 小时内报保险公司，否则保险公司有权拒绝赔偿。如果委托他人代为报案，报案人还应携带身份证及被保险人出具的代为报案委托书。</p><h3 class="headline-2"><a name="1_2"></a><a name="sub1085397_1_2"></a><a name="理赔程序_定损修理"></a><span class="headline-content">定损修理</span></h3><p>因保险事故导致的车辆所有损失在修复之前，必须经<a href="http://baike.baidu.com/view/26882.htm" target="_blank">保险公司</a>定损（定损可到保险公司指定的修理厂或4S店，也可到具有定损资格的厂店进行，但必须保证三方人员全部在场），以核定损失项目及金额；定损完毕后才可修理受损车辆；给第三人造成人身或者财产损害所支付的赔偿金，理赔前也要经保险公司核定赔偿项目和相关证据、数额。</p><p><a name="2"></a><a name="sub1085397_2"></a><a name="保险赔款"></a></p><h2 class="headline-1"><span class="headline-1-index">2</span><span class="headline-content">保险赔款</span><span class="text_edit editable-title" style="margin-left: 10px;" data-edit-id="6461072:%E8%BD%A6%E8%BE%86%E4%BF%9D%E9%99%A9%E7%90%86%E8%B5%94%E7%A8%8B%E5%BA%8F:2"><a title="编辑本段" class="nslog:1019" href="http://baike.baidu.com/link?url=DYnZKW83V9aVxBnMrW4_oxKHdNjCqwuBrNIRwCAjxy2dNRyGj3DTU8iJmS5Cg0Bh0hhrHQSVVOVZ841rfBKWc_#">编辑</a></span></h2><p>被保险人或者其代理人在事故处理完毕后，10日内将索赔单证包括：交通事故责任认定书、调解书、判决书和修理发票、医疗费发票、病历、误工费证明、被抚养人身份情况以及保单正本 ( 复印件 ) 、身份证复印件、行驶证复印件、驾驶员驾照复印件等资料提交给保险公司，由保险公司计算赔款；届时，保险公司会通知领取保险赔款；领取赔款时，领款人要携带保险单正本、被保险人身份证或者户口本原件，如委托他人他人代领，代领人还要携带身份证及被保险人出具的《领取赔款授权书》。赔款最长有效期为自事故报案当日起2年内。</p><p><a name="3"></a><a name="sub1085397_3"></a><a name="特殊案件"></a></p><h2 class="headline-1"><span class="headline-1-index">3</span><span class="headline-content">特殊案件</span><span class="text_edit editable-title" style="margin-left: 10px;" data-edit-id="6461072:%E8%BD%A6%E8%BE%86%E4%BF%9D%E9%99%A9%E7%90%86%E8%B5%94%E7%A8%8B%E5%BA%8F:3"><a title="编辑本段" class="nslog:1019" href="http://baike.baidu.com/link?url=DYnZKW83V9aVxBnMrW4_oxKHdNjCqwuBrNIRwCAjxy2dNRyGj3DTU8iJmS5Cg0Bh0hhrHQSVVOVZ841rfBKWc_#">编辑</a></span></h2><p>当车辆被盗或被抢时，应该先向公安机关报案，应在24小时内通知出险地的派出所或刑警队；然后向保险公司报案，车辆被盗或者被抢48小时内携带个人资料到保险公司填写《机动车辆保险出险通知单》，办好登记手续。三个月内，车辆未能寻回的，可带齐以下证件：公安机关开具的失窃证明、保险单正本、被保险车辆的行驶证、驾驶员的驾驶执照、被保险人的身份证原件、报案人的身份证原件及车辆的钥匙到保险公司索赔。</p><p><a name="4"></a><a name="sub1085397_4"></a><a name="轻微事故"></a></p><h2 class="headline-1"><span class="headline-1-index">4</span><span class="headline-content">轻微事故</span><span class="text_edit editable-title" style="margin-left: 10px;" data-edit-id="6461072:%E8%BD%A6%E8%BE%86%E4%BF%9D%E9%99%A9%E7%90%86%E8%B5%94%E7%A8%8B%E5%BA%8F:4"><a title="编辑本段" class="nslog:1019" href="http://baike.baidu.com/link?url=DYnZKW83V9aVxBnMrW4_oxKHdNjCqwuBrNIRwCAjxy2dNRyGj3DTU8iJmS5Cg0Bh0hhrHQSVVOVZ841rfBKWc_#">编辑</a></span></h2><p>当车辆发生损失数额较小的保险事故后，车主可以将车开至保险公司指定修理处，那里有定损打价权，让修理厂帮助索赔。这种情况一般经过以下几步为车辆定损理赔</p><p>1、检验证件，出示三证及保单：本车行驶证、驾驶员的驾驶证、被保人的身份证、保户保险单；</p><p>2、坏车检查，初定车辆损失部位、坏车检查、填写案件审批表、复印所有证件等；</p><p>3、照相定损，照相定损，安排处理意见；</p><p>4、报案定时，按照案件审批表内容报案。修理完毕，带齐证件及修车发票到修理处接车即可，让修理处代理索赔。</p><p><a name="5"></a><a name="sub1085397_5"></a><a name="理赔流程"></a></p><h2 class="headline-1"><span class="headline-1-index">5</span><span class="headline-content">理赔流程</span><span class="text_edit editable-title" style="margin-left: 10px;" data-edit-id="6461072:%E8%BD%A6%E8%BE%86%E4%BF%9D%E9%99%A9%E7%90%86%E8%B5%94%E7%A8%8B%E5%BA%8F:5"><a title="编辑本段" class="nslog:1019" href="http://baike.baidu.com/link?url=DYnZKW83V9aVxBnMrW4_oxKHdNjCqwuBrNIRwCAjxy2dNRyGj3DTU8iJmS5Cg0Bh0hhrHQSVVOVZ841rfBKWc_#">编辑</a></span></h2><p>1. 报案</p><p>(1)出险后，客户向保险公司理赔部门报案;</p><p>(2)内勤接报案后，要求客户将出险情况立即填写《业务出险登记表》(电话、传真等报案由内勤代填);</p><p>(3)内勤根据客户提供的保险凭证或保险单号立即查阅保单副本并抄单以及复印保单、保单副本和附表。</p><p>查阅保费收费情况并由财务人员在保费收据(业务及统计联)复印件上确认签章(特约付款须附上协议书或约定);</p><p>(4)确认保险标的在保险有效期限内或出险前特约交费，要求客户填写《出险立案查询表》，予以立案(如电话、传真等报案，由检验人员负责要求客户填写)，并按报案顺序编写立案号;</p><p>(5)发放索赔单证。经立案后向被保险人发放有关索赔单证，并告知索赔手续和方法(电话、传真等报案，由检验人员负责);</p><p>(6)通知检验人员，报告损失情况及出险地点。</p><p>以上工作在半个工作日内完成。</p><p>及时报案很重要</p><p>保险车辆若发生道路保险事故后，应立即向事故发生地交通管理部门报案，同时拨打保险公司报案电话。</p><p>保险车辆若发生非道路(如小区等)保险事故后应向公安管理部门报案，并及时(48小时内)向保险公司报案。</p><p>保险车辆若发生涉及人伤的保险事故，应及时抢救伤者、严重人伤向医疗部门报案，并及时向保险公司报案并向医疗核损部门咨询。</p><p>保险车辆若发生盗抢事故，应立即向当地公安部门报案(不可抗力因素除外)，同时向保险公司报案，之后还应配合保险公司理赔人员做笔录及现场勘查;到报社办理登报声明;到养路费稽核处办理停驶手续;公安机关侦察;三个月内被盗车辆找回，保险公司赔付因盗抢引起的修理费用，三个月后车还未找回就到保险公司办理权益转让书;向保险公司提交索赔手续，办理理赔。</p><p>TIPS1：所有报案一定要在事故发生的48小时内，否则保险公司可拒绝理赔。</p><p>TIPS2：报案时可向保险公司服务人员进行后续理赔步骤咨询，记录下报案编号和相关人员的工号很重要。</p><p>2. 查勘定损</p><p>(1)检验人员在接保险公司内勤通知后1个工作日内完成现场查勘和检验工作(受损标的在外地的检验，可委托当地保险公司在3个工作日内完成);</p><p>(2)要求客户提供有关单证;</p><p>(3)指导客户填列有关索赔单证。</p><p>注释：</p><p>为了能够尽快赶到出事地点，保险公司在全国范围内都设有网上定损点，会第一时间赶到现场进行查勘、定损。</p><p>1、需要现场查勘定损的：保险公司会派专业人员迅速赶到现场进行查勘处理。被保险人须会同保险人检验，确定修理项目、方式和费用。</p><p>2、不需要现场查勘定损的：保险事故车辆拖至离事故现场较近的修理厂。如该修理厂是保险公司的远程定损点，可直接对事故车辆定损。不是的，可以联系保险公司派专业人员前去定损。</p><p>3、如果保险公司在限定的时间内没有派定损人员到定损点进行查勘、定损的，被保险人可与保险公司商议，申请驻点的物损评估机构进行定损，保险公司对评估机构的定损应当予以认可，但保险公司对交通事故的真实性有勘验、调查的权利。</p><p>4、当事人对保险公司的财产损失核定不认可的，在车辆未修理之前可申请评估机构进行财产损失核定;当事人对评估机构的定损仍不认可的，可向评估机构的上一级机构要求重新核定;对保险公司的定损或评估机构重新核定均不认可的，可依法申请仲裁或者向人民法院提起诉讼。</p><p>TIPS1：保险公司定损人员没有定损的车辆不能自行修理，否则，保险公司有权拒绝赔偿。被保险人可选择将事故车拖到保险公司指定的修理厂的(建议)，修理厂会尽快将您的车辆修理好。同时修理厂也可以帮助您共同处理理赔方面的问题。也可选择将事故车拖到自己熟悉的修理厂进行修理。</p><p>TIPS1：事故车必须按定损项目及定损金额进行修理，若有项目及费用的变动，应事先与保险公司协商。</p><p>TIPS2：少数不法修理厂为了自己利益将客户送修车辆伪造二次事故骗取理赔金。请提高警惕，建议客户去那些资质较佳或保险公司推荐的修理单位进行事故车修理。</p><p>3. 签收审核索赔单证</p><p>(1)营业部、各保险支公司内勤人员审核客户交来的赔案索赔单证，对手续不完备的向客户说明需补交的单证后退回客户，对单证齐全的赔案应在“出险报告(索赔)书&quot;(一式二联)上签收后，将黄色联交还被保险人;</p><p>(2)将索赔单证及备存的资料整理后，交产险部核赔科。</p><p>注释-案件审核：</p><p>被保险人提供的各种单证齐全后，保险公司应当迅速审核验证有关单据，调查核实有关证明及资料分权限核批。</p><p>1、不超权限业务。单证齐全，审查核定正确无误的，在限定时间内给与赔偿;如果在审查核定中发现与被保险人提供的数据不符或超过保险公司的理赔范围，与被保险人共同调查核实予以赔付。</p><p>2、超权限业务。交通事故重大赔偿金额超过一定的限额，当地保险公司要向上级保险公司进行汇报，由上级保险公司根据具体情况进行处理。</p><p>4. 理算复核</p><p>(1)核赔科经办人接到内勤交来的资料后审核，单证手续齐全的在交接本上签收; (2)所有赔案必须在3个工作日内理算完毕，交核赔科负责人复核。</p><p>5. 审批</p><p>(1)产险部权限内的赔案交主管理赔的经理审批;</p><p>(2)超产险部权限的逐级上报。</p><p>6. 赔付结案</p><p>(1)核赔科经办人将已完成审批手续的赔案编号，将赔款收据和计算书交财务划款;</p><p>(2)财务对赔付确认后，除赔款收据和计算书红色联外，其余取回。</p><p>注释-赔款领取：</p><p>保险公司通常在案件处理完毕后，会第一时间致电私家车客户领取理赔款(企业客户通常是银行划帐)，只要带好相关证明(如身份证，保单，赔案回执)去保单所属保险公司的财务部领取即可。</p><p>车主在理赔时的基本流程：</p><p>(1)出示保险单证。</p><p>(2)出示行驶证。</p><p>(3)出示驾驶证。</p><p>(4)出示被保险人身份证。</p><p>(5)出示保险单。</p><p>(6)填写出险报案表。</p><p>(7)详细填写出险经过。</p><p>(8)详细填写报案人、驾驶员和联系电话。</p><p>(9)检查车辆外观，拍照定损。</p><p>(10)理赔员带领车主进行车辆外观检查。</p><p>(11)根据车主填写的报案内容拍照核损。</p><p>(12)理赔员提醒车主车辆上有无贵重物品。</p><p>(13)交付维修站修理。</p><p>(14)理赔员开具任务委托单确定维修项目及维修时间。</p><p>(15)车主签字认可。</p><p>(16)车主将车辆交于维修站维修。</p><p>以上是车主和保险公司理赔员必须做到的。事实甚于雄辩，车主一定要做好前期工作，避免事后理赔时麻烦被动。</p><h3 class="headline-2"><a name="5_1"></a><a name="sub1085397_5_1"></a><a name="理赔流程_单方事故"></a><span class="headline-content">单方事故</span></h3><p>（单方事故:指不涉及人员伤（亡）或第三者财物损失的单方交通事故</p><p>举例：碰撞外界物体，自身车辆损坏，但外界物体无损坏或者无需赔偿）</p><p>事故处理及保险索赔程序:</p><p>单方肇事是最为常见的一类事故，因为不涉及第三者的损害赔偿，仅仅造成被保险车辆损坏，事故责任为被保险车辆负全部责任，所以事故处理非常简单</p><p>一、报案</p><p>事故发生后，保留事故现场，并立即向保险公司报案</p><p>二、现场处理</p><p>1、损失较小(一万元以下)，保险公司派人到现场查勘，并出具《查勘报告》</p><p>2、损失较大(一万元以上)，如查勘员认为需要报交警处理，会向交警部门报案，由交警部门到现场调查取证，并出具《事故认定书》</p><p>三、定损修理</p><p>1、车主将车辆送抵定损中心并同时通知保险公司，定损</p><p>2、修理厂修车</p><p>3、车主提车</p><p>四、提交单证进行索赔</p><p>理赔：收集索赔资料交保险公司办理索赔手续</p><p>五、损失理算</p><p>保险公司收到齐备的索赔单证后进行理算，以确定最终的赔付金额。</p><p>六、赔付</p><h3 class="headline-2"><a name="5_2"></a><a name="sub1085397_5_2"></a><a name="理赔流程_双方事故"></a><span class="headline-content">双方事故</span></h3><p>双方事故：</p><p>A：多方肇事（无人伤亡，）-事故处理及索赔程序</p><p>多方肇事：指不涉及人员伤亡,但涉及第三者财物损失、事故责任明确的双、多方交通事故</p><p>举例1：车辆追尾，后车负全部责任，对方或两方车辆均损坏</p><p>举例2：碰撞防护栏，车辆负全部责任，护栏损坏也需赔偿</p><p>事故处理及保险索赔程序</p><p>一、报案</p><p>1、事故发生后，保留事故现场，并立即向保险公司报案 ；</p><p>2、如第三方损失为道路设施或者第三方损失为车辆，需向交警部门报案；</p><p>二、现场处理-</p><p>1、保险公司人员到达现场，并出具《查勘报告》</p><p>2、交警部门到达现场，并现场出具《事故认定书》</p><p>提醒：一般情况下，如果在向保险公司报案时，保险公司要求向交警报案时，保险公司人员无需到现场处理！</p><p>三、第三者修理</p><p>1、如果第三者非机动车，则最好要求保险公司人员在进行现场处理时，直接达成三方（第三者、保险公司、车主）公认的一个核损价格，如果当场不能核定损失，则在进行第三者损失核定的时候或者过程中，要求保险公司给出核损价格</p><p>提醒：如果不经过保险公司允许，自行答应第三者有关索赔金额的承诺，这种承诺保险公司是有权推翻重来的，如果重新核定的价格与第三者的要求有差距，则这个差距会由车主自行承担</p><p>2、如果第三者是机动车，则要分以下两种情况：</p><p>第一、如果第三者同意与车主一同前往车主选定的修理厂进行修理，则当场不必支付第三者任何现金！</p><p>第二、如果第三者要求去自己选定的修理厂进行修理，也就是说第三者将与车主去不同的修理厂进行车辆修理时，则第三者可能要求车主在事故现场先支付一部分修理费用，或称押金或定金，（因为担心事后找不到车主或者事后车主不认账），切记：一、现场掏钱，一定要立收据；二、支付一半的修理费用比较适当（因为也有可能发生事后第三者不认账的情况）</p><p>提醒1：第三者车辆修理完毕后，车主必须先将修理费交付给第三者或者第三者选择的修理厂，然后拿到第三者的修理发票及维修明细才能进行保险索赔的，如果事后第三者不提供相关资料或者找不到第三者时，第三者的维修费用保险公司是不能赔付的</p><p>提醒2：虽然上文提到在现场掏钱时，要第三者立收据，虽说这种收据是不能作为赔偿依据的，但是这种收据至少可以避免第三者事后不认账的情况。因为第三者修理完毕后，车主必须先将修理费交付给第三者或者第三者选择的修理厂，如果没有这个收据，第三者万一不认账的情况下，车主到底应该在第三者车辆修理完毕后，支付多少钱呢？</p><p>四、车辆定损修理</p><p>1、将车辆送抵定损中心并同时通知保险公司，定损；</p><p>2、修理厂修车；</p><p>3、车主提车。</p><p>五、提交单证进行索赔</p><p>理赔：收集索赔资料交保险公司办理索赔手续</p><p>六、损失理算</p><p>保险公司收到齐备的索赔单证后进行理算，以确定最终的赔付金额。</p><p>七、赔付:</p><h3 class="headline-2"><a name="5_3"></a><a name="sub1085397_5_3"></a><a name="理赔流程_多方事故"></a><span class="headline-content">多方事故</span></h3><p>多方肇事（有人伤亡）-事故处理及索赔程序</p><p>多方肇事（有人伤亡）：指涉及到人员伤亡的双、多方交通事故。</p><p>举例1：碰撞行人，行人受伤</p><p>该类事故因为涉及到人员伤亡，所以处理起来比较复杂</p><p>一、报案</p><p>事故发生后，事故各方车辆应停在原地，保留好事故现场，并立即向保险公司和交警部门报案；</p><p>提醒：如有人员伤亡，应立即送往医院，除非事发地段比较荒凉或者无车经过，尽量不挪动事故车。因为如果用事故车将伤者送往医院，将造成事故责任无法认定。</p><p>二、现场处理</p><p>交警部门到现场调查取证，并暂扣事故车辆、当事司机《驾驶证》和事故车辆《行驶证》。一般情况下，交警处理的事故保险公司查勘人员无需再到现场查勘。</p><p>三、责任认定</p><p>交警部门根据事故情况作出责任判断，并向当事各方送达《责任认定书》；如当事各方对事故责任认定不服，应在收到《责任认定书》十五日内向交警部门提出复议或者向人民法院提出诉讼</p><p>四、伤者治疗</p><p>1、伤情诊断</p><p>医生对伤者进行检查，出具《病历》和《诊断证明》，并作出是否住院治疗的决定。</p><p>2、住院治疗</p><p>医生对伤者进行治疗。</p><p>3、出院手续</p><p>主治医生认为伤者无需再住院治疗的，伤者应办理出院手续开具《出院证明》，注明出院后的注意事项，休养时间，护理时间及护理人数。</p><p>主治医生认为伤者无需再住院治疗的，伤者拒不办理出院手续，赔偿义务人应通知交警部门，从主治医生证明伤者可以出院之日起的费用赔偿义务人可以不负责赔偿，保险公司也不会赔偿。</p><p>如伤者出院之后需继续治疗的，医生出具《继续治疗费用预估证明》，合理的费用保险公司可以赔付。</p><p>4、伤残评定</p><p>伤者治疗结束后，可以到相关的鉴定机构进行伤残评定，如达到伤残等级，应取得《伤残等级证明》</p><p>5、医疗担保和预付费用</p><p>当肇事各方无法承担医疗费用时，可以向保险公司提出申请预付医疗费用，凭医生出具的《医疗费用预估证明》和已交费用清单可以获得不超过所需费用50%的预付款。</p><p>6、医疗核损</p><p><a href="http://baike.baidu.com/view/26882.htm" target="_blank">保险公司</a>在伤者治疗期间，会派医疗核损人员到医院及交警大队了解伤者的受伤情况和治疗情况，对治疗费用进行预估和监督。</p><p>五、车辆定损修理</p><p>1、将车辆送抵定损中心并同时通知保险公司，及时定损；</p><p>2、修理厂修车；</p><p>3、车主提车。</p><p>六、赔偿调解</p><p>1、伤者治疗结束后，事故各方可到交警大队申请办理赔偿调解手续，也可到法院提起诉讼。法院及交警大队都会根据事故各方提供的证明材料依据相关赔偿标准和法规条款进行赔偿调解，当事各方不服的可以向上级人民法院提起诉讼。/</p><p>2、涉及到保险赔偿的事故，向法院提起诉讼时，可提请保险公司作为第二被告或第三人（厦门岛内法院只允许保险公司作第三人、岛外可以作被告）。</p><p>七、提交单证进行索赔</p><p>付清相关费用，收集索赔资料交保险公司办理索赔手续</p><p>八、损失理算</p><p>保险公司收到齐备的索赔单证后进行理算，以确定最终的赔付金额。</p><p>九、赔付</p><p><a name="6"></a><a name="sub1085397_6"></a><a name="停放被撞"></a></p><h2 class="headline-1"><span class="headline-1-index">6</span><span class="headline-content">停放被撞</span><span class="text_edit editable-title" style="margin-left: 10px;" data-edit-id="6461072:%E8%BD%A6%E8%BE%86%E4%BF%9D%E9%99%A9%E7%90%86%E8%B5%94%E7%A8%8B%E5%BA%8F:6"><a title="编辑本段" class="nslog:1019" href="http://baike.baidu.com/link?url=DYnZKW83V9aVxBnMrW4_oxKHdNjCqwuBrNIRwCAjxy2dNRyGj3DTU8iJmS5Cg0Bh0hhrHQSVVOVZ841rfBKWc_#">编辑</a></span></h2><p>停放被撞-事故处理及索赔程序</p><p>停放被撞：指车辆在停放过程中无人照料的情况下被不明物体碰撞造成车辆受损的事故。</p><p>举例：车辆在停车场停放中被第三方车辆碰撞损坏，但第三方车辆无法找到。</p><p>注意：该类案件保险公司只承担70%的赔偿责任！</p><p>事故处理及保险索赔程序</p><p>一、报案</p><p>事故发生后，保留事故现场，并立即向保险公司报案。</p><p>二、现场处理</p><p>保险公司人员抵达现场进行查勘，并出具《查勘报告》，同时根据查勘员要求到派出所或者交警部门开具《事故证明》，无法出具事故证明保险公司不予以受理赔付。</p><p>三、车辆定损修理</p><p>1、将车辆送抵定损中心并同时通知保险公司，定损；</p><p>2、修理厂修车；</p><p>3、车主提车。</p><p>四、提交单证进行索赔</p><p>理赔：收集索赔资料交保险公司办理索赔手续</p><p>五、损失理算</p><p>保险公司收到齐备的索赔单证后进行理算，以确定最终的赔付金额</p><p>六、赔付</p><p><br/></p><h2 class="headline-1"><span class="headline-1-index">7</span><span class="headline-content">整车被盗</span><span class="text_edit editable-title" style="margin-left: 10px;" data-edit-id="6461072:%E8%BD%A6%E8%BE%86%E4%BF%9D%E9%99%A9%E7%90%86%E8%B5%94%E7%A8%8B%E5%BA%8F:7"><a title="编辑本段" class="nslog:1019" href="http://baike.baidu.com/link?url=DYnZKW83V9aVxBnMrW4_oxKHdNjCqwuBrNIRwCAjxy2dNRyGj3DTU8iJmS5Cg0Bh0hhrHQSVVOVZ841rfBKWc_#">编辑</a></span></h2><p>整车被盗抢-事故处理及索赔程序</p><p>整车被盗抢：指整部车辆被盗、被抢</p><p><br/></p><h2 class="headline-1"><span class="headline-1-index">8</span><span class="headline-content">事故处理</span><span class="text_edit editable-title" style="margin-left: 10px;" data-edit-id="6461072:%E8%BD%A6%E8%BE%86%E4%BF%9D%E9%99%A9%E7%90%86%E8%B5%94%E7%A8%8B%E5%BA%8F:8"><a title="编辑本段" class="nslog:1019" href="http://baike.baidu.com/link?url=DYnZKW83V9aVxBnMrW4_oxKHdNjCqwuBrNIRwCAjxy2dNRyGj3DTU8iJmS5Cg0Bh0hhrHQSVVOVZ841rfBKWc_#">编辑</a></span></h2><p>该类事故因为涉及到交警大队立案以及必要的侦破时间，所以处理起来周期比较长</p><p><strong>一、报案</strong></p><p>1、24小时内带齐身份证、驾驶证、行驶证原件向案发地派出所报案，并取得加盖派出所公章的报案回执及被盗（抢）车辆报案表。</p><p>2、48小时内向保险公司电话报案</p><p><strong>二、刊登《寻车启事》</strong></p><p>一周内带齐报案回执、被盗（抢）车辆报案表到市一级报纸上刊登《寻车启事》，并保存好全幅报纸。</p><p><strong>三、开具《被盗（抢）车辆侦破结果证明书》</strong></p><p>如果三个月后（有些公司规定2个月）车辆仍未找到，带齐报案回执、被盗（抢）机动车辆报案表到派出所和区公安分局刑警大队办理未侦破证明手续，并由上述两个部门在《被盗（抢）车辆侦破结果证明书》上盖章确认未破获</p><p><strong>四、车辆销户</strong></p><p>1、到保险公司复印两份《被盗(抢)车辆立案表》并盖章；</p><p>2、办理车辆销户手续</p><p>带齐被盗（抢）车辆侦破结果证明书、报案回执、被盗（抢）机动车辆报案表、被盗（抢）机动车辆立案表（一份交车管所留存）、行驶证填写《机动车辆停驶登记申请表》，在公安报上刊登《销户声明》，取得《销户证明》</p><p><strong>五、提交单证进行索赔</strong></p><p>收集索赔资料交保险公司办理索赔手续</p><p><strong>六、损失理算</strong></p><p>保险公司收到齐备的索赔单证后进行理算，以确定最终的赔付金额</p><p><strong>七、赔付</strong></p><p><br/></p><h2 class="headline-1"><span class="headline-1-index">9</span><span class="headline-content">保险流程</span><span class="text_edit editable-title" style="margin-left: 10px;" data-edit-id="6461072:%E8%BD%A6%E8%BE%86%E4%BF%9D%E9%99%A9%E7%90%86%E8%B5%94%E7%A8%8B%E5%BA%8F:9"><a title="编辑本段" class="nslog:1019" href="http://baike.baidu.com/link?url=DYnZKW83V9aVxBnMrW4_oxKHdNjCqwuBrNIRwCAjxy2dNRyGj3DTU8iJmS5Cg0Bh0hhrHQSVVOVZ841rfBKWc_#">编辑</a></span></h2><p>依据《道路交通事故处理办法》和《道路交通事故处理程序》特规定如下事故处理流程：</p><p>现场勘查：</p><p>1、发生交通事故后，当事人对事实及成因无争议的，可即行撤离现场，自行协商处理损害赔偿事宜。不即行撤离现场的，必须保护好现场，并迅速报告公安机关。</p><p>2、值班民警接到指令后，必须严格在承诺制度的时间内快速赶赴现场，并快速处置现场。</p><p>3、进行现场勘查包括现场访问、摄影、制图、丈量、勘验等系列工作。现场勘查必须做到依法、及时、全面、准确。</p><p>4、现场勘查记录经复核无误后，应要求当事人或见证人在现场图上签名。</p><p>5、为检验需要，必要时可扣留肇事车辆和当事人的相关证件。</p><p>6、与当事人预约事故处理时间。</p><p>7、事后展开调查必须依法进行，包括询（讯）问、痕迹提取检验、技术检测、损害评估和其他必要的鉴定。</p><p>责任认定:</p><p>1、在调查阶段，必要时可召集当事人举行听证。</p><p>2、在查明事故的基本事实和收集充足的证据后，严格按照规定时间依法作出责任认定。</p><p>3、公布责任时，必须召集各方当事人到席讲清事故的基本事实和认定责任的理由与依据。</p><p>4、告知当事人申请重新认定的权利和法律时效。</p><p>处罚:</p><p>1、责任认定发生法律效力后，应对责任当事人作出处罚意见呈送领导审批。</p><p>2、根据领导作出的处罚决定填写处罚裁决书。</p><p>3、向责任人宣布处罚裁决。</p><p>4、告知当事人申请行政复议的权利和法律时效。</p><p>5、完善处罚的相关手续。</p><p>6、执行处罚。</p><p>赔偿调解:</p><p>1、收集与损害赔偿相关的证明、票据、各种资料。</p><p>2、在确认伤者治疗终结或确定损害结果后，必须在规定时间内组织各方当事人或代理人进行赔偿调解。调解次数最多为二次。</p><p>3、调解成功后，制作《调解书》，并分别送交当事人。</p><p>4、调解未成功的，必须填写《调解终结书》，送交当事人，并告知当事人可在法定时效内向人民法院提起民事诉讼。</p><p><br/></p><h2 class="headline-1"><span class="headline-1-index">10</span><span class="headline-content">基本原则</span><span class="text_edit editable-title" style="margin-left: 10px;" data-edit-id="6461072:%E8%BD%A6%E8%BE%86%E4%BF%9D%E9%99%A9%E7%90%86%E8%B5%94%E7%A8%8B%E5%BA%8F:10"><a title="编辑本段" class="nslog:1019" href="http://baike.baidu.com/link?url=DYnZKW83V9aVxBnMrW4_oxKHdNjCqwuBrNIRwCAjxy2dNRyGj3DTU8iJmS5Cg0Bh0hhrHQSVVOVZ841rfBKWc_#">编辑</a></span></h2><p>车险理赔工作涉及面广，情况比较复杂。在赔偿处理过程中，特别是在对汽车事故进行查勘工作过程中，必须提出应有的要求和坚持一定的原则。</p><p>(一)树立为保户服务的指导思想，坚持实事求是原则</p><p>在整个理赔工作过程中，体现了保险的经济补偿职能作用。当发生汽车保险事故后，保险人要急被保险人所急，千方百计避免扩大损失，尽量减轻因灾害事故造成的影响，及时安排事故车辆修复，并保证基本恢复车辆的原有技术性能，使其尽快投入生产运营。及时处理赔案，支付赔款，以保证运输生产单位(含个体运输户)生产、经营的持续进行和人民生活的安定。</p><p>在现场查勘，事故车辆修复定损以及赔案处理方面，要坚持实事求是的原则，在尊重客观事实的基础上，具体问题作具体分析，即严格按条款办事，又结合实际情况进行适当灵活处理，使各方都比较满意。?</p><p>(二)重合同，守信用，依法办事?</p><p>保险人是否履行合同，就看其是否严格履行经济补偿义务。因此，保险方在处理赔案时，必须加强法制观念，严格按条款办事，该赔的一定要赔，而且要按照赔偿标准及规定赔足；不属于保险责任范围的损失，不滥赔，同时还要向被保险人讲明道理，拒赔部分要讲事实、重证据。</p><p>要依法办事，坚持重合同，诚实信用，只有这样才能树立保险的信誉，扩大保险的积极影响。?</p><p>(三)坚决贯彻“八字”理赔原则</p><p>“主动、迅速、准确、合理”是保险理赔人员在长期的工作实践中总结出的经验，是保险理赔工作优质服务的最基本要求：</p><p>(1)主动：就是要求保险理赔人员对出险的案件，要积极、主动的进行调查、了解和勘察现场，掌握出险情况，进行事故分析确定保险责任。</p><p>(2)迅速：就是要求保险理赔人员查勘、定损处理迅速、不拖沓、抓紧赔案处理，对赔案要核的准，赔款计算案卷缮制快，复核、审批快，使被保险人及时得到赔款。</p><p>(3)准确：就是要求从查勘、定损以至赔款计算，都要做到准确无误，不错赔、不滥赔、不惜赔。</p><p>(4)合理：就是要求在理赔工作过程中，要本着实事求是的精神，坚持按条款办事。在许多情况下，要结合具体案情准确定性，尤其是在对事故车辆进行定损过程中，要合理确定事故车辆维修方案。</p><p></p>'),
(121, '<p><span style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">1、“拖车”</strong></span></p><p><span style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">如果您的车在拖车时与别的车发生了碰撞，怎么办?</span></p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p><span style="margin: 0px; padding: 0px; font-size: 1em; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">这样应对：就当从来没拖过车。千万别提你在拖带车辆或者被别人拖带，否则不管你有没有事故责任，保险公司一律不赔。</span></p><p><span style="margin: 0px; padding: 0px; font-size: 20px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; font-size: 1em; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">2、“没系安全带”</strong></span></p><p><span style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">案例：车子撞到了石墩上，坐在副驾上的乘客甩出车外，摔成重伤。交管认定车主对事故负全责。在赔偿问题上，投保公司认定“车上人员”赔付，而车主认为应按三责险赔。</span></p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p><span style="margin: 0px; padding: 0px; font-size: 20px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">第三者应是指</span><span style="margin: 0px; padding: 0px; font-size: 20px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">被保险人</span><span style="margin: 0px; padding: 0px; font-size: 20px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">以外的受害人。而徐然作为事故发生时的车上乘员，应认定为“本车人员”。</span></p><p><span style="margin: 0px; padding: 0px; font-size: 20px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; font-size: 1em; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">3、“停车场丢车”</strong></span></p><p><span style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">凡是车辆在收费停车场或营业性修理厂中被盗，保险公司一概不负责赔偿。因为上述场所对车辆有保管的责任，在保管期间，因保管人保管不善造成车辆损毁、丢失的，保管人应承担责任。</span></p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p><span style="margin: 0px; padding: 0px; font-size: 20px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; font-size: 1em; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">4、“自家车撞自家人”</strong></span></p><p><span style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">第三者责任险中的第三者通俗地讲，第三者就是排除4种人：即保险人、被保险人、本车发生事故时的驾驶员及其家庭成员、被保险人的家庭成员。还不仅在车险中，在其他责任险中也有相关规定。 攻略：千万别跟人过不去，尤其是自家人。</span></p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p><span style="margin: 0px; padding: 0px; font-size: 20px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; font-size: 1em; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">5、“撞破小灯别报案”</strong></span></p><p><span style="margin: 0px; padding: 0px; font-size: 20px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; font-size: 1em; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></strong></span></p><p><span style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">如果您的车在撞车时，打破了一个小灯找保险公司，他绝对屁颠屁颠给您赔，根据“凡是殷勤必定有鬼”的定理，你没有占便宜而是吃大亏了！</span></p><p>来源：网络</p>'),
(122, '<p><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">1、对方全责但不赔偿</strong></p><p>你一点责任没有，但是对方没有赔偿能力，这个时候保险公司也不会赔偿你的，除非能证明对方的情况。</p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">2、本人和家人因车受伤</strong></p><p>四项主险里的三者险是针对人的保险，但这里针对的人不包括你，也不包括你家的人，当人员受伤产生费用时保险公司是不赔付的，要自己掏腰包。针对自己人的专门有一个保险，叫<strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">车上人员险</strong>。</p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">3、涉水险二次打火</strong></p><p>车辆如果上了涉水险，在涉水路面或车辆被水淹后发动机受到损害是可以得到赔偿的，但是如果你自己又进行了二次打火，那保险公司是可以拒赔的。</p><p><span style="margin: 0px; padding: 0px; line-height: 1.6; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></span></p><p><span style="margin: 0px; padding: 0px; line-height: 1.6; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">4、新车被盗</strong></span><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p>新车就是指新买的还没上牌的车辆，就算你上了保险，再没上牌之前起作用的也只是交强险和三者险，车要是丢了，保险公司是不会赔偿的。</p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">5、醉酒驾驶</strong></p><p>这个不用过多解释了，大家都明白，出了事不仅保险公司不赔钱，你本人还要得到法律的制裁，最好的办法就是酒后不动车。</p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">6、故意毁坏车辆</strong></p><p>这里说的故意毁坏是保险公司的说法，除了那种骗保的情况外，还有一些是你在不知情时被划分进入此条的。比如你在车内放置打火机、摩丝、空气清新剂的易燃易爆的物品，发生爆炸后风挡玻璃被炸碎，这种情况下在保险公司那里就算做故意毁坏车辆，是不能得到赔偿的。</p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">7、车辆不在规定使用状态</strong></p><p>假如你的车没有年检，发生事故时保险公司是拒赔的，因为你不在合法的使用状态内。还有当你的车放在修理厂，第二天发现出事故了，保险公司也是不赔偿的，理由是不在你的使用状态内，这个时候要找修理厂赔偿。</p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">8、不报案或延期报案</strong></p><p>一般情况下保险公司是要求车辆出险48小时内报案，出了48小时保险公司有权利拒赔，所以打个电话也不费什么事，出了险还是尽快报案比较稳妥。还有就是不报案的，如果你都不报案，那保险公司在什么都不知道的情况下也不会给你钱的。</p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">9、改装车辆不申报的</strong></p><p>保险合同里会写明车辆转送或增加车辆危险程度需要通知保险公司，增加车辆危险程度主要说的就是改装车辆。这里提到的改装比较容易产生误解。你改装排气管按理说不应该导致危险程度增加，但你改装发动机是否就会导致车辆危险程度增加呢？现有的法院判例表明，改装了发动机的车辆发生车祸后，保险公司会合法拒赔。</p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">10、无照驾驶</strong></p><p>这里要强调一点，比如持C本开大客车这种情况也算是无照驾驶。</p><p><span style="margin: 0px; padding: 0px; color: rgb(28, 28, 28); line-height: 24px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">其实上保险是以防万一，永远用不上是最好的，但是就怕万一，所以，腾讯地图提醒车主应该先了解清楚保险的细则。</span></p><p>来源：网络</p>');
INSERT INTO `plf_article_data` (`id`, `content`) VALUES
(123, '<p style="margin: 0px auto 20px; padding: 0px; color: rgb(51, 51, 51); line-height: 30px; font-family: 宋体, arial, sans-serif; white-space: normal; -ms-word-wrap: normal; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);">车险是保障，但不懂专业的车主，想必也遭受了不少陷阱和委屈。来一起看看吧：<br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p style="margin: 0px auto 20px; padding: 0px; color: rgb(51, 51, 51); line-height: 30px; font-family: 宋体, arial, sans-serif; white-space: normal; -ms-word-wrap: normal; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">定损价格无法达成一致</strong></p><p style="margin: 0px auto 20px; padding: 0px; color: rgb(51, 51, 51); line-height: 30px; font-family: 宋体, arial, sans-serif; white-space: normal; -ms-word-wrap: normal; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);">车辆出险后，如果保险公司的定损价格与车主后期询问的价格有出入，且双方对此无法达成一致，车主可让保险公司与修理厂协商处理，或按照保险公司原先的定损价格，由保险公司推荐到相应的修理厂进行维修。</p><p style="margin: 0px auto 20px; padding: 0px; color: rgb(51, 51, 51); line-height: 30px; font-family: 宋体, arial, sans-serif; white-space: normal; -ms-word-wrap: normal; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);">如果在这种情况下，车主因定损价格存在纠纷、自行将车辆维修，而使得“无法重新核损”，这时是很难会有保险公司对此赔付的。在车辆发生损失时，保险公司一贯主张以修复为主（在不影响安全前提下），除非是无法修复的，则给予更换，而保险公司对于车辆的定损价格则是参考市面上零部件价格、维修人工费来确定的。当然，不同维修厂因成本的不同，造成出险维修差价较大也是比较常见的现象，所以车主解决方法有两种，一是让保险公司与维修厂议价处理；二是让保险公司推荐到相应的修理厂进行维修。</p><p style="margin: 0px auto 20px; padding: 0px; color: rgb(51, 51, 51); line-height: 30px; font-family: 宋体, arial, sans-serif; white-space: normal; -ms-word-wrap: normal; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);">不过，为了避免在索赔当时出现分歧，在签订保险合同时，双方最好能以书面的方式说明细节，可事先约定一次性的评估条款等。</p><p style="margin: 0px auto 20px; padding: 0px; color: rgb(51, 51, 51); line-height: 30px; font-family: 宋体, arial, sans-serif; white-space: normal; -ms-word-wrap: normal; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">为何提交材料后还得不到索赔</strong></p><p style="margin: 0px auto 20px; padding: 0px; color: rgb(51, 51, 51); line-height: 30px; font-family: 宋体, arial, sans-serif; white-space: normal; -ms-word-wrap: normal; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);">在理赔过程中，有车主遇到了这样的问题，在递交了索赔单证后，却一直没有赔付金的消息。出现这种情况，大致原因几点：一是提交相关材料时未提交齐全；二是未及时将索赔单证转交给保险公司；三是车主所提供的赔款支付账户信息有误。</p><p style="margin: 0px auto 20px; padding: 0px; color: rgb(51, 51, 51); line-height: 30px; font-family: 宋体, arial, sans-serif; white-space: normal; -ms-word-wrap: normal; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);">其实，在车险索赔里，保险公司应明确告知车主索赔单证要齐全，并提醒车主缺哪些单证，尤其是初次出险的新车主，在没有理赔经验的前提下，这种义务提醒是很有必要的。</p><p style="margin: 0px auto 20px; padding: 0px; color: rgb(51, 51, 51); line-height: 30px; font-family: 宋体, arial, sans-serif; white-space: normal; -ms-word-wrap: normal; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">现场勘查误时如何办</strong></p><p style="margin: 0px auto 20px; padding: 0px; color: rgb(51, 51, 51); line-height: 30px; font-family: 宋体, arial, sans-serif; white-space: normal; -ms-word-wrap: normal; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);">在发生交通事故后，如果保险公司查勘员未能按时来到现场，车主可以在查勘员的指导下进入定损中心，若查勘人员因自身原因而使得车主等待时间过长，车主可以让保险公司重新安排人员进行查勘。另外，车主在投保时，若对事故处理的约定不明确，可提出进行事后约定，即在报案时，可以跟保险公司进行口头约定，如果查勘人员不能在约定的时间内赶到现场，则是违反了事后口头协议。</p><p style="margin: 0px auto 20px; padding: 0px; color: rgb(51, 51, 51); line-height: 30px; font-family: 宋体, arial, sans-serif; white-space: normal; -ms-word-wrap: normal; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);">不过，对于3000元以下的小额赔案，车主大可以在第一时间向保险公司报案后，经协商达成后自行撤离现场，到就近的理赔中心完成定损，以免造成交通堵塞。</p><p style="margin: 0px auto 20px; padding: 0px; color: rgb(51, 51, 51); line-height: 30px; font-family: 宋体, arial, sans-serif; white-space: normal; -ms-word-wrap: normal; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);">除了以上比较热议的索赔话题外，还有几项是消费者平时很难察觉到的索赔陷阱。比如在购买保险时，购买了套餐保险，而这些打包销售的保险中却有一些险种是平时用的比较少的。另外，有些消费者为了在事故后得到更多索赔，在当初投保时则“花了大手笔”，然而真正的理赔并非投的越多保的就越多。诸如此类的事例总是不经意的发生在消费者身边，希望能引起消费者注意。</p><p style="margin: 0px auto 20px; padding: 0px; color: rgb(51, 51, 51); line-height: 30px; font-family: 宋体, arial, sans-serif; white-space: normal; -ms-word-wrap: normal; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">捆绑销售并非划算</strong></p><p style="margin: 0px auto 20px; padding: 0px; color: rgb(51, 51, 51); line-height: 30px; font-family: 宋体, arial, sans-serif; white-space: normal; -ms-word-wrap: normal; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);">对于一些没有经验的新车主，第一次购买保险时多会听保险人员的劝告，为爱车买齐保险。确实，全保可以求得心理安慰，但实际上也买了很多没有实际用处的险种。更有甚者，有些保险公司为了获取更大利益，把单个保险捆绑销售，再给予优惠，看似划算了一点的保险，其实并不划算。比如，就有保险公司把车辆险中的责任险、防盗险和车损险等捆绑起来作为自己公司的车辆基本险进行销售，而车主总是在自己不知情的情况下买了下来。</p><p style="margin: 0px auto 20px; padding: 0px; color: rgb(51, 51, 51); line-height: 30px; font-family: 宋体, arial, sans-serif; white-space: normal; -ms-word-wrap: normal; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">并非保的多就赔的多</strong></p><p style="margin: 0px auto 20px; padding: 0px; color: rgb(51, 51, 51); line-height: 30px; font-family: 宋体, arial, sans-serif; white-space: normal; -ms-word-wrap: normal; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);">车险中常给人误导，保的越多，到时候赔的也就越多，其实并非如此，这只是投保人的伎俩，只是为了让车主超额投保而赚取更多代理费。这里，车主需搞清楚一点，任何一家保险公司都是完全根据汽车所出险情大小的实际情况进行理赔的，即使投再多的保，也并不一定能得到更多索赔。</p><p>来源：网络</p>'),
(124, '<p><br/>&nbsp;&nbsp;&nbsp; 为了配合执行公司下一步的战略，特制定以下活动方案，此活动有效时间为：2015年8月21日至2015年11月30日。<br/>一、上期活动在2015年8月20日终止。<br/>二、本期活动开始时间为：2015年8月21日，截止时间为：2015年11月30日止。<br/>三、付费代理商享有招募免费pc代理商权利（付费代理享受6%，免费pc享受6%）<br/>四、地市级代理和付费pc同时享有免费pc代理招募权利。<br/>五、引荐付费pc代理享受培训金奖励及管理权</p><p>奖励政策：<br/>pc代理政策及招商奖励金额<span style="color: rgb(0, 0, 0);">：</span><span style="color: rgb(192, 80, 77);"> （凡是2015年8月20日之后在车务网注册的免费pc代理，升级成为付费pc，执行以下奖励政策）</span></p><p>一、市级代理商利润：</p><table style="width: 336px; height: 102px;"><tbody><tr class="firstRow"><td width="274" align="center" class="selectTdClass" valign="top" style="border-width: 1px; border-style: solid; -ms-word-break: break-all;"><span style="color: rgb(0, 0, 0);">销售量保证金</span></td><td width="274" align="center" class="selectTdClass" valign="top" style="border-width: 1px; border-style: solid; -ms-word-break: break-all;"><span style="color: rgb(0, 0, 0);">送酒配比</span></td><td width="274" align="center" class="selectTdClass" valign="top" style="border-width: 1px; border-style: solid; -ms-word-break: break-all;"><span style="color: rgb(0, 0, 0);">奖励培训费</span></td></tr><tr><td width="274" align="center" class="selectTdClass" valign="top" style="border-width: 1px; border-style: solid; -ms-word-break: break-all;"><span style="color: rgb(0, 0, 0);">2.2万元</span></td><td width="274" align="center" class="selectTdClass" valign="top" style="border-width: 1px; border-style: solid; -ms-word-break: break-all;"><span style="color: rgb(0, 0, 0);">22000元</span></td><td width="274" align="center" class="selectTdClass" valign="top" style="border-width: 1px; border-style: solid; -ms-word-break: break-all;"><span style="color: rgb(0, 0, 0);">4000元</span></td></tr><tr><td width="274" align="center" class="selectTdClass" valign="top" style="border-width: 1px; border-style: solid; -ms-word-break: break-all;"><span style="color: rgb(0, 0, 0);">5.5万元</span></td><td width="274" align="center" class="selectTdClass" valign="top" style="border-width: 1px; border-style: solid; -ms-word-break: break-all;"><span style="color: rgb(0, 0, 0);">165000元</span></td><td width="274" align="center" class="selectTdClass" valign="top" style="border-width: 1px; border-style: solid; -ms-word-break: break-all;"><span style="color: rgb(0, 0, 0);">9000元</span></td></tr></tbody></table><p><br/>1、享受自己办单赚取12%的佣金，<br/>2、享受推广APP邀请链接招募免费pc代理，赚取6%的佣金，<br/>3、享受招募付费pc代理，赚取现金奖励培训费。<br/>二、付费pc代理商利润：<br/>1、享受自己办单赚取12%的佣金，<br/>2、享受推广APP邀请链接招募免费pc代理，赚取6%的佣金，<br/>三、免费pc代理商利润：<br/>1、享受自己办单赚取6%佣金<br/>2、通过链接先注册后投保的用户，享受等额酒水外，还获得5%的提成。<br/>四、汽车众筹奖励计划<br/>1、付费pc销售量满500万，酒水保证金以货补形式补发。<br/>2、年赠送额达到500万（销售额不含税），自动入选参加汽车基金，享受汽车众筹奖励计划。<br/>3、两年赠送额达到1000万（销售额不含税），自动入选参加汽车基金，享受汽车众筹奖励计划。<br/>备注：1.汽车众筹奖励计划：壹圆汽车奖励计划。<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2.销售额皆以APP上，大数据统计为准。</p><p>&nbsp;</p><p><span style="color: rgb(192, 80, 77);">最终解释权归总公司所有</span></p><p style="display:none;" data-background="background-repeat:no-repeat; background-position:center center; background-color:#FFFFFF;"><br/></p>'),
(125, '<p><span class="profile_arrow_wrp" id="js_profile_arrow_wrp"><em class="profile_arrow arrow_out"></em><em class="profile_arrow arrow_in"></em></span></p><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important;"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); line-height: 2em; font-family: 微软雅黑; font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">汽车在使用过程中会遇到零配件耗损问题。最明显的就是汽车轮胎，在公路上跑动久了，橡胶会越磨越薄。汽车的其它部件也会因长期使用磨损。所以，爱车保养尤其要注意这个关键。车如人，可以分为三个生命时期。</span><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">1-4年：青少年期</strong></span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; text-decoration: underline; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><img style="margin: 0px; padding: 0px; width: auto !important; height: auto !important; visibility: visible !important; -ms-word-wrap: break-word !important; box-sizing: border-box !important;" src="http://mmbiz.qpic.cn/mmbiz/avcl1ZrNUF2TxzC9TjGuibPadCzKKZzxptjHF2UNsmQgvFXDHKuPKPx2b8DSEj6uKOdZRoibUE6Jf7ImJOuQIftQ/0?wxfrom=5&wx_lazy=1" data-src="http://mmbiz.qpic.cn/mmbiz/avcl1ZrNUF2TxzC9TjGuibPadCzKKZzxptjHF2UNsmQgvFXDHKuPKPx2b8DSEj6uKOdZRoibUE6Jf7ImJOuQIftQ/0?wxfrom=5" data-w="500" data-ratio="0.666" data-type="jpeg" data-s="300,640"/></strong></span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">一辆车在使用的头两年是生命的巅峰期，只要进行常规保养，基本上不会有什么问题，但两年以上的车子就要开始更换一些最易损耗的部件了。</span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">刹车皮：</strong></span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">车子使用两三年就需要更换新的刹车皮。当一辆车子送去维修时，首先要检查它的刹车皮，因为刹车皮是驾驶安全的首道防线。根据经验，刹车皮大概在两年左右就会磨尽了，当然，准确的使用期得视驾驶者的习惯而定。如果你是那种喜欢踩很多油，然后在关键时候猛力踩刹车的人，刹车皮的磨损肯定会比较厉害，寿命也就比较短。</span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">燃油泵：</strong></span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">车子开到两年多的时候，燃油泵也差不多该清洗或更换了。</span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">减振器：</strong></span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">车子到了三四年的时候，跑起来可能没有新车那么平稳，遇到这种情况，应该检查车子的减振器。减振器的作用是为了减少车子的振动，它是悬挂系统的一部分，如果减振器的弹簧不再有弹性，在高速行驶时就会抖动得很厉害，下雨天更是特别危险。</span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">4-7年：中年期</strong></span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); line-height: 1.75em; font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">这时的车子就像“人到中年”，很多东西都松了，包括车内的各种橡胶管，车盖底下的问题等。不少车主往往在车开到四五年的时候开始换车，也有一些二手车买主喜欢买这个车龄的车子。</span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); line-height: 1.75em; font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">正时皮带：</strong></span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">开了4年左右的车子要注意正时皮带是不是该换了，一般车子在行驶了7万到10万公里的时候，就应该送去换正时皮带，如果不及时更换，车子行驶到半途时如果正时皮带突然断裂，要付出的维修费至少数百元。</span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">橡胶管：</strong></span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">这个车龄的车子如保养不好，漏黑油、漏水的问题就会出现。这是很自然的，橡胶管用旧了，总会出现老化问题。假如车主对车保养得好，老化的问题会比较迟一点出现。</span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">水缸：</strong></span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">5年左右的车子，水缸可能被里面的化学物腐蚀，有些车子的水缸开始漏水，水缸当然就需要更换了。</span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">定期给车子更换机油、过滤器等等，花点小钱，可以省下大钱，驾驶时也更有保障。</span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">7-10年：老年期</strong></span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; text-decoration: underline; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><img style="margin: 0px; padding: 0px; width: auto !important; height: auto !important; visibility: visible !important; -ms-word-wrap: break-word !important; box-sizing: border-box !important;" src="http://mmbiz.qpic.cn/mmbiz/avcl1ZrNUF2TxzC9TjGuibPadCzKKZzxp0sTZJQiaLrLdIGzicr0123FaWnicxwZtWj2LQUxhyUgeIKLUOtlQWPpJg/0?wxfrom=5&wx_lazy=1" data-src="http://mmbiz.qpic.cn/mmbiz/avcl1ZrNUF2TxzC9TjGuibPadCzKKZzxp0sTZJQiaLrLdIGzicr0123FaWnicxwZtWj2LQUxhyUgeIKLUOtlQWPpJg/0?wxfrom=5" data-w="500" data-ratio="0.75" data-type="jpeg" data-s="300,640"/></strong></span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">由于汽车寿命的限定，在我国，汽车一般到了10年就该退休了，如果保养得当，爱车还能健康地如期完成使命。但车子到了7年以后，就逐步进入老年期，到了这把“年纪”，那些在第三年和第四年更换的小零件，差不多该再换一次了，比如说减振器。除此之外，大部分自动变速的车子也应该在这个时候维修自动变速箱。</span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"><strong style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">自动变速箱的保养：</strong></span></p><p style="padding: 0px; line-height: 2em; font-family: 微软雅黑; font-size: 15px; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; -ms-word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; color: rgb(0, 112, 192); font-size: 14px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;">使用自动变速汽车的车主，自动排挡车的变速箱构造比较复杂，也比较精密，在驾驶自动变速的车子时，要想在寿命期内行驶自如，保持良好状态，车主就必须多用心，让不同排挡交替使用，该做的保养一定不能省。这样可以延长自动变速箱的使用期。</span></p><p></p>'),
(126, '<p style="white-space: normal;">山西元坤电子商务有限公司位于山西省运城市空港新区。是一家集软件开发、网络技术服务、信息咨询服务，理财规划、企业管理策划咨询服务、电子商务服务、销售等为一体的高新技术服务企业。目前，在全国拥有子公司12家，分布河南、河北、山西、陕西、四川、内蒙等。在中国率先推出&quot;个人对个人（&quot;Peer to Peer&quot;或称&quot;P2P&quot;）的《互联网借贷平台》及《共通积分（便利）兑换商城》、《供销商城》等创新型电子商务交易（B2B、B2C、C2C、C2B、O2O）商业模式优势于一体的综合服务平台。平台项目在国内处于领先地位，独一无二，无可替代。</p><p style="white-space: normal;"><strong>集团文化——礼 义 廉 耻&nbsp;</strong>&nbsp;</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp;礼是规规矩矩的态度，礼是严严整整的纪律，</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp;义是正正当当的行为，义是慷慷慨慨的牺牲，</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp;廉是清清楚楚的辨别，廉是实实在在的节约，</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp;耻是切切实实的觉悟，耻是轰轰烈烈的奋斗。</p><p style="white-space: normal;">三年战略 ： 忘掉过去、调整心态、</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 确定模式、寻找天才</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 本土化、同城化、行业化、品牌化</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 科技高地、人才高地</p><p style="white-space: normal;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 技术高地、产业高地</p><p style="white-space: normal;">目标：诚信和创新，提高企业核心竞争力，引领企业成为行业领头人！</p><p style="white-space: normal;">利益：严格按照以股东、员工、客户、家属、社会的利益序列，利益分配，发展运营。</p><p style="white-space: normal;">流程：内部物流化，外部连锁化</p><p style="white-space: normal;">管理：标准化、流程化、简单化、系统化</p><p style="white-space: normal;">集团模式：集资本运营导向模式和产业运作模式的结合，建设以服务实体经济为基础，资本运营为纽带的双核模式</p><p style="white-space: normal;"><img src="http://www.vcivc.cn/data/upload/ueditor/image/1/201412/1419927656433042.jpg" width="100%"/></p><p style="white-space: normal;"><img src="http://www.vcivc.cn/data/upload/ueditor/image/1/201412/1419927656847908.jpg" width="100%"/></p><p style="white-space: normal;"><img src="http://www.vcivc.cn/data/upload/ueditor/image/1/201412/1419927657788707.jpg" width="100%"/></p><p style="white-space: normal;"><img src="http://www.vcivc.cn/data/upload/ueditor/image/1/201412/1419927691942735.png" width="100%"/></p><p style="white-space: normal;"><strong>优势与专长</strong></p><p style="white-space: normal;">创业团队具有共同的事业价值观，集智商、情商、财商为一身，优势互补的经营、管理、执行团队。</p><p style="white-space: normal;">战略规划方向正确、目标定位准确，高瞻远瞩，放眼未来。</p><p style="white-space: normal;">团队具有自我创新意识，对市场经济有正确的洞察力和判断力。</p><p style="white-space: normal;">商业模式科学、先进，竞争优势突出，盈利模式多元化，风险控制能力强。</p><p style="white-space: normal;">灵活机动的战略战术，资源整合合作能力强。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">&quot;无需抵押担保、仅仅凭借个人征信评级、信用管理等服务模式&quot;,成为目前小额民间借贷市场最大的竞争优势。&quot;银行不好贷款,即便贷到款,审批程序也极其复杂和漫长,货币紧缩后,低端小额贷款更是难上加难。&quot;</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">在P2P的个人信贷理财模式里,所有的借款都是信用借款,不需要实物抵押。由于不吸储也不放贷,而是将有理财需求的出借人和有资金需求的借款人&quot;配对&quot;,提供一个自然人之间的借贷交流平台,以之后向借款人收取服务费作为收入来源之一。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">P2P的信贷模式从长远看,还会不断吸引新的机构进来,随着这些成熟机构的进一步创新,还将演变成信托机构,架起城乡信用融资的桥梁。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;"><strong>行业与发展</strong></p><p style="white-space: normal;">所属行业： 资本市场服务</p><p style="white-space: normal;">今天电子商务不是一个技术，不是一个商业模式，它是一场革命，它是一个生活方式和工作方式的变革，它只是刚刚开始。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">最近统计数据显示， 2013年中国电子商务市场交易规模达10.2万亿元，同比2012年的8.5万亿元，增长29.9%。2014年一季度限额以上单位网上零售额815亿元，增长51.7%。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">国内网络借贷平台已有数百家，国外有26家。国内主要分布在长三角、珠三角及北京、天津等发达地区。借贷平台客户多达数百万之众，年交易额实现数百亿人民币，单日交易额实现数亿人民币。《温州金融改革实验区》确定了金融服务平台的合法地位。互联网借贷平台的发展趋势日益形成。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">网络借贷指在网上实现借贷，借入者和借出者均可利用这个网络平台，实现借贷的&quot;在线交易&quot;。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">2012年P2P网贷入选&quot;2012年中国年度创新成长企业100强&quot;中唯一入选的金融信息服务企业。</p><p style="white-space: normal;">&nbsp; &nbsp;</p><p style="white-space: normal;">长时段来看，互联网金融才大潮初起，难免泥沙俱下，但潮涨潮落，不改一浪高过一浪的发展趋势。当前的鱼龙杂混、良莠不齐的情况一定不会长期持续下去。P2P健康发展的前提可能是要经历一些风雨，淘汰一批经营不善的网贷公司，甚至要打击掉一批借着P2P平台进行违法犯罪活动的团伙。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">我们相信，经过洗牌之后，一些巨型的、有实力的网贷公司或许将兼并一些中小型网贷公司，并且专注做平台的P2P公司将引进和培育一批金融服务机构。</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;"><strong>产品服务</strong></p><p style="white-space: normal;">主营业务：自主研发电子商务交易平台、P2P借贷平台系统，为创业者和传统企业提供全方位、多选项的电子商务解决方案。在中国率先推出&quot;个人对个人（&quot;Peer to Peer&quot;或称&quot;P2P&quot;）的《信用借贷平台》及《共通积分（便利）兑换商城》、《供销商城》等创新型电子商务交易（B2B、B2C、C2C、C2B、O2O）商业模式优势于一体的综合服务平台。</p><p style="white-space: normal;">主要产品与服务：可定制型《P2P借贷平台系统》；电子商务交易平台系统《共通积分（便利）兑换商城》、《供销商城》。</p><p><br/></p>'),
(127, '<p>正在更新中。。。</p>'),
(128, '<p>常在河边走，哪儿能不湿鞋？”，对于经常开车的朋友们来说更是如此，正因如此汽车保险才成为我们热议的话题。汽车究竟该上什么保险？在哪儿上保险最划算？发生事故时该不该私了？如果你还不了解这些问题，那就一起看看关于汽车保险的那些事儿。</p><p>对于车险，其繁杂的条款的确让普通消费者犯晕，到底购买什么险种才有用？遇到什么情况保险公司不予赔付？</p><p><img style="margin: 0px; padding: 0px; width: auto !important; height: auto !important; color: rgb(43, 43, 43); line-height: 25px; text-indent: 28px; font-family: 宋体; white-space: normal; visibility: visible !important; -ms-word-wrap: break-word !important; box-sizing: border-box !important; background-color: rgb(245, 248, 253);" src="http://mmbiz.qpic.cn/mmbiz/mmAcIL4rGoYve0ciaIaXJXHnia20hIaKdPO0XcUoJibpLdltsDZDkyUdWeyS3RdnDcTxFm3Wkvb2TjiaJYj37sCY3w/640?wx_fmt=jpeg&wxfrom=5&wx_lazy=1" data-src="http://mmbiz.qpic.cn/mmbiz/mmAcIL4rGoYve0ciaIaXJXHnia20hIaKdPO0XcUoJibpLdltsDZDkyUdWeyS3RdnDcTxFm3Wkvb2TjiaJYj37sCY3w/0?wx_fmt=jpeg" data-s="300,640" data-type="jpeg" data-ratio="0.6666666666666666" data-w="441"/></p><p><br style="margin: 0px; padding: 0px; -ms-word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;"/></p><p>交强险</p><p>保监会规定必买险种，理赔中最先赔付，不够的那一部分由商业险补充，交强保额为122000.00元，其中2000.00元为物损，8000.00元为人伤，剩余112000.00元为死亡，这样拆开看就能看出很多人单买交强是错误的。</p><p>车损险</p><p>车子在行驶过程中(单车或两车或多车事故)，或是停放过程中受损都给予理赔，但是一般停放中受损只能索赔到70％(无事故现场的30％免赔)，所以有赔付不足的不要奇怪。</p><p>第三者责任险</p><p>在事故中有第三方受损给予赔付，赔付金额以发票等凭证为依据，当中被保险人被划分在第三者以外，所以如果被自己的车撞死了是得不到任何赔偿的。</p><p>不计免赔</p><p>通俗的讲就是全额赔付的意思，如果不买这个险一般保险公司只赔付80％，20%需自己支付，所以这个险可以不买。</p><p>玻璃单独破损险</p><p>这个险是针对小偷敲碎玻璃偷车里的东西，或是路上小石子打碎玻璃但车子其他未损，只有玻璃损坏时赔付玻璃的险种，但是这个险是没有不计免赔的。</p><p>盗抢险</p><p>车子被盗，被抢而受损，被盗一般有3个月的侦破期，过了3个月如果车子找不回来，保险公司赔付，有不计免赔。</p><p>划痕险</p><p>车子停放过程中车身被人恶意用尖锐的东西刻画受损，这个险保额分2000和5000元。</p><p>涉水险</p><p>不同的保险公司，对于涉水险的称谓也不尽相同，有的叫涉水险，而有的则称之为发动机特别损失险。目前，各家公司都已经有涉水险这一险种可供消费者选择，但是在选择这个险种的前提是，消费者必须在该公司同时上车损险。</p><p>涉水险所保险的项目就是针对发动机，如果发动机因为下雨、洪水、或者其它涉水情况，造成的发动机进水损坏，只要车主没有进行二次启动，涉水险都会进行全额赔付，当然，前提是车主已经购买不计免赔这一特殊项目。若车主在发动机因涉水而停工后，进行了二次启动，那么保险公司都是拒赔的，车主则必须承担所有维修费用。</p><p>自燃险</p><p>车子由于发动机过热、电线过热等车子自身原因导致车子的燃烧，予以赔付。</p><p>车上人员责任险</p><p>被保险车辆上的人员出事故是没有赔付的，但是买了这个险就可以获得赔偿了，也就是医疗什么的，保额分为每人10000、20000、50000元等，看情况自己选择。</p><p>报险时，车主需向保险公司说明时间、地点、以及出险情况，并且要获得保险公司提供的报案号！</p><p></p>'),
